INSERT INTO `blogs` (`id`, `type`, `uid`, `title`, `image`, `date`, `desc`, `slug`, `is_deleted`, `created_at`, `updated_at`) VALUES
(1, 'Hospital', 6, 'Blog Title -  new', 'd-670101657439520.png', '2022-07-23', '<p>This is blog info</p><p>updted</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 'blog-title', '0', '2022-07-10 02:22:00', '2022-07-10 02:23:34'),
(2, 'Doctor', 35, 'NOT ALL PATIENTS OF SPINE PROBLEMS REQUIRE SURGERY', 'd-944931681537835.png', '2023-04-15', '<p>SPINE PROBLEMS ARE INCREASING IN THE POPULATION.</p><p>&nbsp;EVERY OTHER PERSON IS SUFFERING FROM EITHER NECK PAIN OR BACKACHE,.</p><p>USUALLY IT IS POSTURAL BUT AT TIMES CAN BE DUE TO OTHER SERIOUS DISEASES.</p><p>TIMELY EVALUATION CAN HELP IN EARLY DIAGNOSIS AND TREATMENT OF SERIOUS SPINAL DISEASES</p><p>NOT ALL CASES OF SPINE PROBLEMS NEED SURGERY. EARLY DETECTION AND ADEQUATE TREATMENT OF SPINE DISEASE MAY HELP IN AVOIDING NEED OF SURGERY.</p><p>&nbsp;</p>', 'not-all-patients-of-spine-problems-require-surgery', '0', '2023-04-15 00:20:35', '2023-04-15 00:20:35'),
(3, 'Doctor', 1, 'NOT ALL PATIENT OF BACKACHE REQUIRE SURGERY', 'd-417501681556962.jpeg', '2023-04-15', '<p>BACKACHE IS A COMMON PROBLEM SEEN IN POPULATION NOW A DAYS</p><p>MOSTLY IT IS DUE TO ABNORMAL POSTURES</p><p>BUT AT TIME CAN BE DUE TO SERIOUS DISEASES</p><p>EARLY EVALUATION AND TREATMENT CAN HELP IN AVOIDING SPINE SURGERY.</p>', 'not-all-patient-of-backache-require-surgery', '0', '2023-04-15 05:39:22', '2023-04-15 05:39:22'),
(4, 'Doctor', 42, 'KNEE REPLACEMENT - A SECOND INNINGS AT MOBILITY', 'd-348691683012900.jpeg', '2023-05-02', '<p>Advanced and hi tech equipment have enabled a high precision knee replacement surgeries a reality. It provides pain relief, better range of movement and gives a second innings to enjoy life.</p>', 'knee-replacement-a-second-innings-at-mobility', '0', '2023-05-02 02:05:00', '2023-05-02 02:05:00'),
(5, 'Doctor', 63, 'safe and precise knee surgery provides a second innings at life', 'd-560451687878862.jpeg', '2023-06-27', '<p>advanced and precise surgery now a days is safe with navigation systems to assist in surgery and excellent implants for longer viability provides the elderly population a second innings to enjoy life</p>', 'safe-and-precise-knee-surgery-provides-a-second-innings-at-life', '0', '2023-06-27 09:44:22', '2023-06-27 09:44:22'),
(6, 'Doctor', 66, 'Hi tech advanced hip replacement surgery relieves the curse of avascular necrosis', 'd-323051688141541.jpeg', '2023-06-30', '<p>Hip replacement surgery now a days are Hi tech and advanced. It relives the patients from pain and suffering. It relieves one from the curse of avascular necrosis</p>', 'hi-tech-advanced-hip-replacement-surgery-relieves-the-curse-of-avascular-necrosis', '0', '2023-06-30 10:42:21', '2023-06-30 10:42:21'),
(7, 'Doctor', 78, 'JUST 30 MINUTES DAILY AT EXERCISE CAN KEEP YOUR HEART HEALTHY', 'd-304801688370423.png', '2023-07-03', '<p>A regular exercise, just for 30 minutes daily, is sufficient to keep your heart healthy. Routine exercise decreases blood cholesterol levels, helps in control of blood pressure, prevents atherosclerosis (blocking of blood vessels). It prevents coronary artery diseases and stroke.</p>', 'just-30-minutes-daily-at-exercise-can-keep-your-heart-healthy', '0', '2023-07-03 02:17:03', '2023-07-03 02:17:03'),
(8, 'Doctor', 106, 'STOP 3 \'S\' TO KEEP YOUR HEART HEALTHY', 'd-923461690201362.png', '2023-07-23', '<p>Heart ailments are on the rise in population. Rapidly changing culture with changes in life style, habits, work and work related environment are some of the factors contributing to it. A healthy heart can be maintained by stopping 3 \'S\' - SMOKING, STRESS AND SEDENTARY LIFESTYLE.</p>', 'stop-3-s-to-keep-your-heart-healthy', '0', '2023-07-24 06:52:42', '2023-07-24 06:52:42'),
(9, 'Doctor', 111, 'BARIATRIC SURGERY: A SAFE TREATMENT FOR OBESITY', 'd-407391690447946.jpeg', '2023-07-28', '<p>Bariatric surgery remains the only effective and enduring treatment for morbid obesity. Exercise and diet alone often fails to effectively treat people with extreme and excessive obesity. Bariatric surgery is an operation that is performed in order to help such individuals lose weight. Bariatric surgery may lower death rates for patients with severe obesity, especially when coupled with healthy eating and lifestyle changes after surgery.Bariatric surgery is designed to alter or interrupt this digestion process so that food is not broken down and absorbed in the usual way. A reduction in the amount of nutrients and calories absorbed enables patients to lose weight and decrease their risk for obesity-related health risks or disorders.</p>', 'bariatric-surgery-a-safe-treatment-for-obesity', '0', '2023-07-27 03:22:26', '2023-07-27 03:22:26'),
