(24, 'Doctor', 148, 'Epilepsy : Myths and Superstition', 'd-698111701423236.jpeg', '2023-12-01', '<p>Epilepsy is a treatable chronic neurological disorder which is often linked to supernatural activities, due to lack of knowledge and awareness among the common people. &nbsp;The beliefs that outbreak of epilepsy as an unnatural or supernatural activities can be most frequently seen in rural population. One cannot say that the perception of urban populace is different from that of rural populace, but yes, they do differ at some extent.</p><p>Around 0.5% of the world is bearing the burden of the disease. As per a 2018 Indian study, 70 million people have epilepsy worldwide and nearly 12 million Indians suffer from the condition. More than 85% of epilepsy cases are reported in low‑income countries like India. About 95% of the epileptic patients are not able to get the adequate treatment either due to the lack of medical facilities or due to the unawareness about the disease treatment.&nbsp;</p><p>Epilepsy has been a part of social stigma in India because of which people are stuck to superstitious beliefs. They would rather prefer approaching faith healer, shamans’, black magic practitioners, and exorcists instead of an expert physician/ neurophysician. Although the facility of modern medicine is available almost in every part of the country, only 60% of the patients from urban areas and 10% patients from the rural areas approach clinicians for their treatment and rest of the patients undergoes spiritual and witchcraft practices.&nbsp;</p><p>Epilepsy is considered as a curse of bad evils, and thus, the epileptic patients are abandoned and discriminated from the society. Epileptic patients and their families undergo pressure of social fear, misunderstanding, social discrimination and dishonor, disturbed personal and professional life. The major factor driving superstitious beliefs regarding epilepsy are illiteracy, low standard of life, socioeconomic backwardness, treatment gap, religious dogma ruling the mind of the people, and lack of proper medical facilities.</p><p>let’s steer clear some of the common myths and misconceptions about the condition.</p><p>&nbsp;</p><p><strong>Myth #1:</strong> Epilepsy is a curse of God</p><p><strong>Fact:</strong> Epilepsy is NOT due to being possessed by an evil spirit, nor is it due to any supernatural powers or a curse/wrath of God. In fact, just like diabetes and depression, it is a clinical condition that needs treatment. It is a neurological condition which affects the brain and can lead to epileptic seizures.</p><p>&nbsp;</p><p><strong>Myth #2:</strong> Epilepsy is contagious</p><p><strong>Fact:</strong> You cannot get epilepsy if you come in contact with an epileptic person, so it is NOT a contagious disease. Most people also believe that epilepsy can spread by sharing utensils or by contact of saliva, which is not true. Hence, the next time you spot a person suffering an attack, do not refrain from helping his because of the fear that it can spread by touching the person.</p><p>&nbsp;</p><p><strong>Myth #3:</strong> People with epilepsy are mentally ill</p><p><strong>Fact:</strong> NO, epilepsy is not a mental illness. It is associated with mood problems like anxiety and depression. In a majority of cases, it doesn’t lead to mental health problems. But saying that a person with epilepsy is mad is just wrong.</p><p>&nbsp;</p><p><strong>Myth #4:</strong> Use of an onion or keys can terminate an ongoing epileptic attack.</p><p><strong>Fact:</strong> The is a big NO. Most people believe that placing a metal key in the hands of a person having an attack or making the person smell onions or dirty socks during an attack can stop the attack. However, epileptic patients and their families should not fall prey to such irrational beliefs.</p><p>&nbsp;</p><p><strong>Myth #5:</strong> During a seizure, you swallow your tongue.</p><p><strong>Fact:</strong> Bear in mind that the human tongue cannot be swallowed. However, one can bite their tongue leading to an injury or the tongue may roll back leading to an airway obstruction and respiratory distress during a seizure. Hence, if a person is having an attack, you can put a cloth in the mouth and make them lie in the recovery position (sideways) to avoid getting injured.</p><p>&nbsp;</p><p><strong>Myth #6:</strong> You should restrain the person having a seizure.</p><p><strong>Fact:</strong> During an epileptic attack, you should never hold a person down but let the seizure run its course. Moreover, you should not force something in their mouth when having an attack.</p><p>&nbsp;</p><p><strong>Myth #7:</strong> People with epilepsy can’t work or lead normal lives.</p><p><strong>Fact:</strong> Except for children who are born with mental disabilities, people with epilepsy have normal intelligence and functional abilities at par with others. Moreover, they can lead normal lives with proper medication and treatment. It is a misconception that they are dull, cannot have children or fail to excel at school and work.</p><p>&nbsp;</p><p>Epilepsy is no more a serious disorder, but still, in most parts of our country, it is thought to be untreatable.&nbsp;</p>', 'epilepsy-myths-and-myths', '0', '2023-12-01 04:03:56', '2023-12-01 04:04:33'),
(25, 'Doctor', 149, 'Alcohol and Health: The Good, the Bad, and the Ugly', 'd-963981701520037.jpeg', '2023-12-03', '<h2><strong>No level of alcohol consumption is safe for our health</strong></h2><p>The risks and harms associated with drinking alcohol have been systematically evaluated over the years and are well documented. The World Health Organization has now published a statement in The Lancet Public Health: when it comes to alcohol consumption, there is no safe amount that does not affect health.</p><h3><strong>It is the alcohol that causes harm, not the beverage</strong></h3><p>Alcohol is a toxic, psychoactive, and dependence-producing substance and has been classified as a Group 1 carcinogen by the International Agency for Research on Cancer decades ago – this is the highest risk group, which also includes asbestos, radiation and tobacco. Alcohol causes at least seven types of cancer, including the most common cancer types, such as bowel cancer and female breast cancer. Ethanol (alcohol) causes cancer through biological mechanisms as the compound breaks down in the body, which means that any beverage containing alcohol, regardless of its price and quality, poses a risk of developing cancer.</p><h3>Short-Term Health Risks</h3><p>Excessive alcohol use has immediate effects that increase the risk of many harmful health conditions. These are most often the result of binge drinking and include the following:</p><ul><li>Injuries, such as <a href=\"https://www.cdc.gov/transportationsafety/impaired_driving/index.html\">motor vehicle crashes</a>, falls, drownings, and burns.</li><li>Violence, including homicide, suicide, sexual assault, and intimate partner violence.</li><li>Alcohol poisoning, a medical emergency that results from high blood alcohol levels.</li><li>Risky sexual behaviors, including unprotected sex or sex with multiple partners. These behaviors can result in unintended pregnancy or sexually transmitted diseases, including HIV.</li><li>Miscarriage and stillbirth or <a href=\"http://www.cdc.gov/ncbddd/fasd/index.html\">fetal alcohol spectrum disorders (FASDs)</a> among pregnant women.</li></ul><h3>Long-Term Health Risks</h3><p>Over time, excessive alcohol use can lead to the development of chronic diseases and other serious problems including:</p><ul><li>High blood pressure, heart disease, stroke, liver disease, and digestive problems</li><li><a href=\"https://www.cdc.gov/cancer/alcohol/index.htm\">Cancer</a> of the breast, mouth, throat, esophagus, voice box, liver, colon, and rectum.</li><li>Weakening of the immune system, increasing the chances of getting sick.</li><li>Learning and memory problems, including dementia and poor school performance.</li><li>Mental health problems, including depression and anxiety.</li><li>Social problems, including family problems, job-related problems, and unemployment.</li><li>Alcohol use disorders, or alcohol dependence.</li></ul><p>By not drinking too much, you can reduce the risk of these short- and long-term health risks.</p>', 'alcohol-and-health-the-good-the-bad-and-the-ugly', '0', '2023-12-02 06:57:17', '2023-12-02 06:57:17'),
(26, 'Doctor', 149, 'Alcohol and Health: The Good, the Bad, and the Ugly', 'd-943891701520037.jpeg', '2023-12-03', '<h2><strong>No level of alcohol consumption is safe for our health</strong></h2><p>The risks and harms associated with drinking alcohol have been systematically evaluated over the years and are well documented. The World Health Organization has now published a statement in The Lancet Public Health: when it comes to alcohol consumption, there is no safe amount that does not affect health.</p><h3><strong>It is the alcohol that causes harm, not the beverage</strong></h3><p>Alcohol is a toxic, psychoactive, and dependence-producing substance and has been classified as a Group 1 carcinogen by the International Agency for Research on Cancer decades ago – this is the highest risk group, which also includes asbestos, radiation and tobacco. Alcohol causes at least seven types of cancer, including the most common cancer types, such as bowel cancer and female breast cancer. Ethanol (alcohol) causes cancer through biological mechanisms as the compound breaks down in the body, which means that any beverage containing alcohol, regardless of its price and quality, poses a risk of developing cancer.</p><h3>Short-Term Health Risks</h3><p>Excessive alcohol use has immediate effects that increase the risk of many harmful health conditions. These are most often the result of binge drinking and include the following:</p><ul><li>Injuries, such as <a href=\"https://www.cdc.gov/transportationsafety/impaired_driving/index.html\">motor vehicle crashes</a>, falls, drownings, and burns.</li><li>Violence, including homicide, suicide, sexual assault, and intimate partner violence.</li><li>Alcohol poisoning, a medical emergency that results from high blood alcohol levels.</li><li>Risky sexual behaviors, including unprotected sex or sex with multiple partners. These behaviors can result in unintended pregnancy or sexually transmitted diseases, including HIV.</li><li>Miscarriage and stillbirth or <a href=\"http://www.cdc.gov/ncbddd/fasd/index.html\">fetal alcohol spectrum disorders (FASDs)</a> among pregnant women.</li></ul><h3>Long-Term Health Risks</h3><p>Over time, excessive alcohol use can lead to the development of chronic diseases and other serious problems including:</p><ul><li>High blood pressure, heart disease, stroke, liver disease, and digestive problems</li><li><a href=\"https://www.cdc.gov/cancer/alcohol/index.htm\">Cancer</a> of the breast, mouth, throat, esophagus, voice box, liver, colon, and rectum.</li><li>Weakening of the immune system, increasing the chances of getting sick.</li><li>Learning and memory problems, including dementia and poor school performance.</li><li>Mental health problems, including depression and anxiety.</li><li>Social problems, including family problems, job-related problems, and unemployment.</li><li>Alcohol use disorders, or alcohol dependence.</li></ul><p>By not drinking too much, you can reduce the risk of these short- and long-term health risks.</p>', 'alcohol-and-health-the-good-the-bad-and-the-ugly-1', '0', '2023-12-02 06:57:17', '2023-12-02 06:57:17'),
(27, 'Doctor', 151, 'How to prevent Hernia', 'd-125661701755207.jpeg', '2023-12-06', '<p>A&nbsp;<a href=\"https://www.nychernia.com/for-patients/what-is-your-hernia-diagnosis/\">hernia</a>&nbsp;is when tissue, such as from an organ, bulges through or pushes on a weakened portion of muscle or fascia. Though they can happen anywhere on the body, they typically are found in the abdomen and groin areas.</p><p>Hernias can be incredibly painful and cause you pain to the point of impeding your daily routine. Therefore, doing what you can to prevent a hernia is beneficial to know and practice. Here are ways to help reduce the risk of developing a hernia.</p><h2><strong>Exercise</strong></h2><p>A weakness of the muscles can lead to a hernia. By strengthening your muscles, primarily the abdominal wall and the groin, you may prevent the bulging associated with a hernia. However, not all exercise can directly help strengthen your muscles. For example, while running can be a fantastic exercise, it may not develop your muscles enough to prevent tissue from breaking through an opening.</p><p>Resistance training and dedicated strength training may be what you need. Although, it should be noted that strenuous activity can also lead to developing a hernia, so make sure you take a measured approach. Always visit a doctor for a checkup before engaging in an exercise program to determine your fitness and any preexisting conditions.</p><h2><strong>Losing Weight</strong></h2><p>Obesity can place significant pressure on your muscles, weakening them in the long-term. This weakening can leave you susceptible to developing hernias. Keeping your weight in a healthy range can reduce the risk of hernias and bring you many overall health benefits.</p><h2><strong>Seeking Prompt Medical Treatment</strong></h2><p>Certain ailments and illnesses can lead to an increased risk of hernia development. Chronic coughing, for example, can lead to excess intra-abdominal pressure, which may weaken the abdominal wall. Making sure you get treated promptly can help mitigate secondary conditions from developing.</p>', 'how-to-prevent-hernia', '0', '2023-12-05 00:16:47', '2023-12-05 00:16:47');
