(2, '25', 'Hospital Wheelchair', 'medisys', 'd-388401682582294.jpeg', '', '', '', '<p><strong>Details :</strong></p><figure class=\"table\"><table><tbody><tr><td>Brand</td><td>Medisys</td></tr><tr><td>Item Weight</td><td>18 Kilograms</td></tr><tr><td>Style</td><td>Mag Wheels</td></tr><tr><td>Item Dimensions LxWxH</td><td>104 x 22 x 87 Centimeters</td></tr><tr><td>Material</td><td>Metal</td></tr><tr><td>Seat Width</td><td>18 Inches</td></tr><tr><td>Wheel Size</td><td>24 Inches</td></tr><tr><td>Maximum Weight Recommendation</td><td>100 Kilograms</td></tr><tr><td>Wheel Type</td><td>Mag Wheel</td></tr><tr><td>Product Dimensions</td><td>66D x 104W x 88H Centimeters</td></tr></tbody></table></figure><p>&nbsp;</p><ul><li>DURABLE FRAME: Medisys wheelchair is made of heavy-duty steel for rigorous use. Steel frame adds extra durability and stability to the chair while the MS powder coating ensures extra strength, longevity, and resistance from corrosion. The steel frame provides a high load-bearing capability up to 100 kgs.</li><li>COMFORTABLE REXINE UPHOLSTERY SEAT: Wheel chair seats are made using rexine upholstery with heavy-duty inner liners to keep the seat and back from stretching. 18\" seating area provides relief and includes an adjustable safety belt for added security.</li><li>HIGH QUALITY WHEEL CHAIR: The wheelchair comprises superior quality rust-free mag wheels which increases the life span of this chair. The 24 inch rear wheels are for self manoeuvring while the solid PVC front casters swivel at 360° to improve the wheel chairs movements.</li><li>PROPELLING OPTIONS: This wheelchair can be used interchangeably as self-propelled wheelchair or attendant wheelchair. While users of this type of chair will generally push themselves, the handles mean it is possible for a caregiver or attendant to push the chair if required. This provides greater flexibility to users.</li><li>ERGONOMICALLY FOLDING DESIGN: The foldable wheelchair can folds flat for convenient storage and travel. Our folding wheelchair for old people make independent mobility easy via specialized features like soft padded armrests, storage pocket, rexine upholstery etc.</li><li>Net Weight of wheelchair: 18 kgs(approx)</li></ul><p>&nbsp;</p>', 5500.00, 10, 200, '1', 200.00, 4000, 200, '1', 'bawana, new delhi', 2, '1', '1', '0', '2023-04-27 02:28:14', '2023-05-02 12:04:02'),
(3, '25', 'Function Electric Bed', 'medisys', 'd-290751682583082.png', '', '', '', '<p><strong>Details :</strong></p><p>1. Advance Linear Actuator Systems.</p><p>2. Detachable head and foot panels with corner buffers, ABS materials.</p><p>3.Four-section bedplate with ventilated holes for adequate airflow (Perforated CRCA 1.2mm M.S Sheet with 3 6 Embosses Holes).</p><p>4. Collapsible Safety Side Railings, one touch to lay down.</p><p>5. Covered 125mm Castors with breaks</p><p>6. Frame made of 25mm dia M.S tubes.</p><p>7. Provision of Urine bag holder and IV rod.</p><p>8. Finish pre treated &amp; epoxy powder coated.</p><p>9. Dimension – 2185 mm x 980 mm</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 8500.00, 5, 300, '1', 250.00, 5000, 300, '0', 'bawana, new delhi', 3, '1', '1', '0', '2023-04-27 02:41:07', '2023-05-02 12:04:12'),
(4, '25', 'Medisys Double Bottle Suction Machine', 'medisys', 'd-291631682583642.jpeg', '', '', '', '<p><strong>Details :</strong></p><ul><li>Input Power : AC 220 V @ 50 Hz, 180 VA</li><li>Pumping Capacity : 20 LPM</li><li>Maximum Negative Pressure : 90 kPa</li><li>Operating Noise : &lt; 65 dB</li><li>Jar Capacity : 2.5 L X 2</li></ul><p><br>&nbsp;</p><figure class=\"table\"><table><tbody><tr><th>Brand</th><td>‎medisys</td></tr><tr><th>Manufacturer</th><td>medisys</td></tr><tr><th>Country of Origin</th><td>‎india</td></tr><tr><th>Item Weight</th><td>‎14 kg</td></tr><tr><th>Product Dimensions</th><td>‎40 x 35 x 50 cm; 14 Kilograms</td></tr><tr><th>Item Height</th><td>‎50 Centimeters</td></tr><tr><th>Item Width</th><td>‎35 Centimeters</td></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p>', 6000.00, 10, 200, '1', 200.00, 4000, 200, '0', 'bawana, new delhi', 4, '0', '1', '0', '2023-04-27 02:50:42', '2023-04-27 02:50:42'),
(5, '26', 'Wecare Premium Imported 2-Way Adjustable Hospital Bed with Side Rails', 'Wecare', '', '', '', '', '<p><strong>Details :</strong></p><p>&nbsp;</p><ul><li>2 CLASSIC FUNCTIONS: The bed for bedridden patients elevates 80 degrees and supports leg elevation upto 40 degrees. With these functions, the patient can be positioned in Fowler’s, semi-Fowler’s, high-Fowler’s, and standard chair positions. Fowler Bed with mechanically operated back rest and knee rest by super-smooth crank mechanism.</li><li>ALUMINUM COLLAPSIBLE GUARD RAILS - Easily swing the bed rail down and out of the way when not in use. Simply, press the red button to collapse the bed railing. This is very convenient to the users wanting to get out of the bed. The sturdy frame ensures a weight capacity of upto 175 kgs.</li><li>COMPATIBLE WITH ALL HOSPITAL BED MATTRESSES: Any standard size hospital mattress will fit this frame. Whether you want to use a foam, spring or alternating pressure air mattress or specialized CNC cut anti-decubitus foam mattress, this frame will be perfect.</li><li>5\" SWIVEL CASTORS : The Hospital Bed for patients features 5 inch aluminum caster wheels and brake pedals, which allow for ease of movement, even on carpeted surfaces. These features allow the bed to be easily moved on various surfaces within your home or facility.</li><li>DETACHABLE ABS HEAD &amp; FOOT BOARDS : The head rest &amp; foot rest offered comes in durable ABS material finish and provides for enhanced interior safety support as well as add to the decor needs of the surrounding decor. The bed is also suitable for patients who need CPR as the foot/head board is detachable.</li></ul><p>&nbsp;</p><p>&nbsp;</p>', 15000.00, 10, 300, '1', 400.00, 12000, 300, '1', 'Bhuna, hisar, haryana', 3, '0', '1', '0', '2023-04-27 08:09:38', '2023-04-27 08:09:38'),
