(9, '54', 'PMPS Low Height Semi Fowler Regular Bed With Side Guard Railing For Bed Ridden, Sick, Old Aged Patients - DIY (Self Assembling Required)', 'PMPS', 'd-240931686391667.jpeg', 'd-621801686391667.jpeg', 'd-869921686391667.jpeg', 'd-560481686391667.jpeg', '<p><strong>Details :</strong></p><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td>Brand</td><td>P.M.P.S.</td></tr><tr><td>Size</td><td>78x36x18 inches</td></tr><tr><td>Assembly Required</td><td>Yes</td></tr><tr><td>Item Dimensions LxWxH</td><td>198.1 x 91.4 x 45.7 Centimeters</td></tr></tbody></table></figure><ul><li>dimension- 78x36x18 inches (LXWXH)</li><li>function- head side elevation present</li><li>acessories- both side ms guard railing ( drop down in position )</li><li>material- pretreated epoxy coated mild steel with ivory color</li><li>assembling - only basix screw fixing required (no technical skill required ,no special tool required )</li></ul><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 24999.00, 10, 300, '1', 400.00, 22000, 300, '1', 'Jhumri talaiya, U.P', 3, '1', '1', '0', '2023-06-10 04:37:47', '2023-06-10 04:37:47'),
(10, '54', 'Medinain Electric 7A-25D Trolley Suction Machine', 'medinain', 'd-602141686391949.jpeg', 'd-116001686391949.jpeg', 'd-697161686399603.jpeg', 'd-863491686399603.jpeg', '<p><strong>Details :</strong></p><ul><li>Electrical appliance safety requirement: Class I, Type B</li><li>Not suitable for continuous use in the induced abortions and for the inflammable or explodable surroundings. Max continuous working time is 30 minutes, continuity rate: 50%</li><li>Reservoir capacity: 2500mL/pc, 2pieces</li><li>Pumping rate: ≥20L/min</li><li>Noise:≤ 65 dB (A), Power: ≤180VA</li></ul><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 18001.00, 10, 150, '1', 200.00, 15000, 200, '0', 'bawana, new delhi', 4, '1', '1', '0', '2023-06-10 04:42:29', '2023-06-10 06:50:03'),
(11, '89', 'Oxymed Mini (5L) Oxygen Concentrator', 'Oxymed', 'd-222871689153686.jpeg', 'd-487961689153686.jpeg', 'd-874371689153686.jpeg', 'd-995731689153686.jpeg', '<p><strong>Details :</strong></p><p>Oxymed Mini 5 LPM is one of the most popular names in the Indian oxygen concentrator market as it has the largest dealer network in India with over 40 service centres. This machine delivers oxygen at the flow rate of 0.5-5 LPM with a purity level of more than 90% at all flow rates.</p><p><strong>Smallest Home Oxygen Concentrator:</strong> Weighing just 13.9 Kgs, Oxymed Mini is the second lightest oxygen concentrator in the market. Its compact design ensures that the machine could be easily shifted from one location to another.</p><p><strong>Sound</strong>: Oxymed Mini Oxygen Concentrator emits sound at 45 dB.</p><p><strong>Power Consumption: </strong>The machine consumes 390 watts of power.</p><p><strong>Digital Flow Meter:</strong> The device comes with a digital flow regulator through which flow rate can be increased or decreased at the intervals of 0.5 LPM using the  /- buttons.&nbsp;</p><p><strong>Oxygen Purity Analyzer:</strong> Oxymed Mini comes with an inbuilt oxygen purity analyzer through which users can get to know the oxygen purity level that is being delivered in real-time.&nbsp;</p><p><strong>Operating Altitude: </strong>Operating altitude of Oxymed Mini is 7500 feet.</p><p><strong>Outlet Pressure: </strong>The outlet pressure of the device is 10 psi.</p><p><strong>User-Friendly Folding Screen Display:</strong> The digital screen of Oxygen Mini shows the current flow rate, oxygen purity, timer and hour meter.&nbsp;</p><p><strong>Warranty:</strong> The warranty period of Oxymed Mini oxygen concentrator is 3 years.</p><p><strong>Certifications: </strong>The machine is CE certified.</p><p><strong>Additional Features:</strong></p><ul><li>Oxymed mini has an in-built nebulizer</li><li>The machine comes with a digital as well as a rotating ball-type flow meter.</li><li>There are locks on its front wheels which prevent the machine from slipping on the smooth floor.&nbsp;</li><li>The Oxymed Company provides home installation services in almost 50 cities across India.</li></ul><h2>What\'s in the Box?</h2><p>Oxymed Oxygen concentrator</p><p>Humidifier Bottle</p><p>User manual</p><p>Nasal cannula</p><p>Nebulizer Kit</p><p>Additional filter set</p><ul><li>Power Cable</li></ul><h3>Technical details</h3><figure class=\"table\"><table><tbody><tr><td>Purity</td><td>90-96%</td></tr><tr><td>Type</td><td>Home Stationary</td></tr><tr><td>Continuous Flow</td><td>1-5LPM</td></tr><tr><td>Weight</td><td>13.9kg</td></tr><tr><td>Oxygen Purity Indicator (OPI)</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>Power consumption</td><td>390watts</td></tr><tr><td>Sound level</td><td>45db</td></tr><tr><td>Dimensions</td><td>20.27H x 12.36W x 9.4Dinch</td></tr><tr><td>Operating altitude</td><td>7500feet</td></tr><tr><td>Outlet pressure</td><td>10psi</td></tr></tbody></table></figure><h3>Additional details</h3><figure class=\"table\"><table><tbody><tr><td>Oxygen Purity % Analyzer</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>Loss of Power Alarm</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>System Malfunction Alarm</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>No Flow Alarm</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>Indian Voltage Model</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>Company Headquarters</td><td>India</td></tr><tr><td>US FDA Approved</td><td>-</td></tr><tr><td>FAA Approved</td><td>-</td></tr><tr><td>CE Certified</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p>', 0.00, 0, 0, '1', 1100.00, 30000, 300, '1', 'india', 5, '1', '1', '0', '2023-07-12 03:51:26', '2023-10-08 10:55:05'),
(12, '89', 'Resmed AirCurve 10 VAuto BIPAP – Tripack', 'Resmed', 'd-194451689156120.jpeg', 'd-648121689156120.jpeg', 'd-184501689156120.jpeg', 'd-441791689156120.jpeg', '<p><strong>Details :</strong></p><p>Resmed AirCurve™ 10 VAuto BIPAP – Tripack is an auto BIPAP machine used for sleep apnea. Auto BIPAP is better compared to Auto CPAP devices as in Auto BIPAP the exhalation pressure is also controlled automatically by the machine which allow more comfort to users.</p><p>The AirCurve 10 VAuto comes with 4G connectivity support which enables you to monitor your apnea reports directly on the phone through MyAir Mobile App.</p><p><br>Resmed AirCurve™ 10 VAuto BIPAP – Tripack Key Features:</p><ul><li><strong>Easy-Breathe technology </strong>The Easy-Breathe pressure waveform mimics the wave shape of normal breathing and replicates it for your breathing comfort.</li><li><strong>Climate Control </strong>With the new integrated humidifier -HumidAir, you can enjoy the benefits of humidification in one easy-to-use system. And with the Climatelineair heated tube, your device has been designed to automatically deliver the optimal temperature and humidity, for the ultimate comfort experience.</li><li><strong>Continuous leak management</strong>&nbsp;enables reliable delivery of therapy pressure while maintaining patient-device synchrony.</li><li><strong>Compatible with up to 15 L/min of supplemental oxygen</strong>&nbsp;in S and CPAP mode and 4 L/min in VAuto mode.</li><li><strong>The built-in ambient light sensor</strong>&nbsp;adjusts to the brightness of the room. So if you need to get up during the night, the screen’s back light won’t disrupt your bed partner. The light also turns off automatically, so you can settle back to sleep without disturbance.</li></ul><p>Resmed AirCurve™ 10 VAuto BIPAP – Tripack Box Contents:</p><ul><li>Device with&nbsp;Humidair integrated humidifier</li><li>Water tub</li><li>Climatelineair heated tube</li><li>Power supply unit</li><li>Filters</li><li>Travel bag</li><li>SD card (already inserted)</li></ul><h3>Additional information</h3><figure class=\"table\"><table><tbody><tr><th>Warranty</th><td>2 Years</td></tr></tbody></table></figure><p><br>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 79990.00, 20, 300, '1', 1800.00, 55000, 300, '1', 'united states', 7, '1', '1', '0', '2023-07-12 04:32:00', '2023-07-13 01:40:33'),
(13, '89', 'Everyday Foldable Wheelchair', 'everyday', 'd-632921689156674.jpeg', 'd-246261689156674.jpeg', 'd-504981689156674.jpeg', 'd-78821689156674.jpeg', '<p>&nbsp;</p><p><strong>Details :</strong></p><p><br>Brand: Everyday<br>Colour: Black<br>Style: Regular Mobility Wheelchair - Black<br>Item Dimensions LxWxH: 102 x 64 x 89 Centimeters<br>Material: Metal</p><h2>About this item</h2><ul><li>A Reliable Everyday Transit Wheelchair: Best in class Quality, Spare Part availability, Excellent Customer Support, and is Made in India. It is the most Reliable and Trustworthy Everyday Foldable Wheelchair.</li><li>Sturdy X frame Folding Mechanism: Easy to use, heavy-duty, crisp folding action. Black Powder Coated Mild Steel Chassis: Prevents excessive wear and gives long-lasting use. Maximum Weight Handling Capacity: 100 kg.</li><li>Comfortable seating and armrests: Comfortable sitting and arm support. Soft rubber handles for a smooth grip.</li><li>High-Quality Rexine Backrest Supports the spinal cord and helps in maintaining a steady back posture. Backpocket for keeping essentials</li><li>·&nbsp;Bigger Rear Wheels with Dual Braking Mechanism: Easy movability with bigger 23 Inch Flat Free mag wheels. 7-inch Front Castor Wheels help you clear obstacles easily. &amp; Seat belt for Extra Safety: This wheelchair comes with an adjustable buckle-type seat that enhances the safety of the person who is sitting on the chair. Specifically useful for patients who cannot control their body movements properly. WARRANTY: 3 Months</li></ul><h2>Technical Details</h2><figure class=\"table\"><table><tbody><tr><th>Manufacturer</th><td>Everyday</td></tr><tr><th>Country of Origin</th><td>‎India</td></tr><tr><th>Item model number</th><td>NHG1O987</td></tr><tr><th>Product Dimensions</th><td>‎102 x 64 x 89 cm; 19.2 Kilograms</td></tr><tr><th>ASIN</th><td>FGG78UFT67T76R56E5E</td></tr></tbody></table></figure><figure class=\"table\"><table><tbody><tr><th>Manufacturer</th><td>Everyday</td></tr><tr><th