(14, '89', 'sumi manual Semi Fowler Bed for Patients', 'sumi', 'd-754091689164989.jpeg', 'd-737801689164989.jpeg', '', '', '<p><strong>Details :</strong></p><figure class=\"table\"><table><tbody><tr><td>Colour</td><td>Blue, white</td></tr><tr><td>Brand</td><td>Generic</td></tr><tr><td>Size</td><td>Large</td></tr></tbody></table></figure><p>One Function Manual Hospital Bed with adjustments helpful for patients in hospital, clinic or home<br>Size (L×W×H): 2100 mm; 900; 500 mm approximately<br>Backrest adjustment manually with single crank mechanism<br>Head &amp; Leg Bows set made of Polypropylene (set of 2) and Aluminium collapsible side railings with locking system (set of 2)<br>Aluminium collapsible side railings with locking system<br>With Castors with break, with out break<br>With 32 density 3” Mattress with Good quality of Rexene and Pillow</p><h2>Technical Details</h2><figure class=\"table\"><table><tbody><tr><th>Manufacturer</th><td>sumi</td></tr><tr><th>Country of Origin</th><td>‎India</td></tr><tr><th>Item part number</th><td>54444</td></tr><tr><th>ASIN</th><td>gggug7655555</td></tr></tbody></table></figure><p>&nbsp;</p><p>Manual Fowler Bed for Patients Two Function with Mattress Established in 2006, sumi is one of the best quality manufacturers / Suppliers of Modular OT (Operation Theater Setup ), Hospital Furnitures, Medical Equipments, Hospital Equipments, Surgical Instruments for all departments, Hospital Wares, Curtains Partitions Uniforms and Home Medical beds. We follow the highest quality assurance system so that we provide the highest quality products to our customers. Made in India. The Home Medical beds are specifically designed keeping the patient in mind. They are available in 1 function, 3 functions and 5 functions that are either manually operated or motorized. Please check the available options before making a purchase decision.</p>', 30000.00, 30, 300, '1', 700.00, 15000, 300, '0', 'bawana, new delhi', 3, '0', '1', '0', '2023-07-12 06:59:49',