(17, '138', 'Medinain Electric 7A-25D Trolley Suction Machine', 'Medinain', 'd-773581700977307.jpeg', 'd-963521700977307.jpeg', 'd-752841700977307.jpeg', 'd-53591700977307.jpeg', '<p><strong>Details :</strong></p><ul><li>Electrical appliance safety requirement: Class I, Type B</li><li>Not suitable for continuous use in the induced abortions and for the inflammable or explodable surroundings. Max continuous working time is 30 minutes, continuity rate: 50%</li><li>Reservoir capacity: 2500mL/pc, 2pieces</li><li>Pumping rate: ≥20L/min</li><li>Noise:≤ 65 dB (A), Power: ≤180VA</li></ul><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 18000.00, 10, 200, '1', 200.00, 15000, 200, '1', 'bawana, new delhi', 4, '1', '1', '0', '2023-11-26 00:11:47', '2023-11-26 00:11:47'),
(18, '138', 'Oxymed Mini (5L) Oxygen Concentrator', 'Oxymed', 'd-76441700977619.jpeg', 'd-493061700977619.jpeg', 'd-742781700977619.jpeg', 'd-577891700977619.jpeg', '<p><strong>Details :</strong></p><p>Oxymed Mini 5 LPM is one of the most popular names in the Indian oxygen concentrator market as it has the largest dealer network in India with over 40 service centres. This machine delivers oxygen at the flow rate of 0.5-5 LPM with a purity level of more than 90% at all flow rates.</p><p><strong>Smallest Home Oxygen Concentrator:</strong> Weighing just 13.9 Kgs, Oxymed Mini is the second lightest oxygen concentrator in the market. Its compact design ensures that the machine could be easily shifted from one location to another.</p><p><strong>Sound</strong>: Oxymed Mini Oxygen Concentrator emits sound at 45 dB.</p><p><strong>Power Consumption: </strong>The machine consumes 390 watts of power.</p><p><strong>Digital Flow Meter:</strong> The device comes with a digital flow regulator through which flow rate can be increased or decreased at the intervals of 0.5 LPM using the /- buttons.&nbsp;</p><p><strong>Oxygen Purity Analyzer:</strong> Oxymed Mini comes with an inbuilt oxygen purity analyzer through which users can get to know the oxygen purity level that is being delivered in real-time.&nbsp;</p><p><strong>Operating Altitude: </strong>Operating altitude of Oxymed Mini is 7500 feet.</p><p><strong>Outlet Pressure: </strong>The outlet pressure of the device is 10 psi.</p><p><strong>User-Friendly Folding Screen Display:</strong> The digital screen of Oxygen Mini shows the current flow rate, oxygen purity, timer and hour meter.&nbsp;</p><p><strong>Warranty:</strong> The warranty period of Oxymed Mini oxygen concentrator is 3 years.</p><p><strong>Certifications: </strong>The machine is CE certified.</p><p><strong>Additional Features:</strong></p><ul><li>Oxymed mini has an in-built nebulizer</li><li>The machine comes with a digital as well as a rotating ball-type flow meter.</li><li>There are locks on its front wheels which prevent the machine from slipping on the smooth floor.&nbsp;</li><li>The Oxymed Company provides home installation services in almost 50 cities across India.</li></ul><h2>What\'s in the Box?</h2><p>Oxymed Oxygen concentrator</p><p>Humidifier Bottle</p><p>User manual</p><p>Nasal cannula</p><p>Nebulizer Kit</p><p>Additional filter set</p><ul><li>Power Cable</li></ul><h3>Technical details</h3><figure class=\"table\"><table><tbody><tr><td>Purity</td><td>90-96%</td></tr><tr><td>Type</td><td>Home Stationary</td></tr><tr><td>Continuous Flow</td><td>1-5LPM</td></tr><tr><td>Weight</td><td>13.9kg</td></tr><tr><td>Oxygen Purity Indicator (OPI)</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>Power consumption</td><td>390watts</td></tr><tr><td>Sound level</td><td>45db</td></tr><tr><td>Dimensions</td><td>20.27H x 12.36W x 9.4Dinch</td></tr><tr><td>Operating altitude</td><td>7500feet</td></tr><tr><td>Outlet pressure</td><td>10psi</td></tr></tbody></table></figure><h3>Additional details</h3><figure class=\"table\"><table><tbody><tr><td>Oxygen Purity % Analyzer</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>Loss of Power Alarm</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>System Malfunction Alarm</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>No Flow Alarm</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>Indian Voltage Model</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr><tr><td>Company Headquarters</td><td>India</td></tr><tr><td>US FDA Approved</td><td>-</td></tr><tr><td>FAA Approved</td><td>-</td></tr><tr><td>CE Certified</td><td><img src=\"https://www.oxygentimes.com/images/tick.png?v=10oct\"></td></tr></tbody></table></figure><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 0.00, 0, 0, '1', 1500.00, 30000, 200, '1', 'india', 5, '1', '1', '0', '2023-11-26 00:16:59', '2023-11-26 00:16:59'),
(19, '138', 'Hospital Wheelchair', 'medisys', 'd-722841700977788.jpeg', 'd-745661700977788.jpeg', 'd-495771700977788.jpeg', '', '<p><strong>Details :</strong></p><figure class=\"table\"><table><tbody><tr><td>Brand</td><td>Medisys</td></tr><tr><td>Item Weight</td><td>18 Kilograms</td></tr><tr><td>Style</td><td>Mag Wheels</td></tr><tr><td>Item Dimensions LxWxH</td><td>104 x 22 x 87 Centimeters</td></tr><tr><td>Material</td><td>Metal</td></tr><tr><td>Seat Width</td><td>18 Inches</td></tr><tr><td>Wheel Size</td><td>24 Inches</td></tr><tr><td>Maximum Weight Recommendation</td><td>100 Kilograms</td></tr><tr><td>Wheel Type</td><td>Mag Wheel</td></tr><tr><td>Product Dimensions</td><td>66D x 104W x 88H Centimeters</td></tr></tbody></table></figure><p>&nbsp;</p><ul><li>DURABLE FRAME: Medisys wheelchair is made of heavy-duty steel for rigorous use. Steel frame adds extra durability and stability to the chair while the MS powder coating ensures extra strength, longevity, and resistance from corrosion. The steel frame provides a high load-bearing capability up to 100 kgs.</li><li>COMFORTABLE REXINE UPHOLSTERY SEAT: Wheel chair seats are made using rexine upholstery with heavy-duty inner liners to keep the seat and back from stretching. 18\" seating area provides relief and includes an adjustable safety belt for added security.</li><li>HIGH QUALITY WHEEL CHAIR: The wheelchair comprises superior quality rust-free mag wheels which increases the life span of this chair. The 24 inch rear wheels are for self manoeuvring while the solid PVC front casters swivel at 360° to improve the wheel chairs movements.</li><li>PROPELLING OPTIONS: This wheelchair can be used interchangeably as self-propelled wheelchair or attendant wheelchair. While users of this type of chair will generally push themselves, the handles mean it is possible for a caregiver or attendant to push the chair if required. This provides greater flexibility to users.</li><li>ERGONOMICALLY FOLDING DESIGN: The foldable wheelchair can folds flat for convenient storage and travel. Our folding wheelchair for old people make independent mobility easy via specialized features like soft padded armrests, storage pocket, rexine upholstery etc.</li><li>Net Weight of wheelchair: 18 kgs(approx)</li></ul><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 5500.00, 10, 200, '1', 200.00, 4000, 200, '0', 'bawana, new delhi', 2, '0', '1', '0', '2023-11-26 00:19:48', '2023-11-26 00:19:48'),
(20, '138', 'Niscomed 5 Para Monitor SpO2, HR, NIBP, ECG, RESP, 2 Temp with Wall Mounted Stand', 'Niscomed', '', '', '', '', '<p><strong>Details :</strong></p><h4><strong>PRODUCT DESCRIPTION</strong></h4><p>&nbsp;</p><p>&nbsp;</p><p><strong>Prepaid or Partial COD Options are available for this product. Please call or WhatsApp us at 8586 012345</strong><br>&nbsp;</p><p>&nbsp;</p><p>Multi-parameter patient monitor is a robust patient monitor, small enough to move around, yet flexible enough to adapt to your particular needs. With a variety of optional extras, including arrhythmia and ST analysis,&nbsp; . Rich in functions, conveniently adaptable and pleasingly affordable, multi-parameter patient monitor may be just the monitor for your department</p><p><strong>Features Benifits:</strong></p><ul><li>12 inch high-resolution color screen</li><li>Exquisite design suitable to moving operation</li><li>Operation interface: Standard, Trend Screen, oxy CRG Screen, NIBP List, Big front Screen</li><li>Freeze instant waveform for real time S-T segment analysis, pace-maker detection</li><li>Storage for up to 400 groups of NIBP list, 60 alarm events records recall</li><li>Built-in rechargeable lithium battery with 4hours working capacity</li><li>Capture dynamic wave forms</li><li>Patient info input management function</li><li>Screen: 12 inch</li><li>Parameters: ECG/RESP, SpO2 , NIBP</li><li>Color: White</li></ul><figure class=\"table\"><table><tbody><tr><td colspan=\"2\"><strong>5 Para Monitor SpO2, HR, NIBP, ECG, RESP, 2 Temp</strong></td></tr><tr><td><strong>Brand</strong></td><td>Niscomed Aqua 12</td></tr><tr><td><strong>Country of origin</strong></td><td>China</td></tr><tr><td><strong>Colour</strong></td><td>White</td></tr><tr><td><strong>Parameters</strong></td><td>ECG, NIBP, SPO2, Temperature, PR</td></tr><tr><td><strong>Type of display</strong></td><td>Colored</td></tr><tr><td><strong>Display Size</strong></td><td>12.1 inches</td></tr><tr><td><strong>Pulse Rate Range</strong