(21, '138', 'DEVON CIRONA 6200 DVT PUMP', 'Devon Medical', 'd-326381700979274.jpeg', '', '', '', '<p><strong>Details :</strong></p><h2>&nbsp;</h2><figure class=\"table\"><table><tbody><tr><td>Model</td><td>6200 Cirona</td></tr><tr><td>Brand</td><td>Devon Medical</td></tr><tr><td>Usage</td><td>Hospital</td></tr><tr><td>Rest Period</td><td>48 seconds</td></tr><tr><td>Cycle</td><td>60 seconds</td></tr><tr><td>Operation Mode</td><td>Continuous</td></tr><tr><td>Battery</td><td>Lithium Battery, 10.8 V, 400mAh (rechargeable)</td></tr><tr><td>Electrical</td><td>100 – 240 VAC, 50 – 60Hz</td></tr></tbody></table></figure><p>&nbsp;</p><p><strong>FEATURES</strong></p><ul><li><strong>Portable:</strong>&nbsp;The Cirona 6200 has a detachable power cord which can allow for easy transport of the device.</li><li><strong>Customizable:</strong>&nbsp;This system offers customizable treatment options allowing the patient to use on one leg or both legs.</li><li><strong>Accessible:</strong>&nbsp;Patients who are in need can access the benefits this device has to offer through most insurance providers.</li><li><strong>Convenient :</strong>&nbsp;Comes with long-lasting rechargeable battery , bed hanger attaches easily in hospital or home care setting.</li></ul><p><strong>CONTENT OF BOX</strong></p><ol><li>DVT Cirona 6200 Unit</li><li>1 pair of calf</li></ol><p><strong>Warranty: 1 Year</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 45000.00, 20, 200, '0', 0.00, 0, 0, '0', 'india', 18, '1', '1', '0', '2023-11-26 00:44:34', '2023-11-26 00:44:34');
