INSERT INTO `products` (`id`, `name`, `variant_name`, `strength`, `mrp`, `discount`, `pharmacy_id`, `category_id`, `sub_category_id`, `formulation_id`, `avaliblity`, `brand_name`, `image`, `image_2`, `image_3`, `image_4`, `salt_name`, `expiry_type`, `expiry_month`, `expiry_year`, `title`, `description`, `manufacturer_name`, `manufacturer_address`, `prescription_required`, `slug`, `productType`, `is_deleted`, `created_at`, `updated_at`) VALUES
(1, '', '1', '200gm', 200.00, 10, 1, 2, 1, 5, 'No', 'brand', 'd-191391677426478.jpeg', 'd-250211676752000.jpeg', 'd-44221676752000.jpeg', 'd-408911676752000.jpeg', '1', 'after', 'Jan', '2023', 'Colget toothpaste', '<h2><strong>PRODUCT INTRODUCTION</strong></h2><p>Cetrizine Tablet belongs to a group of medicines called antihistamines. It is used to treat various allergic conditions such as hay fever, conjunctivitis and some skin reactions, and reactions to bites and stings. It relieves watery eyes, runny nose, sneezing, and itching.<br><br>Cetrizine Tablet can be taken with or without food. The dose required for you may vary depending on what you are taking it for. This medicine is usually taken in the evening but follow the advice of your doctor on how to take it. You may need this medicine only on days you have symptoms, but if you are taking it to prevent symptoms you should take it regularly. If you miss doses or stop taking it earlier than advised, your symptoms may come back.<br><br>This medicine is generally very safe. The most common side effects include feeling sleepy or dizzy. These are usually mild and go away after a couple of days as your body adjusts. Consult your doctor if any of the side effects persist or worry you. You should avoid alcohol while taking this medicine.<br><br>Before taking it, tell your doctor if you have any kidney problems or epilepsy. Your dose may need to be modified or this medicine may not be suitable. Some other medicines can interact with this medicine so let your healthcare team know what else you are taking. You should also talk to your doctor before using this medicine if you are pregnant or breastfeeding, although it is not thought to be harmful.</p><h2><strong>USES OF CETRIZINE TABLET</strong></h2><ul><li><a href=\"https://www.1mg.com/diseases/allergic-conditions-10\">Treatment of Allergic conditions</a></li></ul><h2><strong>BENEFITS OF CETRIZINE TABLET</strong></h2><h3>In Treatment of Allergic conditions</h3><p>Cetrizine Tablet provides relief from symptoms such as blocked or runny nose, sneezing, and itchy or watery eyes. This will make it easier for you to go about your daily activities. It can also give relief from allergic reactions after insect bites and symptoms of hives and eczema such as rash, swelling, itching, and irritation. This will improve the appearance of your skin and you may find that your mood and self-confidence improve as well. It rarely has any serious side effects and you may only need to take it on days you have symptoms. If you are taking it to prevent getting symptoms you should use it regularly to get the most benefit.</p><h2><strong>SIDE EFFECTS OF CETRIZINE TABLET</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Cetrizine</h3><ul><li>Sleepiness</li><li>Fatigue</li><li>Vomiting</li><li>Dryness in mouth</li><li>Headache</li><li>Constipation</li></ul><h2><strong>HOW TO USE CETRIZINE TABLET</strong></h2><p>Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Cetrizine Tablet may be taken with or without food, but it is better to take it at a fixed time.</p><h2><strong>HOW CETRIZINE TABLET WORKS</strong></h2><p>Cetrizine Tablet is an antihistaminic medication. It treats allergy symptoms such as itching, swelling, and rashes by blocking the effects of a chemical messenger (histamine) in the body.</p><h2><strong>SAFETY ADVICE</strong></h2><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/alcohol.png\" alt=\"warnings\"></p><p><strong>Alcohol</strong></p><p>UNSAFE</p><p>Cetrizine Tablet may cause excessive drowsiness with alcohol.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/pregnancy.png\" alt=\"warnings\"></p><p><strong>Pregnancy</strong></p><p>SAFE IF PRESCRIBED</p><p>Cetrizine Tablet is generally considered safe to use during pregnancy. Animal studies have shown low or no adverse effects to the developing baby; however, there are limited human studies.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/lactation.png\" alt=\"warnings\"></p><p><strong>Breast feeding</strong></p><p>SAFE IF PRESCRIBED</p><p>Cetrizine Tablet is probably safe to use during breastfeeding. Limited human data suggests that the drug does not represent any significant risk to the baby.<br>Larger doses or prolonged use of Cetrizine Tablet may cause sleepiness and other effects in the baby.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/driving.png\" alt=\"warnings\"></p><p><strong>Driving</strong></p><p>SAFE</p><p>Cetrizine Tablet does not usually affect your ability to drive.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/kidney.png\" alt=\"warnings\"></p><p><strong>Kidney</strong></p><p>CAUTION</p><p>Cetrizine Tablet should be used with caution in patients with kidney disease. Dose adjustment of Cetrizine Tablet may be needed. Please consult your doctor.<br>However, it is not recommended in patients with severe kidney disease. It may cause excessive sleepiness in patients with end-stage kidney disease.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/liver.png\" alt=\"warnings\"></p><p><strong>Liver</strong></p><p>SAFE IF PRESCRIBED</p><p>Cetrizine Tablet is probably safe to use in patients with liver disease. Limited data available suggests that dose adjustment of Cetrizine Tablet may not be needed in these patients. Please consult your doctor.</p><h2><strong>WHAT IF YOU FORGET TO TAKE CETRIZINE TABLET?</strong></h2><p>If you miss a dose of Cetrizine Tablet, take it as soon as possible. However, if it is almost time for your next dose, skip the missed dose and go back to your regular schedule. Do not double the dose.</p><h2><strong>All substitutes</strong></h2><p>For informational purposes only. Consult a doctor before taking any medicines.</p><p>Cetrizine Tablet</p><p>₹1.29/Tablet</p><p><a href=\"https://www.1mg.com/drugs/agrocet-10mg-tablet-244671\">Agrocet 10mg Tablet</a></p><p>Agron Remedies Pvt Ltd</p><p>₹0.2/tablet</p><p>84% cheaper</p><p><a href=\"https://www.1mg.com/drugs/cezin-10mg-tablet-151109\">Cezin 10mg Tablet</a></p><p>A. Menarini India Pvt Ltd</p><p>₹0.5/tablet</p><p>61% cheaper</p><p><a href=\"https://www.1mg.com/drugs/okacet-tablet-54954\">Okacet Tablet</a></p><p>Cipla Ltd</p><p>₹1.3/tablet</p><p>1% costlier</p><p><a href=\"https://www.1mg.com/drugs/cetcip-tablet-54944\">Cetcip Tablet</a></p><p>Cipla Ltd</p><p>₹1.32/tablet</p><p>2% costlier</p><p><a href=\"https://www.1mg.com/drugs/mast-1-tablet-228228\">Mast 1 Tablet</a></p><p>Iatros Pharmaceuticals Pvt Ltd</p><p>₹1.5/tablet</p><p>16% costlier</p><p><img src=\"https://www.1mg.com/images/cta-arrow-right.svg\"></p><p><a href=\"https://www.1mg.com/drugs-substitutes/cetrizine-tablet-54921\">VIEW ALL SUBSTITUTES</a></p><p><img src=\"https://www.1mg.com/images/cta-arrow-right.svg\"></p><h2><strong>Quick tips</strong></h2><p><img src=\"https://onemg.gumlet.io/c_fit,a_ignore,q_60,fl_lossy,f_auto/marketing/og1rzrrcdwcki90sl3su.png\" alt=\"video img\"></p><p><img src=\"https://onemg.gumlet.io/c_fit,a_ignore,q_60,fl_lossy,f_auto/marketing/rvcznkwbne3uejtteclw.png\" alt=\"play img\"></p><ul><li>Your doctor has prescribed Cetrizine Tablet to help relieve allergy symptoms such as itching, swelling, and rashes.</li><li>It is okay to take Cetrizine Tablet with most other medications as it has few drug interactions.</li><li>Use caution while driving or doing anything that requires concentration as Cetrizine Tablet can cause dizziness and sleepiness.</li><li>Do not drink alcohol while taking Cetrizine Tablet as it may cause increased sleepiness.</li><li>Stop taking Cetrizine Tablet at least three days before taking an allergy test as it can affect the test results.</li></ul><h2><strong>Fact Box</strong></h2><p>Chemical Class</p><p><strong>Phenylmethyl Piperazinyl Derivative</strong></p><p>&nbsp;</p><p>Habit Forming</p><p><strong>No</strong></p><p>&nbsp;</p><p>Therapeutic Class</p><p><strong>RESPIRATORY</strong></p><p>&nbsp;</p><p>Action Class</p><p><strong>H1 Antihistaminics (second Generation)</strong></p><p>&nbsp;</p><h2><strong>Interaction with drugs</strong></h2><p>Taking Cetrizine with any of the following medicines can modify the effect of either of them and cause some undesirable side effects</p><p><a href=\"https://www.1mg.com/generics/aprepitant-209384\">Aprepitant</a></p><p>Brand(s): Fosapine, Aprepit, Aprepep</p><p>Life-threatening</p><p><a href=\"https://www.1mg.com/generics/fosaprepitant-212833\">Fosaprepitant</a></p><p>Brand(s): Fosup, Artepitant, Emetant</p><p>Life-threatening</p><p><a href=\"https://www.1mg.com/generics/zafirlukast-211223\">Zafirlukast</a></p><p>Brand(s): Zuvair</p><p>Serious</p><p><a href=\"https://www.1mg.com/generics/alprazolam-209346\">Alprazolam</a></p><p>Brand(s): Eurolam</p><p>Moderate</p><p><img src=\"https://www.1mg.com/images/cta-arrow-right.svg\"></p><p><a href=\"https://www.1mg.com/drug-interactions/cetrizine-tablet-35707\">VIEW ALL INTERACTIONS</a></p><p><img src=\"https://www.1mg.com/images/cta-arrow-right.svg\"></p><h2><strong>Patient concerns</strong></h2><p><strong>Running nose, sneezing, which n</strong></p><p>&nbsp;</p><p><img src=\"https://onemg-images.gumlet.io/fetch/w_65,h_65,q_auto,f_auto,r_max/https://doctors-production.s3.amazonaws.com/uploads/doctor_attachment/profile_image/35294/thumb_dd8d99ed-95e1-4953-bd72-0597c7729433.jpg\" alt=\"Dr. Vijay Verma\"></p><p><strong>Dr. Vijay Verma</strong></p><p>&nbsp;</p><p>ENT</p><p>appears allergic issue. take cetrizine 10 mg</p><p><a href=\"https://www.1mg.com/community/c/running-nose-sneezing-which-n-3033604\"><strong>MORE</strong></a></p><p><strong>Which medicine is suitable for allergic sneezing</strong></p><p>&nbsp;</p><p><img src=\"https://onemg-images.gumlet.io/fetch/w_65,h_65,q_auto,f_auto,r_max/https://doctors-production.s3.amazonaws.com/uploads/doctor_attachment/profile_image/35294/thumb_dd8d99ed-95e1-4953-bd72-0597c7729433.jpg\" alt=\"Dr. Vijay Verma\"></p><p><strong>Dr. Vijay Verma</strong></p><p>&nbsp;</p><p>ENT</p><p>Try cetrizine and visit ent specialist to see for any other reason</p><p><a href=\"https://www.1mg.com/community/c/which-medicine-is-suitable-for-allergic-sneezing-1532831\"><strong>MORE</strong></a></p><p><strong>Suffering from cold.No fever but bit of joint pain.Watering of eyes. Can i take cetrizine tablet. I am not under any medication.</strong></p><p>&nbsp;</p><p><img src=\"https://onemg-images.gumlet.io/fetch/w_65,h_65,q_auto,f_auto,r_max/https://doctors-production.s3.amazonaws.com/uploads/doctor_attachment/profile_image/35294/thumb_dd8d99ed-95e1-4953-bd72-0597c7729433.jpg\" alt=\"Dr. Vijay Verma\"></p><p><strong>Dr. Vijay Verma</strong></p><p>&nbsp;</p><p>ENT</p><p>Visit ent specialist as it can be viral or allergic treatment can be started after examination</p><p><a href=\"https://www.1mg.com/community/c/suffering-from-cold-no-fever-but-bit-of-joint-pain-watering-of-eyes-can-i-take-2197807\"><strong>MORE</strong></a></p><p><strong>Dry cough short period. for nearly 1month. no cough during night</strong></p><p>&nbsp;</p><p><img src=\"https://onemg-images.gumlet.io/fetch/w_65,h_65,q_auto,f_auto,r_max/https://doctors-production.s3.amazonaws.com/uploads/doctor_attachment/profile_image/35294/thumb_dd8d99ed-95e1-4953-bd72-0597c7729433.jpg\" alt=\"Dr. Vijay Verma\"></p><p><strong>Dr. Vijay Verma</strong></p><p>&nbsp;</p><p>ENT</p><p>can be allergic try cetrizine for 2 days else visit ent specialist</p><p><a href=\"https://www.1mg.com/community/c/dry-cough-short-period-for-nearly-1month-no-cough-during-night-3317884\"><strong>MORE</strong></a></p><p><strong>Sir, i am sleeping in A/C room. After one hour continues sneezing. Problem. Please give your valuable suggestions</strong></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Dr. Vijay Verma</strong></p><p>&nbsp;</p><p>ENT</p><p>It is allergic problem Get ent consultation and till that time u can try cetrizine tab</p><p><a href=\"https://www.1mg.com/community/c/sir-i-am-sleeping-in-a-c-room-after-one-hour-continues-sneezing-problem-plea-433661\"><strong>MORE</strong></a></p><p><strong>Please suggest alternative to Alerid-D tablet which don\'t contain Cetrizine.</strong></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Dr. Ila Jain Khandelwal</strong></p><p>&nbsp;</p><p>Pathology</p><p>Hi Alternative medicines or substitutes can only be written by the prescribing doctor.</p><p><a href=\"https://www.1mg.com/community/c/please-suggest-alternative-to-alerid-d-tablet-which-don-t-contain-cetrizine-584472\"><strong>MORE</strong></a></p><p><strong>I am suffering from running nose after every 4 to 5 days or after having sex. I am taking cetrizine from last 5 years. is there any permanent solution over it? Any side effects of cetrizine on kidney or liver?</strong></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Dr. Sunil Sekhri</strong></p><p>&nbsp;</p><p>Diabetology</p><p>Your history indicate Allergic Rhinits but to diagnose the condition a physical examination in clinic is required</p><p><a href=\"https://www.1mg.com/community/c/i-am-suffering-from-running-nose-after-every-4-to-5-days-or-after-having-sex-i-2205006\"><strong>MORE</strong></a></p><p><strong>Sneezing contonously for 1 to 2 hrs.</strong></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Dr. Vijay Verma</strong></p><p>&nbsp;</p><p>ENT</p><p>take cetrizine 10 mg</p><p><a href=\"https://www.1mg.com/community/c/sneezing-contonously-for-1-to-2-hrs-3217351\"><strong>MORE</strong></a></p><p><img src=\"https://www.1mg.com/images/forward-rebrand.svg\" alt=\"arrow\"></p><h2><strong>User feedback</strong></h2><p>Patients taking Cetrizine Tablet</p><p>Once A Day</p><p>&nbsp;</p><p>100%</p><p>What are you using Cetrizine Tablet for?</p><p>Allergic cond*</p><p>&nbsp;</p><p>83%</p><p>Others</p><p>&nbsp;</p><p>17%</p><p><i>*Allergic conditions</i></p><p>&nbsp;</p><p>How much was the improvement?</p><p>Excellent</p><p>&nbsp;</p><p>42%</p><p>Average</p><p>&nbsp;</p><p>38%</p><p>Poor</p><p>&nbsp;</p><p>19%</p><p>What were the side-effects while using Cetrizine Tablet?</p><p>Sleepiness</p><p>&nbsp;</p><p>44%</p><p>No Side Effec*</p><p>&nbsp;</p><p>33%</p><p>Cold extremit*</p><p>&nbsp;</p><p>11%</p><p>Weakness</p><p>&nbsp;</p><p>11%</p><p><i>*No Side Effect, Cold extremities</i></p><p>&nbsp;</p><p>How do you take Cetrizine Tablet?</p><p>With food</p><p>&nbsp;</p><p>71%</p><p>With or witho*</p><p>&nbsp;</p><p>27%</p><p>Empty stomach</p><p>&nbsp;</p><p>2%</p><p><i>*With or without food</i></p><p>&nbsp;</p><p>Please rate Cetrizine Tablet on price</p><p>Not Expensive</p><p>&nbsp;</p><p>35%</p><p>Expensive</p><p>&nbsp;</p><p>34%</p><p>Average</p><p>&nbsp;</p><p>31%</p><h3>Are you currently taking Cetrizine Tablet? Let us know how well it is working for you by taking this survey.</h3><p><img src=\"https://www.1mg.com/images/cta-arrow-right.svg\"></p><p><strong>TAKE SURVEY</strong></p><p>&nbsp;</p><p><strong>871 people have taken this survey</strong></p><p>&nbsp;</p><p><img src=\"https://www.1mg.com/images/cta-arrow-right.svg\"></p><p>Disclaimer: The following are the results of on-going survey on 1mg.com for Cetrizine Tablet. These results only indicate the perceptions of the website users. Please base your medical decisions only on the advice of a doctor or a registered medical professional.</p><h2><strong>FAQs</strong></h2><h3><strong>Q. Does Cetrizine Tablet make you tired and drowsy?</strong></h3><p>Yes, Cetrizine Tablet can make you feel tired, sleepy, and weak. If you have these symptoms, you should avoid driving or operating heavy machinery.</p><h3><strong>Q. Is Cetrizine Tablet a steroid? What is it used for?</strong></h3><p>Cetrizine Tablet is an anti-allergic medication, not a steroid. It relieves the symptoms of allergy. It is used to relieve runny nose, sneezing and redness, itching, and watering of the eyes caused by hay fever or seasonal allergies. It also relieves similar symptoms caused due to allergies to substances, such as dust mites, animal dander, and mold. It is also used to treat symptoms of hives, including itching and rash.</p><h3><strong>Q. How long does it take for Cetrizine Tablet to work?</strong></h3><p>You will notice an improvement within an hour of taking Cetrizine Tablet. However, it may take a little longer to notice the full benefits.</p><h3><strong>Q. Can I take Cetrizine Tablet and Fexofenadine together?</strong></h3><p>Sometimes the doctor may advise you to take two different antihistamines together if you are being treated for a severe itchy rash. If you are taking Cetrizine Tablet during the daytime, your doctor may prescribe another antihistamine for the night which causes sleepiness, especially if the itch makes it difficult for you to sleep. Do not take two antihistamines together unless recommended by your docto</p>', 'Manufacturer', '886, Near sector 106, Gurugram', 'Yes', 'colget-toothpaste-1', 'medicine', '0', '2022-05-21 09:10:00', '2023-06-23 07:13:51'),
