(16, '', '3', 'null', 333.00, 2, 1, 2, NULL, 0, 'Yes', '', 'd-684831687878656.webp', '', '', '', 'null', 'null', 'Feb', '2024', 'name', '<p>desc</p>', 'company', 'address', 'Yes', 'name-1', 'other', '0', '2023-04-23 03:40:17', '2023-06-27 09:40:56'),
(17, '', '1 PACK OF 10 TABLETS', '1000MG', 312.00, 10, 4, 3, NULL, 1, 'No', '', 'd-689311682747841.jpeg', 'd-985451682747841.jpeg', '', '', 'Levetiracetam 1000 MG', 'null', 'Mar', '2025', 'LEVIPIL', '<p>Levipil 1g Tablet is an anti-epileptic medicine used to treat seizures (fits) in epilepsy. It can be used alone or along with other medicines. It helps to prevent seizures for as long as you continue to take it.<br><br>Levipil 1g Tablet suppresses the abnormal electrical activity in the brain. You can take it with or without food but try to take it at the same time each day to get the most benefit. The dose will depend on your condition and how you respond to the medicine. Your doctor will advise the right dose for you. It is generally advised as a long-term treatment. You should continue taking it for as long as your doctor has told you to, even if you feel well. If you stop or miss doses your seizures could get worse.<br><br>Some common side effects of this medicine include dizziness, headache, infection, irritation, nasal congestion (stuffy nose), sleepiness, behavior changes, aggressive behavior, and decreased appetite. Side effects are more common during the first few weeks and usually lessen as your body gets used to the medicine. Most of these side effects do not need medical attention, but some of them can be serious. A small number of people being treated with this medicine have had thoughts of harming or killing themselves. Contact your doctor if your mood changes for the worse.<br><br>Before taking it, you should tell your doctor if you have kidney problems, depression, or suicidal thoughts and if you are pregnant, planning to become pregnant, or breastfeeding. Your doctor&nbsp;may suggest regular blood tests to monitor your kidney function while taking this medicine.</p><h2><strong>BENEFITS OF LEVIPIL TABLET</strong></h2><h3>In Treatment of Epilepsy/Seizures</h3><p>Levipil 1g Tablet belongs to a group of medicines called anticonvulsants (or anti-epileptics). It works by slowing down electrical signals in the brain which cause seizures (fits). This medicine can be used to control various types of seizures—myoclonic, partial-onset, and primary generalized tonic-clonic (or grand mal). It can also help reduce symptoms such as confusion, uncontrollable jerking movements, loss of awareness, and fear or anxiety. The medicine can allow you to do some activities that you would otherwise be forbidden or scared to do (such as swimming and driving). It can take a few weeks for this medicine to work (because the dose has to be increased slowly) and during this time you may still have seizures. You should continue taking it even if you feel well and are not having any seizures. Missing doses may trigger a seizure. Do not stop using this medicine until your doctor advises you.</p><h2><strong>SIDE EFFECTS OF LEVIPIL TABLET</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Levipil</h3><ul><li>Sleepiness</li><li>Dizziness</li><li>Fatigue</li><li>Headache</li><li>Decreased appetite</li><li>Behavioral changes</li><li>Aggressive behavior</li><li>Irritation</li><li>Agitation</li><li>Nasal congestion (stuffy nose)</li><li>Infection</li></ul><h2><strong>HOW TO USE LEVIPIL TABLET</strong></h2><p>Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Levipil 1g Tablet may be taken with or without food, but it is better to take it at a fixed time.</p><h2><strong>HOW LEVIPIL TABLET WORKS</strong></h2><p>Levipil 1g Tablet is an antiepileptic medication. It works by attaching to specific sites (SV2A) on the surfaces of nerve cells. This suppresses the abnormal activity of the nerve cells in the brain and prevents the spread of electrical signals that cause seizures.</p><h2><strong>SAFETY ADVICE</strong></h2><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/alcohol.png\" alt=\"warnings\"></p><p><strong>Alcohol</strong></p><p>UNSAFE</p><p>It is unsafe to consume alcohol with Levipil 1g Tablet.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/pregnancy.png\" alt=\"warnings\"></p><p><strong>Pregnancy</strong></p><p>CONSULT YOUR DOCTOR</p><p>Levipil 1g Tablet may be unsafe to use during pregnancy. Although there are limited studies in humans, animal studies have shown harmful effects on the developing baby. Your doctor will weigh the benefits and any potential risks before prescribing it to you. Please consult your doctor.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/lactation.png\" alt=\"warnings\"></p><p><strong>Breast feeding</strong></p><p>SAFE IF PRESCRIBED</p><p>Levipil 1g Tablet is probably safe to use during breastfeeding. Limited human data suggests that the drug does not represent any significant risk to the baby.<br>Monitor the baby for sleepiness and adequate weight gain.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/driving.png\" alt=\"warnings\"></p><p><strong>Driving</strong></p><p>UNSAFE</p><p>Levipil 1g Tablet may decrease alertness, affect your vision or make you feel sleepy and dizzy. Do not drive if these symptoms occur.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/kidney.png\" alt=\"warnings\"></p><p><strong>Kidney</strong></p><p>CAUTION</p><p>Levipil 1g Tablet should be used with caution in patients with kidney disease. Dose adjustment of Levipil 1g Tablet may be needed. Please consult your doctor.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/liver.png\" alt=\"warnings\"></p><p><strong>Liver</strong></p><p>SAFE IF PRESCRIBED</p><p>Levipil 1g Tablet is probably safe to use in patients with liver disease. Limited data available suggests that dose adjustment of Levipil 1g Tablet may not be needed in these patients. Please consult your doctor.<br>However, a lower dose may be advised in patients with severe liver disease.</p><h2><strong>WHAT IF YOU FORGET TO TAKE LEVIPIL TABLET?</strong></h2><p>If you miss a dose of Levipil 1g Tablet, take it as soon as possible. However, if it is almost time for your next dose, skip the missed dose and go back to your regular schedule. Do not double the dose.</p>', 'SUN PHARMA', 'ACEME PLAZA,ANDHERI-KURLA ROAD,ANDHERI EAST MUMBAI-400059', 'Yes', 'levipil-2', 'medicine', '0', '2023-04-29 00:27:21', '2023-04-30 03:31:21'),
