tor.<br>However, a lower dose may be advised in patients with severe liver disease.</p><h2><strong>WHAT IF YOU FORGET TO TAKE LEVIPIL TABLET?</strong></h2><p>If you miss a dose of Levipil 500 Tablet, take it as soon as possible. However, if it is almost time for your next dose, skip the missed dose and go back to your regular schedule. Do not double the dose.</p>', 'SUN PHARMA', 'Plot no 107/108,Namli block , Ranipool, East Sikkim 737135', 'Yes', 'levipil', 'medicine', '0', '2023-04-29 01:28:08', '2023-04-30 03:31:42'),
