(21, '', '1 PACK OF 44 DIAPERS', 'null', 1399.00, 15, 4, 5, NULL, 0, 'No', '', 'd-843601682758555.jpeg', 'd-630831682758555.jpeg', 'd-447391682758555.jpeg', 'd-966721682758555.jpeg', 'null', 'null', 'Jan', '2026', 'PAMPERS PREMIUM CARE PANTS L', '<p>Pampers Premium Care Pants – L, in a pack of 44, are large-sized baby diapers that comes with cotton-like soft top layer and air channels that prevent wetness, providing dryness for the longest time.</p><p>Pampers Premium Care Pants – L comes with a wetness indicator that turns from yellow to blue in order to indicate that it is the time to change the diaper. It also comes with a unique disposal tape that makes it easy to fold and dispose the diaper.</p><p><strong>Benefits of Pampers Premium Care Pants – L</strong></p><p>&nbsp;</p><ul><li>Soft top layer that keeps the baby comfortable</li><li>Air channels prevent wetness for the long hours</li><li>Wetness indicator turns from yellow to blue</li><li>Comes with a disposal tape that makes it easy to roll and dispose off the diaper</li></ul><h4>Usage</h4><p>Gently slip the baby into Pampers Premium Care Pants – L, making sure that the baby is comfortable with the fitting. When the wetness indicator turns from yellow to blue, indicate that it is time to change the diaper, gently remove the diaper and dispose the fecal matter into the toilet. Then, roll the diaper using the disposal tape and enclose it in a waste paper and dispose it in a waste paper basket.</p><p>&nbsp;</p>', 'PAMPERS', 'PROCTER & GAMBLE, P&G PLAZA,CARDINAL GRACIAS ROAD,CHAKLA,ANDHERI(E),MUMBAI,MAHARASHTRA 400099', 'No', 'pampers-premium-care-pants-l', 'other', '0', '2023-04-29 03:25:55', '2023-04-30 03:33:09'),
(22, '', '1 PACK OF 54 DIAPERS', 'null', 1399.00, 10, 4, 5, NULL, 0, 'Yes', '', 'd-479821682760650.jpeg', 'd-596721682760650.jpeg', 'd-641951682760650.jpeg', 'd-964281682760650.jpeg', 'null', 'null', 'Jun', '2026', 'PAMPERS PREMIUM CARE PANTS M', '<p>Pampers Premium Care Pants – M, in a pack of 54, are medium-sized baby diapers that comes with cotton-like soft top layer and air channels that prevent wetness, providing dryness for the longest time.</p><p>Pampers Premium Care Pants – M comes with a wetness indicator that turns from yellow to blue in order to indicate that it is the time to change the diaper. It also comes with a unique disposal tape that makes it easy to fold and dispose the diaper.</p><p><strong>Benefits of Pampers Premium Care Pants – M</strong></p><p>&nbsp;</p><ul><li>Soft top layer that keeps the baby comfortable</li><li>Air channels prevent wetness for the long hours</li><li>Wetness indicator turns from yellow to blue</li><li>Comes with a disposal tape that makes it easy to roll and dispose off the diaper</li></ul><h4>Usage</h4><p>Gently slip the baby into Pampers Premium Care Pants – M, making sure that the baby is comfortable with the fitting. When the wetness indicator turns from yellow to blue, indicate that it is time to change the diaper, gently remove the diaper and dispose the fecal matter into the toilet. Then, roll the diaper using the disposal tape and enclose it in a waste paper and dispose it in a waste paper basket.</p>', 'PAMPERS', 'PROCTER & GAMBLE, P&G PLAZA,CARDINAL GRACIAS ROAD,CHAKLA,ANDHERI(E),MUMBAI,MAHARASHTRA 400099', 'No', 'pampers-premium-care-pants-m-1', 'other', '0', '2023-04-29 04:00:50', '2023-04-30 03:33:18'),
(23, '', '1 PACK OF 200GM', 'null', 125.00, 10, 4, 6, NULL, 0, 'No', '', 'd-362071682761070.jpeg', '', '', '', 'null', 'null', 'Jun', '2026', 'COLGATE ACTIVE SALT TOOTHPASTE', '<p>Colgate Active Salt Toothpaste, in the net quantity of 200gms, is a one of its kind toothpaste that makes use of Active Salt and its minerals to ensure complete oral care. It fights germs and makes the gums healthy. It also helps in reducing tooth sensitivity. This product also helps in the whitening of the teeth. Its minty flavour revitalizes you and keeps the mouth feeling fresh all day, thus preventing bad mouth odour.</p><h4>Benefits of Colgate Active Salt Toothpaste</h4><ul><li>Contains Active Salt which fights germs and makes the gums healthy</li><li>Whitens teeth</li><li>Reduces tooth sensitivity</li><li>Keeps the mouth feeling fresh</li><li>Prevents bad mouth odour</li></ul><h4>Usage</h4><p>After washing the mouth with water, take a required amount of the Colgate Active Salt Toothpaste onto a tooth brush and brush your teeth thoroughly for ideally 3 minutes; at least 2 minutes, with small upward and downward circular motions. Rinse off with water thoroughly afterwards. For best results, use twice, daily – once in the morning and once before going to bed.</p>', 'COLGATE', 'COLGATE PALMOLIVE INDIA LTD  Plot No78,Epip Phase 1,Jharmajri,Baddi,Tehsil Nalagrah,Distt Solan H.P 174103', 'Yes', 'colgate-active-salt-toothpaste-1', 'other', '0', '2023-04-29 04:07:50', '2023-04-30 03:33:45'),
(24, '', '1 PACK 0F 1 TOOTH BRUSH', 'null', 20.00, 10, 4, 7, NULL, 0, 'Yes', '', 'd-785021682761675.jpeg', '', '', '', 'null', 'null', 'May', '2026', 'COLGATE SUPER FLEXI TOOTHBRUSH', '<p>Colgate Super Flexi Toothbrush, is a one of its kind toothbrush which comes with a flexible head that helps its soft bristles reach even the inner corners of the mouth which is otherwise difficult to do with an ordinary toothbrush. This helps offer a superior cleaning effect, with the toothbrush being able to reach even the narrowest of the gaps in between the teeth to remove the food particles, impurities and other debris to offer protection against germs. This helps prevent cavities and even tooth decay. The product comes with a uniquely designed handle that offers superior grip. It also comes with a built-in tongue cleaner that helps keep the tongue clean and healthy.</p><h4>Benefits of Colgate Super Flexi Toothbrush</h4><ul><li>Flexible head that makes it easy to reach the inner corners of the mouth</li><li>Offers superior cleaning effect with its bristles being able to reach the narrow gaps between teeth</li><li>Effectively removes all the food particles, impurities and other debris</li><li>Handle offers a comfortable grip</li><li>Built-in tongue cleaner helps keep the tongue clean and healthy</li><li>Takes efficient care of your oral hygiene</li></ul><h4>Usage</h4><p>Take a toothpaste of your choosing onto this toothbrush and brush your teeth thoroughly using upward and downward circular motions for ideally 3 minutes; at least 2 minutes. Make sure to clean all the corners of the teeth. Then, rinse off thoroughly with water.</p>', 'COLGATE', 'COLGATE PALMOLIVE INDIA LTD, Plot No78,Epip Phase 1,Jharmajri,Baddi,Tehsil Nalagrah,Distt Solan H.P 174103', 'Yes', 'colgate-super-flexi-toothbrush', 'other', '0', '2023-04-29 04:17:55', '2023-04-30 03:34:09'),
(25, '', '1 PACK OF 10 CAPSULES', 'PLEASE SEE COMPOSITION', 275.00, 15, 5, 4, NULL, 2, 'Yes', '', 'd-166161682753197.jpeg', 'd-629841682753197.jpeg', '', '', 'Alpha lipoic acid 100 MG Benfotiamine 150 MG Chromium picolinate 200 MCG Folic acid 1.5 MG Inositol 100 MG Mecobalamin 1500 MCG Selenium dioxide 55 MCG', 'null', 'Jan', '2026', 'NERVON FORTE', '<ul><li>Multivitamin supplement help in cell growth and maintenance</li><li>Make up the deficiencies in the body and protection of cells from wear and tear</li><li>Treats anemia and iron deficiencies and also useful to treat poor parathyroid function</li><li>Treats the deficiency of clotting factors in the body</li><li>Required for maintenance of overall health of the body</li></ul>', 'IPCA LABORATORIES LTD', 'UNIT 2, 393, MELLI JORETHANG ROAD, GOM BLOCK, BHARIKHOLA, SOUTH DISTRICT, SIKKIM 737 121', 'No', 'nervon-forte-2', 'medicine', '0', '2023-04-29 07:18:32', '2023-04-30 03:26:13');
INSERT INTO `products` (`id`, `name`, `variant_name`, `strength`, `mrp`, `discount`, `pharmacy_id`, `category_id`, `sub_category_id`, `formulation_id`, `avaliblity`, `brand_name`, `image`, `image_2`, `image_3`, `image_4`, `salt_name`, `expiry_type`, `expiry_month`, `expiry_year`, `title`, `description`, `manufacturer_name`, `manufacturer_address`, `prescription_required`, `slug`, `productType`, `is_deleted`, `created_at`, `updated_at`) VALUES
(26, '', '1 PACK OF 10 TABLETS', '1000MG', 312.00, 10, 5, 3, NULL, 1, 'No', '', 'd-689311682747841.jpeg', 'd-985451682747841.jpeg', '', '', 'Levetiracetam 1000 MG', 'null', 'Mar', '2025', 'LEVIPIL', '<p>Levipil 1g Tablet is an anti-epileptic medicine used to treat seizures (fits) in epilepsy. It can be used alone or along with other medicines. It helps to prevent seizures for as long as you continue to take it.<br><br>Levipil 1g Tablet suppresses the abnormal electrical activity in the brain. You can take it with or without food but try to take it at the same time each day to get the most benefit. The dose will depend on your condition and how you respond to the medicine. Your doctor will advise the right dose for you. It is generally advised as a long-term treatment. You should continue taking it for as long as your doctor has told you to, even if you feel well. If you stop or miss doses your seizures could get worse.<br><br>Some common side effects of this medicine include dizziness, headache, infection, irritation, nasal congestion (stuffy nose), sleepiness, behavior changes, aggressive behavior, and decreased appetite. Side effects are more common during the first few weeks and usually lessen as your body gets used to the medicine. Most of these side effects do not need medical attention, but some of them can be serious. A small number of people being treated with this medicine have had thoughts of harming or killing themselves. Contact your doctor if your mood changes for the worse.<br><br>Before taking it, you should tell your doctor if you have kidney problems, depression, or suicidal thoughts and if you are pregnant, planning to become pregnant, or breastfeeding. Your doctor&nbsp;may suggest regular blood tests to monitor your kidney function while taking this medicine.</p><h2><strong>BENEFITS OF LEVIPIL TABLET</strong></h2><h3>In Treatment of Epilepsy/Seizures</h3><p>Levipil 1g Tablet belongs to a group of medicines called anticonvulsants (or anti-epileptics). It works by slowing down electrical signals in the brain which cause seizures (fits). This medicine can be used to control various types of seizures—myoclonic, partial-onset, and primary generalized tonic-clonic (or grand mal). It can also help reduce symptoms such as confusion, uncontrollable jerking movements, loss of awareness, and fear or anxiety. The medicine can allow you to do some activities that you would otherwise be forbidden or scared to do (such as swimming and driving). It can take a few weeks for this medicine to work (because the dose has to be increased slowly) and during this time you may still have seizures. You should continue taking it even if you feel well and are not having any seizures. Missing doses may trigger a seizure. Do not stop using this medicine until your doctor advises you.</p><h2><strong>SIDE EFFECTS OF LEVIPIL TABLET</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Levipil</h3><ul><li>Sleepiness</li><li>Dizziness</li><li>Fatigue</li><li>Headache</li><li>Decreased appetite</li><li>Behavioral changes</li><li>Aggressive behavior</li><li>Irritation</li><li>Agitation</li><li>Nasal congestion (stuffy nose)</li><li>Infection</li></ul><h2><strong>HOW TO USE LEVIPIL TABLET</strong></h2><p>Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Levipil 1g Tablet may be taken with or without food, but it is better to take it at a fixed time.</p><h2><strong>HOW LEVIPIL TABLET WORKS</strong></h2><p>Levipil 1g Tablet is an antiepileptic medication. It works by attaching to specific sites (SV2A) on the surfaces of nerve cells. This suppresses the abnormal activity of the nerve cells in the brain and prevents the spread of electrical signals that cause seizures.</p><h2><strong>SAFETY ADVICE</strong></h2><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/alcohol.png\" alt=\"warnings\"></p><p><strong>Alcohol</strong></p><p>UNSAFE</p><p>It is unsafe to consume alcohol with Levipil 1g Tablet.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/pregnancy.png\" alt=\"warnings\"></p><p><strong>Pregnancy</strong></p><p>CONSULT YOUR DOCTOR</p><p>Levipil 1g Tablet may be unsafe to use during pregnancy. Although there are limited studies in humans, animal studies have shown harmful effects on the developing baby. Your doctor will weigh the benefits and any potential risks before prescribing it to you. Please consult your doctor.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/lactation.png\" alt=\"warnings\"></p><p><strong>Breast feeding</strong></p><p>SAFE IF PRESCRIBED</p><p>Levipil 1g Tablet is probably safe to use during breastfeeding. Limited human data suggests that the drug does not represent any significant risk to the baby.<br>Monitor the baby for sleepiness and adequate weight gain.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/driving.png\" alt=\"warnings\"></p><p><strong>Driving</strong></p><p>UNSAFE</p><p>Levipil 1g Tablet may decrease alertness, affect your vision or make you feel sleepy and dizzy. Do not drive if these symptoms occur.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/kidney.png\" alt=\"warnings\"></p><p><strong>Kidney</strong></p><p>CAUTION</p><p>Levipil 1g Tablet should be used with caution in patients with kidney disease. Dose adjustment of Levipil 1g Tablet may be needed. Please consult your doctor.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/liver.png\" alt=\"warnings\"></p><p><strong>Liver</strong></p><p>SAFE IF PRESCRIBED</p><p>Levipil 1g Tablet is probably safe to use in patients with liver disease. Limited data available suggests that dose adjustment of Levipil 1g Tablet may not be needed in these patients. Please consult your doctor.<br>However, a lower dose may be advised in patients with severe liver disease.</p><h2><strong>WHAT IF YOU FORGET TO TAKE LEVIPIL TABLET?</strong></h2><p>If you miss a dose of Levipil 1g Tablet, take it as soon as possible. However, if it is almost time for your next dose, skip the missed dose and go back to your regular schedule. Do not double the dose.</p>', 'SUN PHARMA', 'ACEME PLAZA,ANDHERI-KURLA ROAD,ANDHERI EAST MUMBAI-400059', 'Yes', 'levipil-3', 'medicine', '0', '2023-04-29 07:19:39', '2023-04-30 03:26:44'),
(27, '', '1 PACK OF 200GM', 'null', 125.00, 10, 5, 6, NULL, 0, 'No', '', 'd-362071682761070.jpeg', '', '', '', 'null', 'null', 'Jun', '2026', 'COLGATE ACTIVE SALT TOOTH PASTE', '<p>Colgate Active Salt Toothpaste, in the net quantity of 200gms, is a one of its kind toothpaste that makes use of Active Salt and its minerals to ensure complete oral care. It fights germs and makes the gums healthy. It also helps in reducing tooth sensitivity. This product also helps in the whitening of the teeth. Its minty flavour revitalizes you and keeps the mouth feeling fresh all day, thus preventing bad mouth odour.</p><h4>Benefits of Colgate Active Salt Toothpaste</h4><ul><li>Contains Active Salt which fights germs and makes the gums healthy</li><li>Whitens teeth</li><li>Reduces tooth sensitivity</li><li>Keeps the mouth feeling fresh</li><li>Prevents bad mouth odour</li></ul><h4>Usage</h4><p>After washing the mouth with water, take a required amount of the Colgate Active Salt Toothpaste onto a tooth brush and brush your teeth thoroughly for ideally 3 minutes; at least 2 minutes, with small upward and downward circular motions. Rinse off with water thoroughly afterwards. For best results, use twice, daily – once in the morning and once before going to bed.</p>', 'COLGATE', 'COLGATE PALMOLIVE INDIA LTD  Plot No78,Epip Phase 1,Jharmajri,Baddi,Tehsil Nalagrah,Distt Solan H.P 174103', 'No', 'colgate-active-salt-tooth-paste-1', 'other', '0', '2023-04-29 07:20:30', '2023-04-30 03:28:21'),
