(31, '', '1 TOOTH PASTE', 'null', 88.00, 10, 5, 6, NULL, 0, 'Yes', '', 'd-895411682841409.jpeg', '', '', '', 'null', 'null', 'May', '2027', 'COLGATE HERBAL TOOTH PASTE', '<p>Colgate Herbal Toothpaste, in the net quantity of 100gms, is enriched with the goodness of Chamomile, Myrrh, Eucalyptus and Sage, all of which work towards providing highly effective and complete oral care. This toothpaste cleans the food particles and other debris to keep your teeth clean always. It removes germs, thus keeping cavities at bay. It removes dental plaque and also prevents tooth decay. This product also revitalizes the breath, preventing bad mouth odour and keeping the mouth feeling fresh all day long.</p><h4>Benefits of Colgate Herbal Toothpaste</h4><ul><li>Enriched with Chamomile, Myrrh, Eucalyptus and Sage, which provide complete oral hygiene</li><li>Whitens the teeth</li><li>Provides healthy gums</li><li>Removes food particles and other debris, providing protection from germs</li><li>Prevents cavities and tooth decay</li><li>Removes dental plaque</li><li>Prevents bad mouth odour</li></ul><h4>Usage</h4><p>After rinsing the mouth with water, take a required amount of the Colgate Herbal Toothpaste onto a soft bristle toothbrush and brush the teeth vigorously with it, using small upward and downward circular motions, for ideally 3 minutes; at least 2 minutes. Wash off with water afterwards. For best results, use twice, daily.</p><p><br>&nbsp;</p>', 'COLGATE', 'COLGATE PALMOLIVE INDIA LTD, Plot No78,Epip Phase 1,Jharmajri,Baddi,Tehsil Nalagrah,Distt Solan H.P 174103', 'Yes', 'colgate-herbal-tooth-paste-1', 'other', '0', '2023-04-30 02:26:49', '2023-04-30 03:29:40'),
