(53, '', '15 TABLETS', '500mg', 218.00, 20, 11, 3, NULL, 1, 'Yes', '', 'd-159761689921647.jpeg', 'd-466921689921647.jpeg', '', '', '1', 'null', 'May', '2028', 'EPILIVE', '<p>Epilive 500 Tablet is an anti-epileptic medicine used to treat seizures (fits) in epilepsy. It can be used alone or along with other medicines. It helps to prevent seizures for as long as you continue to take it.<br><br>Epilive 500 Tablet suppresses the abnormal electrical activity in the brain. You can take it with or without food but try to take it at the same time each day to get the most benefit. The dose will depend on your condition and how you respond to the medicine. Your doctor will advise the right dose for you. It is generally advised as a long-term treatment. You should continue taking it for as long as your doctor has told you to, even if you feel well. If you stop or miss doses your seizures could get worse.<br><br>Some common side effects of this medicine include dizziness, headache, infection, irritation, nasal congestion (stuffy nose), sleepiness, behavior changes, aggressive behavior, and decreased appetite. Side effects are more common during the first few weeks and usually lessen as your body gets used to the medicine. Most of these side effects do not need medical attention, but some of them can be serious. A small number of people being treated with this medicine have had thoughts of harming or killing themselves. Contact your doctor if your mood changes for the worse.<br><br>Before taking it, you should tell your doctor if you have kidney problems, depression, or suicidal thoughts and if you are pregnant, planning to become pregnant, or breastfeeding. Your doctor&nbsp;may suggest regular blood tests to monitor your kidney function while taking this medicine.</p><h2><strong>BENEFITS OF EPILIVE TABLET</strong></h2><h3>In Treatment of Epilepsy/Seizures</h3><p>Epilive 500 Tablet belongs to a group of medicines called anticonvulsants (or anti-epileptics). It works by slowing down electrical signals in the brain which cause seizures (fits). This medicine can be used to control various types of seizures—myoclonic, partial-onset, and primary generalized tonic-clonic (or grand mal). It can also help reduce symptoms such as confusion, uncontrollable jerking movements, loss of awareness, and fear or anxiety. The medicine can allow you to do some activities that you would otherwise be forbidden or scared to do (such as swimming and driving). It can take a few weeks for this medicine to work (because the dose has to be increased slowly) and during this time you may still have seizures. You should continue taking it even if you feel well and are not having any seizures. Missing doses may trigger a seizure. Do not stop using this medicine until your doctor advises you.</p><h2><strong>SIDE EFFECTS OF EPILIVE TABLET</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Epilive</h3><ul><li>Sleepiness</li><li>Dizziness</li><li>Fatigue</li><li>Headache</li><li>Decreased appetite</li><li>Behavioral changes</li><li>Aggressive behavior</li><li>Irritation</li><li>Agitation</li><li>Nasal congestion (stuffy nose)</li><li>Infection</li></ul><h2><strong>HOW TO USE EPILIVE TABLET</strong></h2><p>Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Epilive 500 Tablet may be taken with or without food, but it is better to take it at a fixed time.</p><h2><strong>HOW EPILIVE TABLET WORKS</strong></h2><p>Epilive 500 Tablet is an antiepileptic medication. It works by attaching to specific sites (SV2A) on the surfaces of nerve cells. This suppresses the abnormal activity of the nerve cells in the brain and prevents the spread of electrical signals that cause seizures.</p>', 'LUPIN LABS', 'Mumbai, india', 'Yes', 'epilive-2', 'medicine', '0', '2023-07-21 01:10:47', '2023-07-21 01:23:07'),
(54, '', '15 TABLETS', '500 mg', 216.00, 20, 11, 3, NULL, 1, 'Yes', '', 'd-739381689923090.jpeg', 'd-369271689923090.jpeg', '', '', '1', 'null', 'Mar', '2027', 'LEVIPIL', '<p>Levipil 500 Tablet is an anti-epileptic medicine used to treat seizures (fits) in epilepsy. It can be used alone or along with other medicines. It helps to prevent seizures for as long as you continue to take it.<br><br>Levipil 500 Tablet suppresses the abnormal electrical activity in the brain. You can take it with or without food but try to take it at the same time each day to get the most benefit. The dose will depend on your condition and how you respond to the medicine. Your doctor will advise the right dose for you. It is generally advised as a long-term treatment. You should continue taking it for as long as your doctor has told you to, even if you feel well. If you stop or miss doses your seizures could get worse.<br><br>Some common side effects of this medicine include dizziness, headache, infection, irritation, nasal congestion (stuffy nose), sleepiness, behavior changes, aggressive behavior, and decreased appetite. Side effects are more common during the first few weeks and usually lessen as your body gets used to the medicine. Most of these side effects do not need medical attention, but some of them can be serious. A small number of people being treated with this medicine have had thoughts of harming or killing themselves. Contact your doctor if your mood changes for the worse.<br><br>Before taking it, you should tell your doctor if you have kidney problems, depression, or suicidal thoughts and if you are pregnant, planning to become pregnant, or breastfeeding. Your doctor&nbsp;may suggest regular blood tests to monitor your kidney function while taking this medicine.</p><h2><strong>BENEFITS OF LEVIPIL TABLET</strong></h2><h3>In Treatment of Epilepsy/Seizures</h3><p>Levipil 500 Tablet belongs to a group of medicines called anticonvulsants (or anti-epileptics). It works by slowing down electrical signals in the brain which cause seizures (fits). This medicine can be used to control various types of seizures—myoclonic, partial-onset, and primary generalized tonic-clonic (or grand mal). It can also help reduce symptoms such as confusion, uncontrollable jerking movements, loss of awareness, and fear or anxiety. The medicine can allow you to do some activities that you would otherwise be forbidden or scared to do (such as swimming and driving). It can take a few weeks for this medicine to work (because the dose has to be increased slowly) and during this time you may still have seizures. You should continue taking it even if you feel well and are not having any seizures. Missing doses may trigger a seizure. Do not stop using this medicine until your doctor advises you.</p><h2><strong>SIDE EFFECTS OF LEVIPIL TABLET</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Levipil</h3><ul><li>Sleepiness</li><li>Dizziness</li><li>Fatigue</li><li>Headache</li><li>Decreased appetite</li><li>Behavioral changes</li><li>Aggressive behavior</li><li>Irritation</li><li>Agitation</li><li>Nasal congestion (stuffy nose)</li><li>Infection</li></ul><h2><strong>HOW TO USE LEVIPIL TABLET</strong></h2><p>Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Levipil 500 Tablet may be taken with or without food, but it is better to take it at a fixed time.</p><h2><strong>HOW LEVIPIL TABLET WORKS</strong></h2><p>Levipil 500 Tablet is an antiepileptic medication. It works by attaching to specific sites (SV2A) on the surfaces of nerve cells. This suppresses the abnormal activity of the nerve cells in the brain and prevents the spread of electrical signals that cause seizures.</p>', 'Sun pharmaceuticals', 'Mumbai, India', 'Yes', 'levipil-4', 'medicine', '0', '2023-07-21 01:34:50', '2023-07-21 01:34:50'),
(55, '', '1 PACK OF 15 TABLETS', 'PLEASE SEE COMPOSITION', 249.00, 20, 11, 8, NULL, 1, 'Yes', '', 'd-784961689925141.jpeg', 'd-779611689925141.jpeg', '', '', '2', 'null', 'Apr', '2027', 'GLUCONORM G4 FORTE', '<p>Gluconorm-G 4 Forte Tablet PR belongs to a category of medicines known as anti-diabetic drugs. It is a combination of two medicines used to treat type 2 diabetes mellitus in adults. It helps control blood sugar levels in people with diabetes.<br><br>Gluconorm-G 4 Forte Tablet PR should be taken with food. Take it regularly at the same time each day to get the most benefit. Your doctor will decide what dose is best for you and this may change from time to time according to how it is working according to your blood sugar levels.<br><br>Keep taking this medicine, even if you feel well or your blood sugar levels are controlled. If you stop it without consulting your doctor, your blood sugar levels could rise and put you at risk of kidney damage, blindness, nerve problems, and loss of limbs. Remember that it is only part of a treatment program that should also include a healthy diet, regular exercise, and weight reduction as advised by your doctor. Your lifestyle plays a big part in controlling diabetes.<br><br>The most common side effect of Gluconorm-G 4 Forte Tablet PR is low blood glucose levels (hypoglycemia). Make sure you recognize the signs of having low blood glucose levels, such as sweating, dizziness, headache, and shaking, and know how to deal with it. To prevent this, it\'s important to have regular meals and always carry a fast-acting source of glucose such as sugary food or fruit juice with you. Drinking alcohol can also increase your risk of low blood sugar levels and should be avoided. Other side effects that may be seen on taking this medicine include taste changes, nausea, diarrhea, stomach pain, headache, and upper respiratory tract infection. Some people may find that they put on weight with this medicine.<br><br>You should not take it if you have type 1 diabetes mellitus, if you have diabetic ketoacidosis (high levels of acid in your blood), or if you have severe kidney or liver disease. Before taking this medicine, tell your doctor if you have ever had heart disease. It may not be suitable. Pregnant or breastfeeding women should also consult their doctor before taking it. Your blood sugar levels should be checked regularly and your doctor may also advise blood tests to monitor your blood cell counts and liver function.</p><h2><strong>BENEFITS OF GLUCONORM-G TABLET PR</strong></h2><h3>In Treatment of Type 2 diabetes mellitus</h3><p>Gluconorm-G 4 Forte Tablet PR is a combination medicine that increases the amount of insulin your body produces (in the pancreas). The insulin then works to lower your blood glucose level. It is usually taken once a day. You should keep taking it for as long as it is prescribed.<br>Lowering blood glucose levels is an essential part of managing diabetes. If you can control the level you will reduce the risk of getting any of the serious complications of diabetes such as kidney damage, eye damage, nerve problems, and loss of limbs. Taking this medicine regularly along with proper diet and exercise will help you live a normal, healthy life.</p><h2><strong>SIDE EFFECTS OF GLUCONORM-G TABLET PR</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Gluconorm-G</h3><ul><li>Hypoglycemia (low blood glucose level)</li><li>Headache</li><li>Nausea</li><li>Diarrhea</li><li>Flatulence</li></ul><h2><strong>HOW TO USE GLUCONORM-G TABLET PR</strong></h2><p>Use it as advised by your doctor or check the label for directions before use. Gluconorm-G 4 Forte Tablet PR is to be taken with food.</p><h2><strong>HOW GLUCONORM-G TABLET PR WORKS</strong></h2><p>Gluconorm-G 4 Forte Tablet PR is a combination of two antidiabetic medicines: Glimepiride and Metformin.Glimepiride is a sulfonylurea which works by increasing the amount of insulin released by the pancreas in order to lower the blood glucose. Metformin is a biguanide which works by lowering glucose production in the liver, delaying glucose absorption from intestines and increasing the body\'s sensitivity to insulin.</p>', 'Lupin Ltd', 'Lupin Ltd, 3rd floor Kalpataru Inspire, Off. W E Highway, Santacruz (East), Mumbai 400 055. India', 'Yes', 'gluconorm-g4-forte', 'medicine', '0', '2023-07-21 02:09:01', '2023-07-21 02:09:01'),
