de and Metformin.Glimepiride is a sulfonylurea which works by increasing the amount of insulin released by the pancreas in order to lower the blood glucose. Metformin is a biguanide which works by lowering glucose production in the liver, delaying glucose absorption from intestines and increasing the body\'s sensitivity to insulin.</p>', 'Lupin Ltd', 'Lupin Ltd, 3rd floor Kalpataru Inspire, Off. W E Highway, Santacruz (East), Mumbai 400 055. India', 'Yes', 'gluconorm-g2-forte-1', 'medicine', '0', '2023-07-21 02:09:56', '2023-07-21 04:02:24'),
(58, '', '1 PACK OF 200GM', 'null', 125.00, 10, 11, 6, NULL, 0, 'Yes', '', 'd-495981689925900.jpeg', '', '', '', 'null', 'null', 'Jun', '2026', 'COLGATE ACTIVE SALT TOOTHPASTE', '<p>Colgate Active Salt Toothpaste, in the net quantity of 200gms, is a one of its kind toothpaste that makes use of Active Salt and its minerals to ensure complete oral care. It fights germs and makes the gums healthy. It also helps in reducing tooth sensitivity. This product also helps in the whitening of the teeth. Its minty flavour revitalizes you and keeps the mouth feeling fresh all day, thus preventing bad mouth odour.</p><h4>Benefits of Colgate Active Salt Toothpaste</h4><ul><li>Contains Active Salt which fights germs and makes the gums healthy</li><li>Whitens teeth</li><li>Reduces tooth sensitivity</li><li>Keeps the mouth feeling fresh</li><li>Prevents bad mouth odour</li></ul><h4>Usage</h4><p>After washing the mouth with water, take a required amount of the Colgate Active Salt Toothpaste onto a tooth brush and brush your teeth thoroughly for ideally 3 minutes; at least 2 minutes, with small upward and downward circular motions. Rinse off with water thoroughly afterwards. For best results, use twice, daily – once in the morning and once before going to bed.</p>', 'COLGATE', 'COLGATE PALMOLIVE INDIA LTD  Plot No78,Epip Phase 1,Jharmajri,Baddi,Tehsil Nalagrah,Distt Solan H.P 174103', 'Yes', 'colgate-active-salt-toothpaste-2', 'other', '0', '2023-07-21 02:21:40', '2023-07-21 02:26:42');
