(59, '', '1 PACK 0F 1 TOOTH BRUSH', 'null', 20.00, 10, 11, 7, NULL, 0, 'Yes', '', 'd-712921689927886.jpeg', '', '', '', 'null', 'null', 'May', '2026', 'COLGATE SUPER FLEXI TOOTHBRUSH', '<p>Colgate Super Flexi Toothbrush, is a one of its kind toothbrush which comes with a flexible head that helps its soft bristles reach even the inner corners of the mouth which is otherwise difficult to do with an ordinary toothbrush. This helps offer a superior cleaning effect, with the toothbrush being able to reach even the narrowest of the gaps in between the teeth to remove the food particles, impurities and other debris to offer protection against germs. This helps prevent cavities and even tooth decay. The product comes with a uniquely designed handle that offers superior grip. It also comes with a built-in tongue cleaner that helps keep the tongue clean and healthy.</p><h4>Benefits of Colgate Super Flexi Toothbrush</h4><ul><li>Flexible head that makes it easy to reach the inner corners of the mouth</li><li>Offers superior cleaning effect with its bristles being able to reach the narrow gaps between teeth</li><li>Effectively removes all the food particles, impurities and other debris</li><li>Handle offers a comfortable grip</li><li>Built-in tongue cleaner helps keep the tongue clean and healthy</li><li>Takes efficient care of your oral hygiene</li></ul><h4>Usage</h4><p>Take a toothpaste of your choosing onto this toothbrush and brush your teeth thoroughly using upward and downward circular motions for ideally 3 minutes; at least 2 minutes. Make sure to clean all the corners of the teeth. Then, rinse off thoroughly with water.</p>', 'COLGATE', 'COLGATE PALMOLIVE INDIA LTD, Plot No78,Epip Phase 1,Jharmajri,Baddi,Tehsil Nalagrah,Distt Solan H.P 174103', 'Yes', 'colgate-super-flexi-toothbrush-1', 'other', '0', '2023-07-21 02:54:46', '2023-07-21 02:54:46'),
(60, '', '1 PACK OF 44 DIAPERS', 'null', 1399.00, 15, 11, 5, NULL, 0, 'Yes', '', 'd-784021689929453.jpeg', 'd-895671689929453.jpeg', 'd-794511689929453.jpeg', 'd-40031689929453.jpeg', 'null', 'null', 'Jan', '2027', 'PAMPERS PREMIUM CARE PANTS L', '<p>Pampers Premium Care Pants – L, in a pack of 44, are large-sized baby diapers that comes with cotton-like soft top layer and air channels that prevent wetness, providing dryness for the longest time.</p><p>Pampers Premium Care Pants – L comes with a wetness indicator that turns from yellow to blue in order to indicate that it is the time to change the diaper. It also comes with a unique disposal tape that makes it easy to fold and dispose the diaper.</p><p><strong>Benefits of Pampers Premium Care Pants – L</strong></p><p>&nbsp;</p><ul><li>Soft top layer that keeps the baby comfortable</li><li>Air channels prevent wetness for the long hours</li><li>Wetness indicator turns from yellow to blue</li><li>Comes with a disposal tape that makes it easy to roll and dispose off the diaper</li></ul><h4>Usage</h4><p>Gently slip the baby into Pampers Premium Care Pants – L, making sure that the baby is comfortable with the fitting. When the wetness indicator turns from yellow to blue, indicate that it is time to change the diaper, gently remove the diaper and dispose the fecal matter into the toilet. Then, roll the diaper using the disposal tape and enclose it in a waste paper and dispose it in a waste paper basket.</p><p>&nbsp;</p>', 'PAMPERS', 'PROCTER & GAMBLE, P&G PLAZA,CARDINAL GRACIAS ROAD,CHAKLA,ANDHERI(E),MUMBAI,MAHARASHTRA 400099', 'No', 'pampers-premium-care-pants-l-1', 'other', '0', '2023-07-21 03:20:53', '2023-07-21 03:20:53'),
(61, '', '1', 'null', 775.00, 20, 11, 9, NULL, 0, 'Yes', '', 'd-293511689930254.jpeg', 'd-135421689930254.jpeg', 'd-527721689930254.jpeg', 'd-963941689930254.jpeg', 'null', 'null', 'Jun', '2028', 'ENSURE VANILA 400 GM', '<ul><li>Scientifically Formulated and clinically proven with 32 nutrients including protein, calcium, Vitamin D that could be missing from your diet</li><li>Helps Boost Immunity and protects against infections - Contains Immunonutrients like Vitamins A, C, E, Folic Acid, Zinc and Manganese to maintain protection against infections</li><li>Helps Increase Muscle Mass,contains high quality proteins that help increase muscle-mass &amp; a balanced macronutrient ratio that supports optimum utilization of proteins</li><li>Nutrition to Stay Strong and Active,Contains nutrients like Calcium, Phosphorus, Magnesium, Vitamin D and Vitamin K for strong bones</li><li>NO. 1 ORAL NUTRITION SUPPLEMENT WORLDWIDE : in two delicious flavours Vanilla and Chocolate</li><li>Support Digestive health and helps Metabolism - contains fructo-oligosaccharide (FOS) which supports digestive health &amp; Vitamin B1,B2,B6, B12 and iodine that help in metabolism</li><li>Delicious Nutritional drink with upto 4 times, less sugar than other health drinks</li><li>HOW TO PREPARE:Add 6 Scoops of Ensure in 190 ml chilled water or 3 Scoops of Ensure in 150 ml chilled milk, Stir until dissolved and enjoy</li></ul>', 'ABBOTT NUTRITION', 'Abbott Healthcare Pvt Ltd, Regd Office 3, Corporate Park, Sion Trombay Road, Mumbai, Maharashtra 400071', 'Yes', 'ensure-vanila-400-gm', 'other', '0', '2023-07-21 03:33:37', '2023-10-08 14:37:48'),
(62, '', '15 TABLETS', '500mg', 218.00, 25, 10, 3, NULL, 1, 'Yes', '', 'd-187131689939661.jpeg', 'd-967611689939661.jpeg', '', '', '1', 'null', 'May', '2028', 'EPILIVE', '<p>Epilive 500 Tablet is an anti-epileptic medicine used to treat seizures (fits) in epilepsy. It can be used alone or along with other medicines. It helps to prevent seizures for as long as you continue to take it.<br><br>Epilive 500 Tablet suppresses the abnormal electrical activity in the brain. You can take it with or without food but try to take it at the same time each day to get the most benefit. The dose will depend on your condition and how you respond to the medicine. Your doctor will advise the right dose for you. It is generally advised as a long-term treatment. You should continue taking it for as long as your doctor has told you to, even if you feel well. If you stop or miss doses your seizures could get worse.<br><br>Some common side effects of this medicine include dizziness, headache, infection, irritation, nasal congestion (stuffy nose), sleepiness, behavior changes, aggressive behavior, and decreased appetite. Side effects are more common during the first few weeks and usually lessen as your body gets used to the medicine. Most of these side effects do not need medical attention, but some of them can be serious. A small number of people being treated with this medicine have had thoughts of harming or killing themselves. Contact your doctor if your mood changes for the worse.<br><br>Before taking it, you should tell your doctor if you have kidney problems, depression, or suicidal thoughts and if you are pregnant, planning to become pregnant, or breastfeeding. Your doctor&nbsp;may suggest regular blood tests to monitor your kidney function while taking this medicine.</p><h2><strong>BENEFITS OF EPILIVE TABLET</strong></h2><h3>In Treatment of Epilepsy/Seizures</h3><p>Epilive 500 Tablet belongs to a group of medicines called anticonvulsants (or anti-epileptics). It works by slowing down electrical signals in the brain which cause seizures (fits). This medicine can be used to control various types of seizures—myoclonic, partial-onset, and primary generalized tonic-clonic (or grand mal). It can also help reduce symptoms such as confusion, uncontrollable jerking movements, loss of awareness, and fear or anxiety. The medicine can allow you to do some activities that you would otherwise be forbidden or scared to do (such as swimming and driving). It can take a few weeks for this medicine to work (because the dose has to be increased slowly) and during this time you may still have seizures. You should continue taking it even if you feel well and are not having any seizures. Missing doses may trigger a seizure. Do not stop using this medicine until your doctor advises you.</p><h2><strong>SIDE EFFECTS OF EPILIVE TABLET</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Epilive</h3><ul><li>Sleepiness</li><li>Dizziness</li><li>Fatigue</li><li>Headache</li><li>Decreased appetite</li><li>Behavioral changes</li><li>Aggressive behavior</li><li>Irritation</li><li>Agitation</li><li>Nasal congestion (stuffy nose)</li><li>Infection</li></ul><h2><strong>HOW TO USE EPILIVE TABLET</strong></h2><p>Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Epilive 500 Tablet may be taken with or without food, but it is better to take it at a fixed time.</p><h2><strong>HOW EPILIVE TABLET WORKS</strong></h2><p>Epilive 500 Tablet is an antiepileptic medication. It works by attaching to specific sites (SV2A) on the surfaces of nerve cells. This suppresses the abnormal activity of the nerve cells in the brain and prevents the spread of electrical signals that cause seizures.</p>', 'LUPIN LABS', 'Mumbai, india', 'Yes', 'epilive', 'medicine', '0', '2023-07-21 06:11:01', '2023-07-21 06:30:06'),
(63, '', '1 PACK OF 10 CAPSULES', 'PLEASE SEE COMPOSITION', 275.00, 25, 10, 4, NULL, 2, 'Yes', '', 'd-483411689940731.jpeg', 'd-486801689940731.jpeg', '', '', 'Alpha lipoic acid 100 MG Benfotiamine 150 MG Chromium picolinate 200 MCG Folic acid 1.5 MG Inositol 100 MG Mecobalamin 1500 MCG Selenium dioxide 55 MCG', 'null', 'Jan', '2026', 'NERVON FORTE', '<ul><li>Multivitamin supplement help in cell growth and maintenance</li><li>Make up the deficiencies in the body and protection of cells from wear and tear</li><li>Treats anemia and iron deficiencies and also useful to treat poor parathyroid function</li><li>Treats the deficiency of clotting factors in the body</li><li>Required for maintenance of overall health of the body</li></ul>', 'IPCA LABORATORIES LTD', 'UNIT 2, 393, MELLI JORETHANG ROAD, GOM BLOCK, BHARIKHOLA, SOUTH DISTRICT, SIKKIM 737 121', 'No', 'nervon-forte', 'medicine', '0', '2023-07-21 06:28:51', '2023-07-21 06:28:51'),
(64, '', '10 TABLETS', '4 MG', 57.00, 25, 10, 10, NULL, 1, 'No', '', 'd-744341690003891.jpeg', 'd-159231690003891.jpeg', 'd-43021690003786.jpeg', '', '2', 'null', 'Jun', '2027', 'EMESET', '<p>Emeset 4 Tablet is an antiemetic medicine commonly used to control nausea and vomiting due to certain medical conditions like stomach upset. It is also used to prevent nausea and vomiting caused due to any surgery, cancer drug therapy, or radiotherapy.<br><br>Emeset 4 Tablet may be used alone or with other medications and can be taken with or without food. Your doctor will suggest the appropriate dose depending on what you are taking it for. The first dose is normally taken before the start of surgery, chemotherapy, or radiotherapy. After these treatments, take any further doses as prescribed by your doctor (normally only for a few days at most). Take it regularly at the same time(s) each day to get the most benefit. Be careful not to take too much.<br><br>This medicine does not relieve other side effects associated with cancer treatments. Also, it has little effect on vomiting caused by motion sickness. The most common side effects of taking this medicine include headache, diarrhea, or constipation and feeling tired. These symptoms should disappear when you stop taking the medicine. However, if these side effects bother you or do not go away, your doctor may be able to suggest ways of preventing or reducing them.&nbsp;<br><br>Before taking this medicine, tell your doctor if you have heart or liver problems or a blockage in your stomach or intestines. Also, tell your doctor about any other medicines you might be taking, especially medicines to treat epilepsy, heart problems, cancer, and depression. These may affect, or be affected by, this medicine. If you are pregnant or breastfeeding, ask for advice from your doctor.</p><h2><strong>BENEFITS OF EMESET TABLET</strong></h2><h3>In Treatment of Nausea</h3><p>Emeset 4 Tablet blocks the action of chemicals in the body that can make you feel or be sick. It is often used to prevent nausea and vomiting that may be caused by cancer chemotherapy and radiation treatment (in adults and children aged 4 years and older). It is usually taken both before and after chemotherapy or radiation. This medicine helps you recover more comfortably from these treatments. It is also effective at preventing nausea and vomiting after an operation (in adults only). The dose will depend on what you are being treated for but always take this medicine as it is prescribed.</p><h2><strong>SIDE EFFECTS OF EMESET TABLET</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Emeset</h3><ul><li>Constipation</li><li>Diarrhea</li><li>Fatigue</li><li>Headache</li></ul><h2><strong>HOW TO USE EMESET TABLET</strong></h2><p>Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Emeset 4 Tablet may be taken with or without food, but it is better to take it at a fixed time.</p><h2><strong>HOW EMESET TABLET WORKS</strong></h2><p>Emeset 4 Tablet is an antiemetic medication. It works by blocking the action of a chemical messenger (serotonin) in the brain that may cause nausea and vomiting during anti-cancer treatment (chemotherapy) or after surgery.</p>', 'Cipla Ltd', 'Cipla House, Peninsula Business Park, Ganpatrao Kadam Marg, Lower Parel, Mumbai-400013', 'Yes', 'emeset-1', 'medicine', '0', '2023-07-21 23:59:46', '2023-07-22 00:01:31'),
(65, '', '1 PACK OF 15 TABLETS', 'PLEASE SEE COMPOSITION', 250.00, 25, 10, 8, NULL, 1, 'No', '', 'd-387001690004347.jpeg', 'd-725171690004347.jpeg', '', '', '2', 'null', 'May', '2028', 'GLUCONORM G2 FORTE', '<p>Gluconorm G2 Forte Tablet PR belongs to a category of medicines known as anti-diabetic drugs. It is a combination of two medicines used to treat type 2 diabetes mellitus in adults. It helps control blood sugar levels in people with diabetes.<br><br>Gluconorm G2 Forte Tablet PR should be taken with food. Take it regularly at the same time each day to get the most benefit. Your doctor will decide what dose is best for you and this may change from time to time according to how it is working according to your blood sugar levels.<br><br>Keep taking this medicine, even if you feel well or your blood sugar levels are controlled. If you stop it without consulting your doctor, your blood sugar levels could rise and put you at risk of kidney damage, blindness, nerve problems, and loss of limbs. Remember that it is only part of a treatment program that should also include a healthy diet, regular exercise, and weight reduction as advised by your doctor. Your lifestyle plays a big part in controlling diabetes.<br><br>The most common side effect of Gluconorm G2 Forte Tablet PR is low blood glucose levels (hypoglycemia). Make sure you recognize the signs of having low blood glucose levels, such as sweating, dizziness, headache, and shaking, and know how to deal with it. To prevent this, it\'s important to have regular meals and always carry a fast-acting source of glucose such as sugary food or fruit juice with you. Drinking alcohol can also increase your risk of low blood sugar levels and should be avoided. Other side effects that may be seen on taking this medicine include taste changes, nausea, diarrhea, stomach pain, headache, and upper respiratory tract infection. Some people may find that they put on weight with this medicine.<br><br>You should not take it if you have type 1 diabetes mellitus, if you have diabetic ketoacidosis (high levels of acid in your blood), or if you have severe kidney or liver disease. Before taking this medicine, tell your doctor if you have ever had heart disease. It may not be suitable. Pregnant or breastfeeding women should also consult their doctor before taking it. Your blood sugar levels should be checked regularly and your doctor may also advise blood tests to monitor your blood cell counts and liver function.</p><h2><strong>BENEFITS OF GLUCONORM-G TABLET PR</strong></h2><h3>In Treatment of Type 2 diabetes mellitus</h3><p>Gluconorm G2 Forte Tablet PR is a combination medicine that increases the amount of insulin your body produces (in the pancreas). The insulin then works to lower your blood glucose level. It is usually taken once a day. You should keep taking it for as long as it is prescribed.<br>Lowering blood glucose levels is an essential part of managing diabetes. If you can control the level you will reduce the risk of getting any of the serious complications of diabetes such as kidney damage, eye damage, nerve problems, and loss of limbs. Taking this medicine regularly along with proper diet and exercise will help you live a normal, healthy life.</p><h2><strong>SIDE EFFECTS OF GLUCONORM-G TABLET PR</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Gluconorm-G</h3><ul><li>Hypoglycemia (low blood glucose level)</li><li>Headache</li><li>Nausea</li><li>Diarrhea</li><li>Flatulence</li></ul><h2><strong>HOW TO USE GLUCONORM-G TABLET PR</strong></h2><p>Use it as advised by your doctor or check the label for directions before use. Gluconorm G2 Forte Tablet PR is to be taken with food.</p><h2><strong>HOW GLUCONORM-G TABLET PR WORKS</strong></h2><p>Gluconorm G2 Forte Tablet PR is a combination of two antidiabetic medicines: Glimepiride and Metformin.Glimepiride is a sulfonylurea which works by increasing the amount of insulin released by the pancreas in order to lower the blood glucose. Metformin is a biguanide which works by lowering glucose production in the liver, delaying glucose absorption from intestines and increasing the body\'s sensitivity to insulin.</p>', 'Lupin Ltd', 'Lupin Ltd, 3rd floor Kalpataru Inspire, Off. W E Highway, Santacruz (East), Mumbai 400 055. India', 'No', 'gluconorm-g2-forte', 'medicine', '0', '2023-07-22 00:04:18', '2023-07-22 00:09:07'),
(66, '', '1 PACK OF 1 TOOTH BRUSH', 'null', 20.00, 20, 10, 7, NULL, 0, 'Yes', '', 'd-714891690004639.jpeg', '', '', '', 'null', 'null', 'Mar', '2027', 'COLGATE EXTRA CLEAN TOOTH BRUSH', '<p>The Colgate Extra Clean Toothbrush, is a uniquely designed toothbrush with a power tip that reaches even the back of the teeth to efficiently sweep away all the food particles, impurities and other debris, thus providing effective protection from germs. This helps protect the teeth from cavities and also prevents tooth decay. The Colgate Extra Clean Toothbrush also comes with a pearlized handle that offers comfortable grip, and it is designed with soft, specialized bristles that offer superior cleaning effect, help in the removal of dental plaque, while not being harsh on the teeth.</p><h4>Benefits of Colgate Extra Clean Toothbrush</h4><ul><li>The power tip reaches even the back of the teeth</li><li>Efficiently cleans all the food particles, impurities and other debris, thus protecting from germs</li><li>Helps in the prevention of cavities and tooth decay</li><li>The special pearlized handle offers comfortable grip</li><li>Specialized bristles make for superior cleaning</li><li>Takes efficient care of your oral hygiene</li></ul><h4>Usage</h4><p>Take a toothpaste of your choosing onto this toothbrush and brush your teeth thoroughly using upward and downward circular motions for ideally 3 minutes; at least 2 minutes. Make sure to clean all the corners of the teeth. Then, rinse off thoroughly with water.</p>', 'COLGATE', 'COLGATE PALMOLIVE INDIA LTD, Plot No78,Epip Phase 1,Jharmajri,Baddi,Tehsil Nalagrah,Distt Solan H.P 174103', 'No', 'colgate-extra-clean-tooth-brush', 'other', '0', '2023-07-22 00:13:59', '2023-07-22 00:13:59'),
(67, '', '500 GM', 'null', 150.00, 30, 10, 9, NULL, 0, 'Yes', '', 'd-426841690005527.jpeg', 'd-28281690005527.jpeg', 'd-223501690005527.jpeg', '', 'null', 'null', 'May', '2028', 'EATRITE CORN FLAKES PLAIN', '<p>Eatrite Corn Flakes Plain 500gm is a nutritious and tasty breakfast meal. This product is an excellent source of vitamins, minerals, dietary fiber, proteins, and carbohydrates that keep you feeling fuller for longer. It is also beneficial for heart disease. Made from high-quality ingredients, Eatrite Corn Flakes Plain 500gm is an easy-to-prepare meal that you can enjoy anytime. With its great taste and nutritional benefits, it is perfect for busy mornings when you need a quick and healthy breakfast to start your day on the right track.</p><h4>Ingredients</h4><p>Ingredients Corn Grits, Sugar, Cereal Extract, Iodized Salt, Vitamins, Minerals And Antioxidant (INS 320).</p><p><strong>Suitable for everyone</strong></p><h4>Benefits of the Eatrite Corn Flakes Plain 500gm</h4><ul><li>Regarded as a healthy breakfast option in India and abroad, a cup of corn flakes contains 101 calories, 266 mg sodium, and 24 gms carbohydrates.</li><li>Also, the folic acid found in corn flakes helps produce new blood cells and prevents birth defects.</li></ul><h4>Product Specifications of Eatrite Corn Flakes Plain 500gm<br>&nbsp;</h4><ul><li>Made in India</li></ul><h4>Storage Information&nbsp;</h4><p>Store in a cool, dry and hygienic place</p>', 'EATRITE', 'SRI LAKSHMI NARASIMHA AGRO .,  FOODS 50/52., KAMASAWADI VILLGAE , DODDABALLAPURA TALUK, BANGALORE RURAL DISTT 561203', 'No', 'eatrite-corn-flakes-plain', 'other', '0', '2023-07-22 00:28:47', '2023-10-08 14:39:48'),
(68, '', '1 PACK OF 54 DIAPERS', 'null', 1399.00, 20, 10, 5, NULL, 0, 'No', '', 'd-511711690005800.jpeg', 'd-632271690005800.jpeg', 'd-933361690005800.jpeg', 'd-779891690005800.jpeg', 'null', 'null', 'Jun', '2026', 'PAMPERS PREMIUM CARE PANTS M', '<p>Pampers Premium Care Pants – M, in a pack of 54, are medium-sized baby diapers that comes with cotton-like soft top layer and air channels that prevent wetness, providing dryness for the longest time.</p><p>Pampers Premium Care Pants – M comes with a wetness indicator that turns from yellow to blue in order to indicate that it is the time to change the diaper. It also comes with a unique disposal tape that makes it easy to fold and dispose the diaper.</p><p><strong>Benefits of Pampers Premium Care Pants – M</strong></p><p>&nbsp;</p><ul><li>Soft top layer that keeps the baby comfortable</li><li>Air channels prevent wetness for the long hours</li><li>Wetness indicator turns from yellow to blue</li><li>Comes with a disposal tape that makes it easy to roll and dispose off the diaper</li></ul><h4>Usage</h4><p>Gently slip the baby into Pampers Premium Care Pants – M, making sure that the baby is comfortable with the fitting. When the wetness indicator turns from yellow to blue, indicate that it is time to change the diaper, gently remove the diaper and dispose the fecal matter into the toilet. Then, roll the diaper using the disposal tape and enclose it in a waste paper and dispose it in a waste paper basket.</p>', 'PAMPERS', 'PROCTER & GAMBLE, P&G PLAZA,CARDINAL GRACIAS ROAD,CHAKLA,ANDHERI(E),MUMBAI,MAHARASHTRA 400099', 'Yes', 'pampers-premium-care-pants-m', 'other', '0', '2023-07-22 00:33:20', '2023-07-22 00:33:20'),
(69, '', '50 ML', 'null', 559.00, 20, 10, 11, NULL, 0, 'Yes', '', 'd-133641690006461.jpeg', 'd-44591690006461.jpeg', '', '', 'null', 'null', 'Apr', '2027', 'SEBAMED MOISTURIZING CREAM', '<h2>Product Information</h2><p>SebaMed Moisturizing Cream, in the net quantity of 50ml, is a mild and highly hydrating moisturizing cream which helps make the texture of the skin soft and smooth. It helps impart a natural radiant glow to the skin. Enriched with Vitamin E, it neutralizes the effect of harsh environmental pollutants and other free-radicals, preventing premature aging of the skin. This cream\'s moisture complex protects the elasticity of the skin, keeping it looking healthy and youthful.</p><h4>Benefits of the SebaMed Moisturizing Cream</h4><ul><li>Enriched with Vitamin E, neutralizes the harsh effects of environmental pollutants and other free- radicals</li><li>Preserves the elasticity of the skin by replicating the skin\'s natural moisturizing factors</li><li>Softens the skin, making it smooth and healthy</li><li>Imparts a natural glow to the skin</li><li>Keeps the skin looking youthful and radiant</li></ul><h4>Usage</h4><p>After cleansing the face, take a required amount of the SebaMed Moisturizing Cream and apply it evenly all over the face and neck. Gently massage it into the skin using circular motions till the product gets completely absorbed. For best results, use twice, on a daily basis.</p>', 'SEBAMED', 'USV PVT LTD  B.S.D,MARG GOVANDI MUMBAI 400088', 'Yes', 'sebamed-moisturizing-cream', 'other', '0', '2023-07-22 00:44:21', '2023-07-22 00:44:21'),
(70, '', '1 PACK OF 10 TABLETS', '200MG', 98.00, 20, 9, 12, NULL, 1, 'No', '', 'd-737451690015356.jpeg', 'd-354721690015356.jpeg', 'd-490911690015356.jpeg', 'd-878851690015356.jpeg', '2', 'null', 'Jun', '2027', 'ZIFI', '<p>Zifi 200 Tablet is an antibiotic belonging that is used to treat a variety of bacterial infections. It is effective in infections of the respiratory tract (eg. pneumonia), urinary tract, ear, nasal sinus, throat, and some sexually transmitted diseases.<br><br>Zifi 200 Tablet should be given under the supervision of a doctor or health professional.&nbsp;Use it&nbsp;regularly at evenly spaced intervals as per the schedule prescribed by your doctor.&nbsp;Using it at the same time every day will help you remember to take it. The dose will depend on what you are being treated for, but you should always complete the full course of this antibiotic as prescribed by your doctor. Do not stop taking it until you have finished, even when you feel better. If you stop taking it early, some bacteria may survive and the infection may come back or worsen. It will not work for viral infections such as flu or common cold. Using any antibiotic when you do not need it can make it less effective for future infections.<br><br>The most common side effects of this medicine include nausea, stomach pain, indigestion, and diarrhea. These are usually mild but let your doctor know if they bother you or do not go away.<br><br>Before taking it, you should let your doctor know if you are allergic to any antibiotics or have any kidney or liver problems. You should also let your healthcare team know all other medicines you are taking as they may affect, or be affected by this medicine. This medicine is generally regarded as safe to use during pregnancy and breastfeeding if prescribed by a doctor.</p><h2><strong>BENEFITS OF ZIFI TABLET</strong></h2><h3>In Treatment of Bacterial infections</h3><p>Zifi 200 Tablet is an antibiotic medicine that works by killing the infection-causing bacteria in your body. It is effective for bacterial infections of the lungs, throat, and urinary tract among others. This medicine usually makes you feel better within a few days, but you should continue taking it as prescribed even when you feel better. Stopping it early may make the infection come back and harder to treat.</p><h2><strong>SIDE EFFECTS OF ZIFI TABLET</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Zifi</h3><ul><li>Nausea</li><li>Stomach pain</li><li>Indigestion</li><li>Diarrhea</li></ul><h2><strong>HOW TO USE ZIFI TABLET</strong></h2><p>Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Zifi 200 Tablet may be taken with or without food, but it is better to take it at a fixed time.</p><h2><strong>HOW ZIFI TABLET WORKS</strong></h2><p>Zifi 200 Tablet is an antibiotic. It kills the bacteria by preventing them from forming the bacterial protective covering (cell wall) which is needed for them to survive.</p>', 'FDC LIMITED', 'At Verna Ind Estate L 56-57,Verna Goa 403722', 'Yes', 'zifi', 'medicine', '0', '2023-07-22 03:12:36', '2023-07-22 03:12:36'),
(71, '', '1 PACK OF 10 TABLETS', '325MG', 291.00, 20, 9, 12, NULL, 1, 'No', '', 'd-363661690015710.jpeg', 'd-767661690015710.jpeg', 'd-908831690015710.jpeg', 'd-190861690015710.jpeg', '2', 'null', 'May', '2026', 'Zifi CV', '<p>Zifi CV 200 Tablet is a combination medicine. It is prescribed to treat various types of bacterial infections. It fights against the microorganisms to prevent their growth and further spread of the infection.<br><br>Zifi CV 200 Tablet is a prescription medicine. It is advised to take it as per the prescription. It can be taken with or without food, but it must be taken at a fixed time to ensure better efficacy. Do not consume more than the recommended dose, as this may have harmful effects on your body. If you miss a dose, take it as soon as you remember. The course of the treatment must be completed even if you feel better. Sudden discontinuation of the treatment may affect the potency of the medicine.<br><br>Some common side effects of this medicine are nausea, vomiting, diarrhea, indigestion, etc. If any of the side effects get aggravated, you must consult your doctor immediately. If you experience any allergic reaction (rashes, itching, swelling, shortness of breath, etc.), you must seek immediate medical help.<br><br>Before taking this medicine, you should tell your doctor if you are taking any medicines for any health condition. Pregnant or breastfeeding women should also consult with their doctor before taking it. Avoid drinking alcohol as it can cause excessive drowsiness with this medicine. It usually does not impair your ability to drive, but you should not drive if it makes you feel sleepy or dizzy. You must take adequate rest for a faster recovery, also take a healthy diet and drink plenty of water. Your doctor may ask for a few laboratory and diagnostic tests to know the effects of the medicine on your body.</p><h2><strong>BENEFITS OF ZIFI CV TABLET</strong></h2><h3>In Treatment of Bacterial infections</h3><p>Zifi CV 200 Tablet helps treat infections that are caused by bacteria. It contains two medicines, Cefixime, and Clavulanic acid. Cefixime stops the growth of infection-causing bacteria. Clavulanic Acid enhances the activity of Cefixime against the bacteria as well as reduces resistance of the bacteria to the antibiotic. This medicine usually makes you feel better within a few days, but you should continue taking it as prescribed even when you feel better to make sure that all the infectious bacteria are killed and do not become resistant.</p><h2><strong>SIDE EFFECTS OF ZIFI CV TABLET</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Zifi CV</h3><ul><li>Nausea</li><li>Diarrhea</li><li>Stomach pain</li><li>Indigestion</li><li>Flatulence</li></ul><h2><strong>HOW TO USE ZIFI CV TABLET</strong></h2><p>Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Zifi CV 200 Tablet may be taken with or without food, but it is better to take it at a fixed time.</p><h2><strong>HOW ZIFI CV TABLET WORKS</strong></h2><p>Zifi CV 200 Tablet is a combination of two medicines: Cefixime and Clavulanic Acid. Cefixime is an antibiotic. It works by preventing the formation of the bacterial protective covering which is essential for the survival of bacteria. Clavulanic Acid is a beta-lactamase inhibitor which reduces resistance and enhances the activity of Cefixime against bacteria.</p>', 'FDC Ltd', 'FDC LIMITED, B-8, MIDC Area, Waluj - 431 136, Dist. Aurangabad, Maharashtra', 'Yes', 'zifi-cv', 'medicine', '0', '2023-07-22 03:18:30', '2023-10-08 14:24:03'),
(72, '', '1 PACK OF 10 CAPSULES', 'PLEASE SEE COMPOSITION', 275.00, 15, 9, 4, NULL, 2, 'Yes', '', 'd-85041690016112.jpeg', 'd-463381690016112.jpeg', '', '', 'Alpha lipoic acid 100 MG Benfotiamine 150 MG Chromium picolinate 200 MCG Folic acid 1.5 MG Inositol 100 MG Mecobalamin 1500 MCG Selenium dioxide 55 MCG', 'null', 'Jan', '2026', 'NERVON FORTE', '<ul><li>Multivitamin supplement help in cell growth and maintenance</li><li>Make up the deficiencies in the body and protection of cells from wear and tear</li><li>Treats anemia and iron deficiencies and also useful to treat poor parathyroid function</li><li>Treats the deficiency of clotting factors in the body</li><li>Required for maintenance of overall health of the body</li></ul>', 'IPCA LABORATORIES LTD', 'UNIT 2, 393, MELLI JORETHANG ROAD, GOM BLOCK, BHARIKHOLA, SOUTH DISTRICT, SIKKIM 737 121', 'No', 'nervon-forte-3', 'medicine', '0', '2023-07-22 03:25:12', '2023-07-22 03:25:12'),
(73, '', '1 PACK OF 20 TABLETS', 'PLEASE SEE COMPOSITION', 115.00, 10, 9, 2, NULL, 1, 'No', '', 'd-649711690016181.jpeg', '', '', '', 'Trypsin Chymotrypsin (100000AU)', 'on', 'Nov', '2029', 'CHYMORAL FORTE', '<h2><strong>PRODUCT INTRODUCTION</strong></h2><p>Chymoral Forte Tablet is a medicine used in the treatment of pain and inflammation (swelling). It helps relieve pain and swelling in postoperative wounds and other inflammatory diseases.<br><br>Chymoral For', 'TORRENT PHARMACEUTICALS LTD', 'MUMBAI, INDIA', 'No', 'chymoral-forte-1', 'medicine', '0', '2023-07-22 03:26:21', '2023-07-22 03:26:21'),
(74, '', '1 PACK OF 120 DIAPERS', 'null', 1649.90, 20, 9, 5, NULL, 0, 'Yes', '', 'd-773231690016736.jpeg', 'd-422721690016736.jpeg', 'd-363291690016736.jpeg', 'd-385371690016736.jpeg', 'null', 'null', 'Apr', '2030', 'HUGGIES WONDER PANTS MEGA JUMBO PACK M', '<p>Choose Huggies Complete Comfort which provides 5 in 1 Comfort for your baby – Bubble softness, India’s 1st pants with Bubble Bed to wrap your baby in softness. Made with air-friendly material that helps skin to breathe. With triple leak guard, Huggies helps keep your baby dry and protects against leakage. Comfy fit of Huggies ensures a snug fit helping against red marks.</p><p>Benefits of Huggies Wonder Pants Mega Jumbo Pack M 120S<br>Bubble softness – India’s 1st pants with Bubble Bed to wrap your baby in softness Breathable – Air-friendly material that helps skin to breathe Triple Leak Guard – Extra padding to fight leakage Comfy Fit – Cushiony waistband to ensure a snug fit<br>Product Specifications<br>Product type: Baby diapers Size: M<br>Usage/Dosage<br>Disposable diaper.</p><p>Storage<br>Store in a clean and hygienic place, away from heat or sunlight.</p>', 'HUGGIES', 'Kimberly-Clark India Pvt. Ltd.  Art Guild House, A-09 - 3rd Floor, Phoenix Market City, LBS Marg, Kurla (West), Mumbai - 400070', 'No', 'huggies-wonder-pants-mega-jumbo-pack-m-1', 'other', '0', '2023-07-22 03:35:36', '2023-10-08 13:57:35'),
(75, '', '1 PACK OF 100GM', 'null', 135.50, 10, 9, 11, NULL, 0, 'No', '', 'd-227021690017325.jpeg', 'd-85711690017325.jpeg', '', '', 'null', 'null', 'Feb', '2027', 'PONDS MAGIC TALC', '<p>Pond\'s Magic Freshness Talc, in the net quantity of 100gms, envelops you in the fragrance of Acacia Honey. This talc is finely milled and very smooth in texture which makes for easy application of the product. The product helps correct the uneven skin tone and brightens the dull skin. It gives the flawless matte-finish to the face by absorbing excess oil, keeping it shine-free all day.<br>It also offers protection from sweat and reduces bad body odour.</p><h4>Benefits of Pond’s Magic Freshness Talc</h4><ul><li>Fragrance of warm Acacia Honey that is pleasant and soothing to the senses</li><li>Finely milled and smooth in texture, which makes it easy to apply</li><li>Absorbs excess oil and gives a flawless matte-finish</li><li>Offers protection from sweat and reduces bad body odour</li><li>Gentle and non-irritating on the skin, it is ideal for daily use</li></ul><h4>Usage</h4><p>It is advisable to use the Pond\'s Magic Freshness Talc after showering and patting dry. It can be applied on the body and underarm area so as to regulate the sweat and reduce bad body odour. It can also be applied on the face to set your make up or even after cleansing and moisturizing the face. For best results, use this talc daily.</p>', 'PONDS', 'Hindustan Unilever Ltd.(Hul), Unilever House, B.D.Sawant Marg, Chakala, Andheri (E), Mumbai 400099, Maharashtra', 'No', 'ponds-magic-talc-1', 'other', '0', '2023-07-22 03:45:25', '2023-10-08 13:57:24'),
(76, '', '10 tablets', '4 MG', 51.30, 20, 12, 10, NULL, 1, 'Yes', '', 'd-363231696774235.jpeg', 'd-524891696774235.jpeg', 'd-31101696774235.jpeg', '', '2', '', 'May', '2026', 'Ondem', '<p>Ondem 4 Tablet is an antiemetic medicine commonly used to control nausea and vomiting due to certain medical conditions like stomach upset. It is also used to prevent nausea and vomiting caused due to any surgery, cancer drug therapy, or radiotherapy.<br><br>Ondem 4 Tablet may be used alone or with other medications and can be taken with or without food. Your doctor will suggest the appropriate dose depending on what you are taking it for. The first dose is normally taken before the start of surgery, chemotherapy, or radiotherapy. After these treatments, take any further doses as prescribed by your doctor (normally only for a few days at most). Take it regularly at the same time(s) each day to get the most benefit. Be careful not to take too much.<br><br>This medicine does not relieve other side effects associated with cancer treatments. Also, it has little effect on vomiting caused by motion sickness. The most common side effects of taking this medicine include headache, diarrhea, or constipation and feeling tired. These symptoms should disappear when you stop taking the medicine. However, if these side effects bother you or do not go away, your doctor may be able to suggest ways of preventing or reducing them.&nbsp;<br><br>Before taking this medicine, tell your doctor if you have heart or liver problems or a blockage in your stomach or intestines. Also, tell your doctor about any other medicines you might be taking, especially medicines to treat epilepsy, heart problems, cancer, and depression. These may affect, or be affected by, this medicine. If you are pregnant or breastfeeding, ask for advice from your doctor.</p><h2><strong>USES OF ONDEM TABLET</strong></h2><ul><li>Treatment of Nausea</li><li>Treatment of Vomiting</li></ul><h2><strong>BENEFITS OF ONDEM TABLET</strong></h2><h3>In Treatment of Nausea</h3><p>Ondem 4 Tablet blocks the action of chemicals in the body that can make you feel or be sick. It is often used to prevent nausea and vomiting that may be caused by cancer chemotherapy and radiation treatment (in adults and children aged 4 years and older). It is usually taken both before and after chemotherapy or radiation. This medicine helps you recover more comfortably from these treatments. It is also effective at preventing nausea and vomiting after an operation (in adults only). The dose will depend on what you are being treated for but always take this medicine as it is prescribed.</p><h2><strong>SIDE EFFECTS OF ONDEM TABLET</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Ondem</h3><ul><li>Constipation</li><li>Diarrhea</li><li>Fatigue</li><li>Headache</li></ul><h2><strong>HOW TO USE ONDEM TABLET</strong></h2><p>Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Ondem 4 Tablet may be taken with or without food, but it is better to take it at a fixed time.</p><h2><strong>HOW ONDEM TABLET WORKS</strong></h2><p>Ondem 4 Tablet is an antiemetic medication. It works by blocking the action of a chemical messenger (serotonin) in the brain that may cause nausea and vomiting during anti-cancer treatment (chemotherapy) or after surgery.</p><h2><strong>SAFETY ADVICE</strong></h2><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/alcohol.png\" alt=\"warnings\"></p><p><strong>Alcohol</strong></p><p>SAFE</p><p>Consuming alcohol with Ondem 4 Tablet does not cause any harmful side effects.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/pregnancy.png\" alt=\"warnings\"></p><p><strong>Pregnancy</strong></p><p>SAFE IF PRESCRIBED</p><p>Ondem 4 Tablet is generally considered safe to use during pregnancy. Animal studies have shown low or no adverse effects to the developing baby; however, there are limited human studies.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/lactation.png\" alt=\"warnings\"></p><p><strong>Breast feeding</strong></p><p>SAFE IF PRESCRIBED</p><p>Ondem 4 Tablet is probably safe to use during breastfeeding. Limited human data suggests that the drug does not represent any significant risk to the baby.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/driving.png\" alt=\"warnings\"></p><p><strong>Driving</strong></p><p>SAFE</p><p>Ondem 4 Tablet does not usually affect your ability to drive.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/kidney.png\" alt=\"warnings\"></p><p><strong>Kidney</strong></p><p>SAFE IF PRESCRIBED</p><p>Ondem 4 Tablet is safe to use in patients with kidney disease. No dose adjustment of Ondem 4 Tablet is recommended.<br>However, inform your doctor if you have an underlying kidney disease. Limited information is available in patients taking this medicine for more than one day.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/liver.png\" alt=\"warnings\"></p><p><strong>Liver</strong></p><p>CONSULT YOUR DOCTOR</p><p>There is limited information available on the use of Ondem 4 Tablet in patients with liver disease. Please consult your doctor.</p><h2><strong>WHAT IF YOU FORGET TO TAKE ONDEM TABLET?</strong></h2><p>If you miss a dose of Ondem 4 Tablet, take it as soon as possible. However, if it is almost time for your next dose, skip the missed dose and go back to your regular schedule. Do not double the dose.\\n</p>', 'Alkem Laboratories Ltd', 'Alkem Laboratories Limited, Devashish Building, Alkem House, Senapati Bapat Road, Lower Parel, Mumbai - 400 013.', 'Yes', 'ondem', 'medicine', '0', '2023-10-08 08:40:35', '2023-10-08 08:40:35'),
(77, '', '1 PACK OF 200GM', 'null', 125.20, 10, 9, 6, NULL, 0, 'No', '', 'd-362071682761070.jpeg', '', '', '', 'null', 'null', 'Jun', '2026', 'COLGATE ACTIVE SALT TOOTHPASTE', '<p>Colgate Active Salt Toothpaste, in the net quantity of 200gms, is a one of its kind toothpaste that makes use of Active Salt and its minerals to ensure complete oral care. It fights germs and makes the gums healthy. It also helps in reducing tooth sensitivity. This product also helps in the whitening of the teeth. Its minty flavour revitalizes you and keeps the mouth feeling fresh all day, thus preventing bad mouth odour.</p><h4>Benefits of Colgate Active Salt Toothpaste</h4><ul><li>Contains Active Salt which fights germs and makes the gums healthy</li><li>Whitens teeth</li><li>Reduces tooth sensitivity</li><li>Keeps the mouth feeling fresh</li><li>Prevents bad mouth odour</li></ul><h4>Usage</h4><p>After washing the mouth with water, take a required amount of the Colgate Active Salt Toothpaste onto a tooth brush and brush your teeth thoroughly for ideally 3 minutes; at least 2 minutes, with small upward and downward circular motions. Rinse off with water thoroughly afterwards. For best results, use twice, daily – once in the morning and once before going to bed.</p>', 'COLGATE', 'COLGATE PALMOLIVE INDIA LTD  Plot No78,Epip Phase 1,Jharmajri,Baddi,Tehsil Nalagrah,Distt Solan H.P 174103', 'Yes', 'colgate-active-salt-toothpaste-3', 'other', '0', '2023-10-08 13:57:12', '2023-10-08 14:13:56');
INSERT INTO `products` (`id`, `name`, `variant_name`, `strength`, `mrp`, `discount`, `pharmacy_id`, `category_id`, `sub_category_id`, `formulation_id`, `avaliblity`, `brand_name`, `image`, `image_2`, `image_3`, `image_4`, `salt_name`, `expiry_type`, `expiry_month`, `expiry_year`, `title`, `description`, `manufacturer_name`, `manufacturer_address`, `prescription_required`, `slug`, `productType`, `is_deleted`, `created_at`, `updated_at`) VALUES
(78, '', '10 TABLETS', '10 MG', 50.47, 20, 15, 14, NULL, 1, 'Yes', '', 'd-663191701076817.jpeg', 'd-713721701076817.jpeg', 'd-374891701076817.jpeg', '', '4', '', 'Apr', '2025', 'ZEROGRAIN', '<p>Zerograin 10 Tablet is a medicine used for the prevention of migraines. However, it cannot treat an acute attack and will only work to prevent migraines for as long as you continue to take the medicine. This medicine relaxes the brain, preventing migraine headaches.<br><br>Zerograin 10 Tablet may be taken with or without food. However, it is advised to take it at the same time each day as this helps to maintain a consistent level of medicine in the body. Do not skip any doses and finish the full course of treatment even if you feel better and if you have missed a dose, take it as soon as you remember. You should continue to take this medicine for as long as the doctor advises and do not stop taking it suddenly.<br><br>Side effects associated with the use of this medicine include muscle pain, fatigue, constipation, nausea, insomnia (difficulty sleeping), and runny nose. Some other side effects that may be seen on taking this medicine are increased appetite, depression, stomach discomfort, and breast pain. It may also cause sleepiness at the beginning of your treatment, so do not drive, operate machinery, until you know how this medicine affects you.<br><br>It may also cause weight gain and to prevent it you can eat a healthy balanced diet and should exercise regularly. This medicine may cause changes in your mood and you may feel depressed, therefore, regular monitoring of behavior is important. Pregnant or breastfeeding mothers should consult their doctor before taking this medicine.</p><h2><strong>USES OF ZEROGRAIN TABLET</strong></h2><h3>&nbsp;Prevention of Migraine</h3><p>Zerograin 10 Tablet helps improve the flow of blood in your brain and prevents abnormal activity of muscles that triggers migraines. It is a very effective medicine for preventing migraine attacks, however, it does not treat an attack that has already started. By preventing and reducing the frequency migraine attacks, the medicine can help you carry out your daily activities and improve your quality of life.</p><h2><strong>SIDE EFFECTS OF ZEROGRAIN TABLET</strong></h2><p>Most side effects do not require any medical attention and disappear as your body adjusts to the medicine. Consult your doctor if they persist or if you’re worried about them</p><h3>Common side effects of Zerograin</h3><ul><li>Sleepiness</li><li>Weight gain</li><li>Muscle pain</li><li>Fatigue</li><li>Constipation</li><li>Nausea</li><li>Insomnia (difficulty in sleeping)</li><li>Runny nose</li><li>Increased appetite</li><li>Depression</li><li>Stomach discomfort</li><li>Breast pain</li></ul><h2><strong>HOW TO USE ZEROGRAIN TABLET</strong></h2><p>Take this medicine in the dose and duration as advised by your doctor. Swallow it as a whole. Do not chew, crush or break it. Zerograin 10 Tablet may be taken with or without food, but it is better to take it at a fixed time.</p><h2><strong>HOW ZEROGRAIN TABLET WORKS</strong></h2><p>Migraine headaches are thought to result from the dilatation of blood vessels in the head. Zerograin 10 Tablet works by preventing loss of tone and dilation of blood vessels, thus preventing the migraine headache.</p><h2><strong>SAFETY ADVICE</strong></h2><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/alcohol.png\" alt=\"warnings\"></p><p><strong>Alcohol</strong></p><p>UNSAFE</p><p>Zerograin 10 Tablet may cause excessive drowsiness with alcohol.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/pregnancy.png\" alt=\"warnings\"></p><p><strong>Pregnancy</strong></p><p>CONSULT YOUR DOCTOR</p><p>Information regarding the use of Zerograin 10 Tablet during pregnancy is not available. Please consult your doctor.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/lactation.png\" alt=\"warnings\"></p><p><strong>Breast feeding</strong></p><p>CONSULT YOUR DOCTOR</p><p>Information regarding the use of Zerograin 10 Tablet during breastfeeding is not available. Please consult your doctor.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/driving.png\" alt=\"warnings\"></p><p><strong>Driving</strong></p><p>CONSULT YOUR DOCTOR</p><p>It is not known whether Zerograin 10 Tablet alters the ability to drive. Do not drive if you experience any symptoms that affect your ability to concentrate and react.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/kidney.png\" alt=\"warnings\"></p><p><strong>Kidney</strong></p><p>SAFE IF PRESCRIBED</p><p>Zerograin 10 Tablet is probably safe to use in patients with kidney disease. Limited data available suggests that dose adjustment of Zerograin 10 Tablet may not be needed in these patients. Please consult your doctor.<br>However, consult your doctor if have severe kidney disease.</p><p><img src=\"https://onemg.gumlet.io/w_50,h_50/q_auto,f_auto/liver.png\" alt=\"warnings\"></p><p><strong>Liver</strong></p><p>CAUTION</p><p>Zerograin 10 Tablet should be used with caution in patients with liver disease. Dose adjustment of Zerograin 10 Tablet may be needed. Please consult your doctor.</p><h2><strong>WHAT IF YOU FORGET TO TAKE ZEROGRAIN TABLET?</strong></h2><p>If you miss a dose of Zerograin 10 Tablet, skip it and continue with your normal schedule. Do not double the dose.</p>', 'MANKIND PHARMA LTD', '208, Okhla Industrial Estate, Phase III, New Delhi - 110020', 'Yes', 'zerograin-1', 'medicine', '0', '2023-11-27 03:50:17', '2023-11-27 03:51:59'),
(79, '', '15 CAPSULES', 'null', 231.00, 20, 15, 15, NULL, 2, 'Yes', '', 'd-390771701079634.jpeg', 'd-714841701079634.jpeg', 'd-307171701079634.jpeg', 'd-786801701079634.jpeg', '5', '', 'May', '2026', 'FOLVITE MB', '<p><strong>PRODUCT INFORMATION</strong></p><p>This medicine is a combination of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12. These are essential nutrients required by the body for healthy nervous system, blood and to support the immune system. It also helps in division of cells, formation of haemoglobin, development of blood cells, development of brain &amp; spinal cord and for overall growth, development and functioning of the organs. It helps to reduce homocysteine levels (an amino acid linked with heart diseases, strokes and blood vessel disorders).</p><p><strong>USES</strong></p><ul><li>It is used for treatment and prevention of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12 deficiency which may be due to nutritional causes or malabsorption.&nbsp;</li><li>It is used in the management of anemia, neuropathies like diabetic neuropathy, alcoholic neuropathy, drug-induced neuropathy, trigeminal neuralgia, sciatica and optic neuritis.&nbsp;</li><li>It helps to reduce homocysteine levels in blood (hyperhomocysteinemia), the major factor for atherosclerosis. and help in preventing heart diseases, strokes and blood vessel disorders.</li></ul><p><strong>HOW TO USE</strong></p><p>It should be taken in the dose and duration as advised by your doctor. It may be taken with or without food. Do not chew, cut or break the medicine. Swallow it as a whole with a glass of water.&nbsp;</p><p><strong>HOW DOES IT WORK</strong></p><p>It restores the levels of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12 in the body which helps the body in division of cells, formation of haemoglobin, development of blood cells, development of brain &amp; spinal cord and for overall growth, development and functioning of the organs. It helps to reduce homocysteine levels (an amino acid linked with heart diseases, strokes and blood vessel disorders).</p><p>Folic Acid (Vitamin B9) is important for synthesis of DNA and amino acids. It helps in cell division, development of blood cells and supports immune functions.</p><p>Vitamin B12 (Methylcobalamin) is essential for DNA synthesis, production of red blood cells, and functioning of the brain and nerves.</p><p>Vitamin B6 (pyridoxine) acts as a coenzyme for various reactions in the body and helps in boosting metabolism. It is also important for proper regeneration and nerve function.</p><p><strong>COMMON SIDE EFFECTS</strong></p><ul><li>Stomach upset</li><li>Bloating, flatulence&nbsp;</li><li>Nausea, vomiting</li><li>Loss of appetite (anorexia)</li><li>Headache</li><li>Diarrhea, abdominal pain</li><li>Skin rash, hot flushes</li></ul><p>This is not a complete list of side effects and others may occur. Call your doctor for medical advice about side effects. Minor side effects disappear as the body adjusts to the medicine and mostly do not require medical attention. Consult your doctor if the side effects persist or if you’re worried about them.</p><p><strong>WHAT TO DO IF I MISS A DOSE</strong></p><p>Take a missed dose as soon as you recall it. However, if it is close to the time for your next dose, skip the missed dose and go back to your regular schedule. Do not take 2 doses at the same time or extra doses.&nbsp;</p><p><strong>CONTRAINDICATIONS</strong></p><p><strong>&nbsp;</strong></p><ul><li>Allergy to Folic acid or Vitamin B9 or L-methyl folate or Vitamin B6 or Pyridoxin or Pyridoxal phosphate or Vitamin B12 or Adenosylcobalamin or Cyanocobalamin or Methylcobalamin or Mecobalamin or any other ingredients.</li></ul><p><strong>&nbsp;</strong></p><p><strong>PRECAUTIONS</strong></p><p>&nbsp;</p><p><strong>Alcohol:</strong> Avoid alcohol when using this drug as alcohol may decrease the absorption of this drug.</p><p>&nbsp;</p><p><strong>Pregnancy:</strong> Though, this drug is generally considered safe to use during pregnancy, should be used only if clearly needed. Please consult your doctor.&nbsp;if you are pregnant or planning to get pregnant.</p><p>&nbsp;</p><p><strong>Breast feeding:&nbsp;</strong>This drug is generally considered safe to use during breastfeeding. Consult your doctor if you are breast feeding.</p><p>&nbsp;</p><p><strong>Driving:</strong>&nbsp;This drug doesn’t affect your ability to drive.</p><p>&nbsp;</p><p><strong>Kidney:</strong> This drug should be used with caution in patients with kidney disease. Please consult your doctor&nbsp;if you have any kidney disease, before using this drug.</p><p>&nbsp;</p><p><strong>Liver:</strong>&nbsp;This drug should be used with caution in patients with severe liver disease. Inform your doctor if you have any liver illness, before using this drug.</p><p><strong>Children: </strong>A child\'s dose of this drug depends upon the age and weight of the child. Follow your doctor\'s dosing instructions very carefully. Do not give a child more than the prescribed dose of this drug.</p><p><strong>Other precautions:&nbsp;</strong></p><p>&nbsp;</p><ul><li>Don’t take this medicine, if you have an Allergy to Folic acid or Vitamin B9 or L-methyl folate or Vitamin B6 or Pyridoxin or Pyridoxal phosphate or Vitamin B12 or Adenosylcobalamin or Cyanocobalamin or Methylcobalamin or Mecobalamin or any other ingredients. Tell your doctor if you are allergic to any drugs.</li></ul><p>&nbsp;</p><ul><li>Tell your doctor if you have or ever had any history of kidney disease, liver disease, diabetes, heart disease, bleeding disorders, stomach/intestinal problems, Leber\'s disease or other form of optic nerve damage or low levels of potassium in your blood.</li></ul><p>&nbsp;</p><ul><li>Tell your doctor about all the medications you are taking for your previous ailments.&nbsp;</li></ul><p><strong>&nbsp;</strong></p><p><strong>DRUG INTERACTIONS</strong></p><p>Sometimes drugs are not safe when you take them with certain other drugs and food. Taking them together can cause bad side effects. Be sure to talk to your doctor about all the drugs you take.</p><p>Consult your doctor if you are taking this medicine with the following drugs:</p><p>Chloramphenicol, Neomycin, Nitrofurantoin, Pyrimethamine, Pantoprazole, Omeprazole, Ranitidine, Famotidine, Arsenic Trioxide, Methotrexate, Colchicine, Amino Salicylic Acid, Altretamine, Phenobarbital, Phenytoin, Primidone, Levodopa, Oral Contraceptives.</p><p><strong>STORAGE:</strong> Store in a cool, dry place away from the reach of children.&nbsp;Store below 30°C.</p><p><strong>&nbsp;</strong></p><p><strong>FAQs</strong></p><p>&nbsp;</p><p><strong>Q: What is&nbsp;this medicine? What is it used for?</strong></p><p>&nbsp;</p><p>A: This medicine is a combination of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12.&nbsp;It is used for treatment and prevention of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12 deficiency which may be due to nutritional causes or malabsorption. It is used in the management of anemia, neuropathies like diabetic neuropathy, alcoholic neuropathy, drug-induced neuropathy, trigeminal neuralgia, sciatica and optic neuritis. It also helps to reduce homocysteine levels in blood (hyperhomocysteinemia), the major factor for atherosclerosis. and help in preventing heart diseases, strokes and blood vessel disorders.&nbsp;</p><p>&nbsp;</p><p><strong>Q: Can&nbsp;this medicine be taken empty stomach?</strong></p><p>&nbsp;</p><p>A: It should be taken in the dose and duration as advised by your doctor. It may be taken with or without food. Do not chew, cut or break the medicine. Swallow it as a whole with a glass of water.</p><p>&nbsp;</p><p><strong>Q: Can I take other nutritional supplements along with his medicine?</strong></p><p>&nbsp;</p><p>A: No. You should avoid taking other nutritional supplements along with his medicine as it may lead to a vitamin overdose and side effects.</p><p>&nbsp;</p><p><strong>Q: Can I take antacids while using this medicine?</strong></p><p>&nbsp;</p><p>A: It is advised to take this medicine two hours before or four hours after taking antacids, as antacids may interfere with its absorption.</p><p>&nbsp;</p><p><strong>Q: What are the dietary sources of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12?</strong></p><p>A: Dietary sources of folic acid are Dark green leafy vegetables (peas, turnip greens, spinach, romaine lettuce, asparagus, Brussels, sprouts, broccoli), beans, peanuts, sunflower seeds, fresh fruits, fruit juices, whole grains, liver, aquatic foods, eggs, fortified foods and supplements.</p><p>Dietary sources of vitamin B12 are primarily animal meat, fish, eggs, and dairy products.</p><p>Dietary sources of vitamin B6 are dark leafy greens, bananas, avocados, papayas, oranges, fortified cereals, nuts, beef liver, tuna, meat, salmon, chickpeas, poultry and cantaloupe.</p><p><strong>Q: Can&nbsp;this medicine be used during pregnancy?</strong></p><p>A:&nbsp;Though, it is generally considered safe to use during pregnancy, should be used only if clearly needed.&nbsp;Consult your doctor if you are pregnant before taking this medicine.</p><p><strong>Q: Can I stop taking this medicine if I feel well?</strong></p><p>A: No. You should continue taking this medicine for as long as your doctor has recommended it to achieve full benefit. Consult your doctor if you experience any difficulty while taking this medicine.</p><p><strong>Q: Is it safe to take&nbsp;this medicine for a long time?</strong></p><p>&nbsp;</p><p>A: It is unlikely to harm you if taken for a long time but should be used for as long as prescribed by your doctor.</p><p>&nbsp;</p><p><strong>Q: Does this medicine cause diarrhoea?</strong></p><p>A: Yes. This medicine may cause diarrhoea as a side effect. You should drink plenty of fluids, maintain hydration and eat non-spicy food, if you experience such side effect. Consult your doctor if you have severe diarrhoea or if you find blood in stools.</p><p><strong>&nbsp;</strong></p><p><strong>REFERENCES</strong></p><ul><li>CDSCO [Internet]. Cdscoonline.gov.in. 2023.</li><li>Vitamins and minerals - B vitamins and folic acid [Internet]. nhs.uk. 2023.</li><li>Folate (Folic Acid) – Vitamin B9 [Internet]. The Nutrition Source. 2023.</li><li>Vitamin B12 [Internet]. The Nutrition Source. 2023.</li><li>Office of Dietary Supplements - Vitamin B12 [Internet]. Ods.od.nih.gov. 2023.</li><li>B-Vitamins and Bone Health–A Review of the Current Evidence [Internet]. Ncbi.nlm.nih.gov. 2023.</li><li>Combs Jr. GF, McClung JP. The Vitamins: Fundamental Aspects in Nutrition and Health. 5th ed. Westborough, MA: Academic Press; 2017.</li><li>Vitamin B12 - Fact Sheet for Health Professionals [Internet]. Nccih.nih.gov. 2023.</li><li>Folate - Fact Sheet for Health Professionals [Internet]. Nccih.nih.gov. 2023.</li><li>Office of Dietary Supplements - Vitamin B6 [Internet]. Ods.od.nih.gov. 2023.</li><li>Coates PM, Betz JM, Blackman MR, et al. (Editors). Encyclopedia of Dietary Supplements. 2nd ed. Boca Raton, FL: CRC Press; 2010.</li><li>The Benefits Of Methylfolate [Internet]. Tespo Vitamins. 2023.</li></ul><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;</p><p><strong>Disclaimer:</strong></p><p>This information is solely intended to provide a general overview on the product that is it accurate and reliable, as it is reviewed by expert professionals. The information provided here is for informational purposes only. This information is not intended to replace or be a substitute for a registered medical practitioner\'s medical treatment/advice or consultation or create a doctor-patient relationship. This may not cover everything about particular health conditions, lab tests, medicines, all possible side effects, drug interactions, warnings, alerts, etc. You should not use this information to diagnose, prevent, or cure a health problem. Please consult your doctor and discuss all your queries or doubts related to any disease or medicine. You hereby agree that you shall not make any health or medical-related decision based in whole or in part on anything contained in the Site.</p>', 'PFIZER LIMITED', 'The Capital, 1802, 18th Floor , Plot No. C-70, ‘G’ Block , Bandra Kurla Complex, Bandra East , Mumbai – 400051.', 'No', 'folvite-mb', 'medicine', '0', '2023-11-27 04:37:14', '2023-11-27 04:37:14'),
(80, '', '20 TABLETS', '40 MG', 137.07, 20, 15, 16, NULL, 1, 'Yes', '', 'd-287491701088050.jpeg', 'd-715481701088050.jpeg', 'd-636791701088050.jpeg', '', '6', '', 'May', '2025', 'TIGATEL', '<p><strong>PRODUCT INFORMATION</strong></p><p>The active ingredient in this medicine is Telmisartan. It is an angiotensin II receptor antagonist (ARB) used in the management of high blood pressure (hypertension).</p><p><strong>USES</strong></p><p>It is used for the treatment of high blood pressure (hypertension). This medicine is also helpful in reducing the chances of heart disease, stroke or death from heart diseases in high-risk patients. This medicine is also effective in preserving kidney function, in hypertensive patients with type-2 diabetes mellitus and treatment of diabetic nephropathy.</p><p><strong>HOW TO USE</strong></p><p>It should be taken in the dose and duration as advised by your doctor. It may be taken with or without food. Do not chew, cut or break the medicine. Swallow it as a whole with a glass of water.&nbsp;</p><p><strong>HOW DOES IT WORK</strong></p><p>The active ingredient in this medicine is Telmisartan. It blocks the binding of angiotensin II (a vasoconstrictor) to the receptors in vascular smooth muscle and the adrenal gland, resulting in decreased systemic vascular resistance, thereby allowing the blood to flow more smoothly and the heart to pump more efficiently.</p><p><strong>COMMON SIDE EFFECTS</strong></p><ul><li>Dizziness or light-headedness</li><li>Back pain</li><li>Sinus pain, cough and congestion</li><li>Diarrhea</li><li>Headache</li></ul><p>&nbsp;</p><p>This is not a complete list of side effects and others may occur. Call your doctor for medical advice about side effects. Minor side effects disappear as the body adjusts to the medicine and mostly do not require medical attention. Consult your doctor if the side effects persist or if you’re worried about them.</p><p><strong>WHAT TO DO IF I MISS A DOSE</strong></p><p>Take a missed dose as soon as you recall it. However, if it is close to the time for your next dose, skip the missed dose and go back to your regular schedule. Do not take 2 doses at the same time or extra doses.&nbsp;</p><p><strong>CONTRAINDICATIONS</strong></p><p><strong>&nbsp;</strong></p><ul><li>Hypersensitivity to telmisartan or any other component of this product.</li><li>Coadministration with Aliskiren in patients with diabetes or renal impairment.</li><li>Biliary obstructive disorders.&nbsp;</li><li>Severe hepatic impairment.&nbsp;</li><li>Pregnancy.</li></ul><p><strong>&nbsp;</strong></p><p><strong>PRECAUTIONS</strong></p><p>&nbsp;</p><p><strong>Alcohol:</strong>&nbsp;Do not drink alcohol if you are taking this medicine because alcohol may decrease your blood pressure and increases the side effects.</p><p>&nbsp;</p><p><strong>Pregnancy:</strong> This medicine is not recommended if you are pregnant or planning to get pregnant as there is evidence of risk to developing fetus. If&nbsp;pregnancy is detected, discontinue the drug as soon as possible.&nbsp;Please consult your doctor.</p><p>&nbsp;</p><p><strong>Breast feeding:&nbsp;</strong>Its use is not recommended during breast feeding. There is lack of data regarding presence of&nbsp;this medicine in human milk, the effects on the breastfed infant, or the effects on milk production. Consult your doctor if you are breast feeding before taking this drug.</p><p>&nbsp;</p><p><strong>Driving:</strong> This medicine may cause dizziness, decrease alertness. Avoid driving, if these symptoms occur.</p><p>&nbsp;</p><p><strong>Kidney:</strong> This medicine should be used with caution in patients with severe kidney disease. Dose adjustment may be required. Inform your doctor if you have any kidney disease, before using this drug.</p><p>&nbsp;</p><p><strong>Liver:</strong>&nbsp;This medicine should be used with caution in patients with liver disease. Dose adjustment may be required. It is not recommended in patients with severe liver disease. Inform your doctor if you have any liver illness, before using this drug.</p><p><strong>Children:&nbsp;</strong>Use of this medicine is not recommended below 18 years of age.</p><p><strong>Other precautions:&nbsp;</strong></p><p>&nbsp;</p><ul><li>Don’t take this medicine if you have an allergy to Telmisartan or any other part of this drug. Tell your doctor if you are allergic to any drugs.</li></ul><p>&nbsp;</p><ul><li>Tell your doctor if you have or have ever had heart disease, kidney disease, liver disease, blockage of the bile duct (which can occur with gallstones, tumors, or injury).</li></ul><p>&nbsp;</p><ul><li>Diarrhea, vomiting, not drinking enough fluids, and sweating a lot can cause a drop in blood pressure, which may cause light-headedness and fainting. Tell your doctor if you have any of these problems or develop them during your treatment.</li></ul><p>&nbsp;</p><p><strong>DRUG INTERACTIONS</strong></p><p><strong>&nbsp;</strong></p><p>Sometimes drugs are not safe when you take them with certain other drugs and food. - Taking them together can cause bad side effects. - Be sure to talk to your doctor about all the drugs you take.</p><p>&nbsp;</p><p>Consult your doctor if you are taking this drug with the following medicines:</p><p>&nbsp;</p><p>Aliskiren, Furosemide, Hydrochlorothiazide, Digoxin, Spironolactone, Eplerenone, Triamterene, Amiloride, Lisinopril, Enalapril, Ramipril, Benazepril, Heparin, Ciclosporin, Tacrolimus, Trimethoprim, Ibuprofen, Aspirin, Celecoxib, Indomethacin, Lithium, Hydrocortisone, Prednisolone.</p><p><strong>&nbsp;</strong></p><p><strong>STORAGE:</strong> Store in a cool, dry place away from the reach of children.&nbsp;Store below 30°C.</p><p><strong>&nbsp;</strong></p><p><strong>FAQs</strong></p><p>&nbsp;</p><p><strong>Q: What is this medicine? What is it used for?</strong></p><p>&nbsp;</p><p>A: This medicine is an angiotensin II receptor antagonist used in the management of high blood pressure (hypertension). This medicine is also helpful in reducing the chances of heart disease, stroke or death from heart diseases in high-risk patients.</p><p>&nbsp;</p><p><strong>Q: Is this medicine a blood thinner?</strong></p><p>A: No, this medicine is not a blood-thinner medicine. It is an angiotensin II receptor antagonist used in the management of high blood pressure.</p><p>&nbsp;</p><p><strong>Q: Are</strong>&nbsp;<strong>this medicine and amlodipine same?</strong></p><p>&nbsp;</p><p>A: No, this medicine and amlodipine are not the same. Both are used for the treatment of high blood pressure and can be used in combination. However, they differ in their class of medicine and their mode of action. This medicine is an angiotensin II receptor antagonist, while amlodipine is a calcium channel blocker.</p><p>&nbsp;</p><p><strong>Q: What is the best time to takethis medicine, in the morning or at night?</strong></p><p>&nbsp;</p><p>A: You should take this medicine exactly as recommended by your doctor. Generally, it is recommended to be taken once daily, either in the morning or in the evening. This medicine may be taken with or without food, try to take it at the same time every day for effective blood pressure control.</p><p>&nbsp;</p><p><strong>Q: How much time does this medicine take to work?</strong></p><p>&nbsp;</p><p>A: This medicine starts working within an hour after its oral intake. You may see an improvement within a few days, but it usually takes 2 to 4 weeks to show its full benefit.&nbsp;</p><p>&nbsp;</p><p><strong>Q: Can I stop taking</strong>&nbsp;<strong>this medicine if my blood pressure is controlled.</strong></p><p>&nbsp;</p><p>A: No, you should not stop taking this medicine without consulting your doctor even if your blood pressure is controlled. This medicine controls high blood pressure but does not cure it. Stopping it suddenly may increase your blood pressure which may be harmful. Talk to your doctor if you have any concerns.</p><p>&nbsp;</p><p><strong>Q: Does this medicine use cause weight gain?</strong></p><p>&nbsp;</p><p>A: No, this medicine is not known to cause weight gain.&nbsp;</p><p>&nbsp;</p><p><strong>Q: Can this medicine cause cough?</strong></p><p>A: Yes, some individuals may experience cough with the use of this medicine. However, if the cough is persistent, it is recommended to consult your doctor.</p><p><strong>Q: Can this medicine cause increased potassium level in blood (hyperkalemia)?</strong></p><p>&nbsp;</p><p>A: This medicine may cause increased potassium level in blood (hyperkalaemia). Your doctor may advise a regular monitoring of blood potassium levels while taking this medicine. Inform your doctor if you have any kidney-related problems before starting with this medicine.</p><p><strong>Q: Can I take this medicine if I am taking antidiabetic medicines?</strong></p><p>A: Yes, you can take this medicine and your antidiabetic medicines as prescribed by your doctor.</p><p><strong>Q: What dietary restrictions and life style modifications should I do to control high blood pressure?</strong></p><p>A: In addition to taking medication, dietary restrictions and life style modifications will also help to control your blood pressure. These include eating a diet that is low in fat and salt (avoid pickles and packaged foods like chips as it contains excess salt), maintaining a healthy weight, at least 30 minutes exercise daily, not smoking, and using alcohol in moderation.&nbsp;</p><p><strong>REFERENCES</strong></p><ul><li>CDSCO [Internet]. Cdscoonline.gov.in. 2023.</li><li>AG-Telmisartan Tablet [Internet]. Pdf.hres.ca. 2023.</li><li>Pfeffer MA, Opie LH. Inhibitors of the Renin-Angiotensin-Aldosterone System. In: Opie LH, Gersh BJ, editors. Drugs for the Heart. 8th ed. Philadelphia, Pennsylvania: Elsevier Saunders; 2013. p. 157.</li><li>Telmisartan [Internet]. Ncbi.nlm.nih.gov. 2023.&nbsp;</li><li>Medscape.com</li><li>Telmisartan. Bracknell, Berkshire: Boehringer Ingelheim Limited; 1998 [revised Nov. 2017].</li><li>Chaves RG, Lamounier JA. Breastfeeding and maternal medications. J Pediatr (Rio J). 2004;80(5 Suppl):S189-S198</li><li>Telmisartan. Ingelheim, Germany: Boehringer Ingelheim Pharma KG; 1998.</li><li>Micardis 20 mg tablets - Patient Information Leaflet (PIL) - (emc) [Internet]. Medicines.org.uk. 2023.</li></ul><p>&nbsp;</p><p><strong>Disclaimer:</strong></p><p>This information is solely intended to provide a general overview on the product that is it accurate and reliable, as it is reviewed by expert professionals. The information provided here is for informational purposes only. This information is not intended to replace or be a substitute for a registered medical practitioner\'s medical treatment/advice or consultation or create a doctor-patient relationship. This may not cover everything about particular health conditions, lab tests, medicines, all possible side effects, drug interactions, warnings, alerts, etc. You should not use this information to diagnose, prevent, or cure a health problem. Please consult your doctor and discuss all your queries or doubts related to any disease or medicine. You hereby agree that you shall not make any health or medical-related decision based in whole or in part on anything contained in the Site.</p>', 'SUN PHARMA', 'ACME Plaza, Andheri-Kurla Road, Andheri (East),   MUMBAI  400 059 India', 'Yes', 'tigatel', 'medicine', '0', '2023-11-27 06:57:30', '2023-11-27 06:57:30'),
(81, '', '10 TABLETS', 'null', 409.75, 20, 15, 17, NULL, 1, 'No', '', 'd-944291701093739.jpeg', 'd-911031701093739.jpeg', 'd-735751701093739.jpeg', 'd-303561701093739.jpeg', '7', '', 'Apr', '2025', 'RETOZ MR', '<p><strong>PRODUCT INFORMATION</strong></p><p>It is a combination of Etoricoxib and Thiocolchicoside. It is a non-opioid analgesic (pain relieving) drug with marked muscle relaxant, anti-inflammatory (reducing swelling or oedema) properties.&nbsp;</p><p><strong>USES</strong></p><p>It is used to relieve pain, swelling, inflammation and relax muscles in acute or chronic back pain, neck pain, spine-related disorders, torticollis, myalgia, muscle spasms, musculoskeletal pain, rheumatoid arthritis, osteoarthritis, ankylosing spondylitis, extra-articular rheumatism, muscle inflammation, fracture, post traumatic pain, postoperative pain in people greater than 16 years of age.&nbsp;</p><p><strong>HOW TO USE</strong></p><p>It should be taken in the dose and duration as advised by your doctor. It may be taken with or without food. Swallow it as a whole with a glass of water. Do not chew, crush or break it.&nbsp;</p><p><strong>HOW DOES IT WORK</strong></p><p>It is a combination of Etoricoxib and Thiocolchicoside. Etoricoxib relieves pain by inhibiting the enzyme (Cyclooxygenase-2 or COX-2) that is responsible for the formation of certain chemicals (prostaglandins IL-1β, and TNF) which are responsible for causing the pain, fever, swelling, and redness.</p><p>Thiocolchicoside is a centrally acting skeletal muscle relaxant. It has GABA-mimetic and glycinergic actions on the centres of the spinal cord and brain, thereby reducing skeletal muscle spasm, stiffness, improves muscle movements, and provides relief in pain.</p><p>Together they provide relief in pain, inflammation and relaxation of muscles more effectively.</p><p><strong>COMMON SIDE EFFECTS</strong></p><ul><li>Stomach pain</li><li>Heartburn, epigastric pain, dyspepsia</li><li>Indigestion</li><li>Nausea</li><li>Vomiting</li><li>Diarrhoea</li><li>Dizziness</li><li>Loss of appetite</li><li>Flatulence</li><li>Swelling of the legs or feet</li><li>Flu-like symptoms (fever, cold, cough, or sore throat)</li><li>Wheezing or shortness of breath</li></ul><p>This is not a complete list of side effects and others may occur. Call your doctor for medical advice about side effects. Minor side effects disappear as the body adjusts to the medicine and mostly do not require medical attention. Consult your doctor if the side effects persist or if you’re worried about them.</p><p><strong>WHAT TO DO IF I MISS A DOSE</strong></p><p>Take a missed dose as soon as you recall it. However, if it is close to the time for your next dose, skip the missed dose and go back to your regular schedule. Do not take 2 doses at the same time or extra doses.&nbsp;</p><p><strong>CONTRAINDICATIONS</strong></p><p><strong>&nbsp;</strong></p><ul><li>Allergy to Etoricoxib,&nbsp;Thiocolchicoside, Aspirin, Ibuprofen or other NSAIDs or any ingredients.&nbsp;</li><li>Severe hepatic impairment</li><li>Severe renal impairment</li><li>Active or history of peptic ulcer/ gastrointestinal haemorrhage.</li><li>Inflammatory bowel disease</li><li>Children and adolescent &lt;16 years.&nbsp;</li><li>Pregnancy and lactation.</li><li>History of gastrointestinal bleeding or perforation related to previous NSAID therapy.</li><li>Congestive heart failure, severe heart failure, uncontrolled hypertension, ischaemic heart disease, peripheral arterial disease, cerebrovascular disease.&nbsp;</li></ul><p><strong>&nbsp;</strong></p><p><strong>PRECAUTIONS</strong></p><p>&nbsp;</p><p><strong>Alcohol:</strong> Avoid alcohol when using this drug. Alcohol may increase the risk of side effects&nbsp;like nausea, gastric discomfort and liver problems.</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Pregnancy:</strong>&nbsp;This drug is not recommended for use during pregnancy. Consult your doctor before consuming this drug if you are pregnant or planning to get pregnant.</p><p>&nbsp;</p><p><strong>Breast feeding:&nbsp;</strong>This drug is not recommended for use during breastfeeding. Consult your doctor before consuming this drug if you are breastfeeding.</p><p>&nbsp;</p><p><strong>Driving:</strong>&nbsp;This medicine&nbsp;may cause dizziness,&nbsp;blurred vision,&nbsp;decrease alertness and affect your ability to drive.Avoid driving or operating machinery, if these symptoms occur.</p><p>&nbsp;</p><p><strong>Kidney:</strong> This medicine should be used with caution in patients with kidney disease. Dose adjustment may be required. Its use is not recommended in patients with moderate to severe renal impairment. Please consult your doctor.</p><p>&nbsp;</p><p><strong>Liver:</strong>&nbsp;This medicine should be with caution in patients with hepatic impairment or active liver disease. Dose adjustment may be required. Its use is not recommended in patients with moderate to&nbsp;severe hepatic impairment. &nbsp;Inform your doctor if you have any liver illness, before using this drug.</p><p><strong>Children:&nbsp;</strong>Safety and effectiveness of&nbsp;this medicine are not established in children and use is not recommended.&nbsp;</p><p><strong>Other precautions:&nbsp;</strong></p><ul><li>Don’t take this medicine, if you have an allergy to Etoricoxib, Thiocolchicoside,&nbsp;Aspirin, Ibuprofen or other NSAIDs or any other part of this drug. Tell your doctor if you are allergic to any drugs.</li><li>Consult your doctor if you have or ever had any history of bronchial asthma,&nbsp;liver disease, kidney disease,&nbsp;fits, seizures, glucose or galactose malabsorption, history of gastrointestinal disease (e.g., gastrointestinal bleeding, ulceration, ulcerative colitis, Crohn\'s disease), SLE, hepatic porphyria, dehydration, anaemia hyperlipidaemia, diabetes mellitus, hypertension, heart failure, myocardial infarction, stroke, cerebral haemorrhage, coagulation disorders.</li></ul><p><strong>&nbsp;</strong></p><p><strong>DRUG INTERACTIONS</strong></p><p>Sometimes drugs are not safe when you take them with certain other drugs and food. - Taking them together can cause bad side effects. - Be sure to talk to your doctor about all the drugs you take.</p><p>Consult your doctor if you are taking this medicine with the following drugs:</p><p>Warfarin, Aspirin, Lithium, Methotrexate, Cyclosporine, Tacrolimus, Salbutamol, Minoxidil, Rifampicin, Enalapril, Ramipril, Losartan, Valsartan, Digoxin, Ethinylestradiol.</p><p><strong>&nbsp;</strong></p><p><strong>STORAGE:</strong> Store in a cool, dry place away from the reach of children.&nbsp;Store below 30°C.</p><p><strong>&nbsp;&nbsp;</strong></p><p><strong>FAQs</strong></p><p>&nbsp;</p><p><strong>Q: What is&nbsp;this medicine? What is it used for?</strong></p><p>&nbsp;</p><p>A: It is a combination of Etoricoxib and&nbsp;Thiocolchicoside.&nbsp;It is used to relieve pain, swelling, inflammation and relax muscles in acute or chronic back pain, neck pain, spine-related disorders, torticollis, myalgia, muscle spasms, musculoskeletal pain, rheumatoid arthritis, osteoarthritis, ankylosing spondylitis, extra-articular rheumatism, muscle inflammation, fracture, post traumatic pain, postoperative pain.</p><p>&nbsp;</p><p><strong>Q: Is&nbsp;this medicine an antibiotic?</strong></p><p>&nbsp;</p><p>A: No, it is not an antibiotic,&nbsp;it is a combination of Etoricoxib and Thiocolchicoside with anti-inflammatory, analgesic (pain relieving) and muscle relaxation properties.</p><p>&nbsp;</p><p><strong>Q: Is this medicine a steroid?</strong></p><p>&nbsp;</p><p>A: No, it is not a steroid, it is a combination of Etoricoxib and Thiocolchicoside with anti-inflammatory, analgesic (pain relieving) and muscle relaxation properties.</p><p>&nbsp;</p><p><strong>Q: Can this medicine be taken empty stomach?</strong></p><p>&nbsp;</p><p>A: This medicine may be taken with or without food.</p><p>&nbsp;</p><p><strong>Q: Can this medicine be used during pregnancy?</strong></p><p>&nbsp;</p><p>A: This drug is not recommended for use during pregnancy. Consult your doctor before consuming this drug if you are pregnant or planning to get pregnant.</p><p>&nbsp;</p><p><strong>Q: Is this medicine safe?</strong></p><p>&nbsp;</p><p>A: This medicine is safe if used in the dose and duration advised by your doctor.</p><p>&nbsp;</p><p><strong>Q: Can this medicine be used in children?</strong></p><p>&nbsp;</p><p>A: No, safety and effectiveness of this medicine are not established in children and use is not recommended.</p><p>&nbsp;</p><p><strong>Q: Is this medicine&nbsp;an effective pain killer?</strong></p><p>&nbsp;</p><p>A: This medicine is an effective pain-relieving drug with anti-inflammatory and muscle relaxation properties.</p><p>&nbsp;</p><p><strong>Q: Can I take this medicine for a long period?</strong></p><p>&nbsp;</p><p>A: No, you should not take this medicine for a long period as it might increase the risk of liver and kidney impairment, stomach ulcers, gastrointestinal bleeding, heart problems and cause damage to cells (abnormal number of chromosomes). Do not exceed the dose and duration of treatment prescribed by the doctor.</p><p>&nbsp;</p><p><strong>Q: Is his medicine a narcotic drug? Can it get me high? Can it cause addiction or dependence?</strong></p><p>&nbsp;</p><p>A: No, this medicine is not a narcotic drug. it is a combination of Etoricoxib and Thiocolchicoside with anti-inflammatory, analgesic (pain relieving) and muscle relaxation properties. It does not get you high and does not cause addiction or dependence.</p><p>&nbsp;</p><p><strong>Q: Can this medicine make me drowsy?</strong></p><p>&nbsp;</p><p>A: Yes, this medicine can cause dizziness, blurred vision and drowsiness. Though, it is uncommon, if you have such symptoms avoid driving or operating heavy machinery.</p><p>&nbsp;</p><p><strong>Q: Can I use this medicine for backache or body pain?</strong></p><p>&nbsp;</p><p>A: Yes, this medicine can be used to relieve backache or body pain. Do consult your doctor if your body ache is persistent and does not go away.</p><p>&nbsp;</p><p><strong>Q: I am suffering from hypertension (high blood pressure), can I take this medicine?</strong></p><p>&nbsp;</p><p>A: This medicine increases the risk of heart attack, stroke and also decreases the effectiveness of antihypertensive drugs. Consult your doctor before using this medicine if you have hypertension.&nbsp;</p><p>&nbsp;</p><p><strong>Q: Does this medicine cause swelling (oedema) in hands and feet?</strong></p><p>&nbsp;</p><p>A: Yes. This medicine may cause swelling (oedema) of feet and hands as a side effect, due to fluid retention. A low-salt diet, raising your legs above by putting a pillow below them while lying down might help in reducing swelling (oedema).</p><p>&nbsp;</p><p><strong>Q: I am on birth control pills; Can I use This medicine?</strong></p><p>&nbsp;</p><p>A: This medicine increases the level of estrogen in the body, birth control pills also contain estrogen. This might increase the risk of side-effects. Consult your doctor. your doctor may suggest an alternate method of contraception.</p><p>&nbsp;</p><p><strong>Q: Can this medicine and Pregabalin be taken together?</strong></p><p>&nbsp;</p><p>A: Yes. You may use the medicine along with Pregabalin if it is prescribed so by your doctor. Do not use the medicines without the doctor\'s advice.</p><p>&nbsp;</p><p><strong>Q: Does this medicine cause diarrhoea?</strong></p><p>&nbsp;</p><p>A: Yes, this medicine may cause diarrhoea as a side effect in some patients and not necessarily in everyone. However, if the symptom persists, consult your doctor.</p><p>&nbsp;</p><p><strong>Q: Can this medicine impair fertility?</strong></p><p>&nbsp;</p><p>A: This medicine may affect sperm cells and cause problems with male fertility. So, it is advisable to consult your doctor if you are planning to become a father.</p><p>&nbsp;</p><p><strong>Q: Can I take this medicine for headache?</strong></p><p>&nbsp;</p><p>A: No, you should not take this medicine for headaches. Do not self-medicate. Consult your doctor.</p><p>&nbsp;</p><p><strong>Q: Is this medicine a muscle relaxant?</strong></p><p>&nbsp;</p><p>A: Yes. It contains Thiocolchicoside, which is a centrally acting skeletal muscle relaxant. It reduces skeletal muscle spasm, stiffness, improves muscle movements, and provides relief in pain.</p><p><strong>Q: Can I stop taking this medicine if I feel well?</strong></p><p>A: You should take this medicine for the duration as prescribed by your doctor. It is generally prescribed for short durations. Consult your doctor if you have any difficulty while taking Thiocolchicoside.</p><p><strong>Q: I am a patient of epilepsy; Can I take this medicine?</strong></p><p>A: No. This medicine contains Thiocolchicoside, which may precipitate seizures (especially in patients who are at risk for fits or seizures). Consult your doctor before taking this medicine if you are epileptic patient.</p><p><strong>Q: If my symptoms are not relieved, can I take more than the recommended dose?</strong></p><p>A: No, you should use this drug strictly in the doses as prescribed by your doctor. Dose excess can be harmful.</p><p><strong>Q: Is this medicine helpful in relieving stomach pain?</strong></p><p>&nbsp;</p><p>No, this medicine should not be taken for stomach pain without consulting your doctor. Stomach pain can be due to many reasons, like constipation, dyspepsia, indigestion, food poisoning, etc. This drug can increase the secretion of acid in stomach which may aggravate gastritis or complicate gastric ulcer.</p><p>&nbsp;</p><p><strong>Q: Can the use of this medicine cause kidney damage?</strong></p><p>A: Yes, this medicine lowers the levels of prostaglandins in the body which leads to kidney damage on long-term use. It is less likely to affect kidney function if used as recommended by a doctor. This medicine should be used with caution in people with kidney disease. Kidney function should be monitored in these patients regularly. Effects on renal function are usually reversible on withdrawal of this medicine.</p><p><strong>&nbsp;</strong></p><p><strong>REFERENCES</strong></p><ul><li>CDSCO [Internet]. Cdscoonline.gov.in. 2023.</li><li>Etoricoxib. Hoddesdon, Hertfordshire: Merck Sharp &amp; Dohme Limited; 2016.</li><li>Arcoxia 60 mg Film-coated Tablets - Summary of Product Characteristics (SmPC) - (emc) [Internet]. Medicines.org.uk. 2023.</li><li>Myroil Tablet [Internet]. Sanofi. 2023.</li><li>European Medicine Agency. European Medicines Agency recommends restricting use of thiocolchicoside by mouth or injection: Thiocolchicoside; 2014.&nbsp;</li><li>Thiocolchicoside Tablet [Internet]. Ema.europa.eu. 2023.</li><li>Etoricoxib. Haarlem, The Netherlands: Merck Sharp &amp; Dohme B.V.; 2018.&nbsp;</li><li>Drugs.com. Thiocolchicoside.&nbsp;</li><li>ScienceDirect. Etoricoxib.</li></ul><p>&nbsp;</p><p><strong>Disclaimer:</strong></p><p>This information is solely intended to provide a general overview on the product that is it accurate and reliable, as it is reviewed by expert professionals. The information provided here is for informational purposes only. This information is not intended to replace or be a substitute for a registered medical practitioner\'s medical treatment/advice or consultation or create a doctor-patient relationship. This may not cover everything about particular health conditions, lab tests, medicines, all possible side effects, drug interactions, warnings, alerts, etc. You should not use this information to diagnose, prevent, or cure a health problem. Please consult your doctor and discuss all your queries or doubts related to any disease or medicine. You hereby agree that you shall not make any health or medical-related decision based in whole or in part on anything contained in the Site.</p>', 'DR REDDYS LABORATORIES LTD', 'Dr. Reddy\'s Laboratories Ltd., 8-2-337, Road No. 3, Banjara Hills, Hyderabad, Telangana 500034, INDIA', 'Yes', 'retoz-mr-1', 'medicine', '0', '2023-11-27 08:32:19', '2023-11-27 08:41:43'),
(82, '', '1 PACK OF 200GM', 'null', 125.00, 10, 15, 6, NULL, 0, 'Yes', '', 'd-362071682761070.jpeg', '', '', '', 'null', 'null', 'Jun', '2026', 'COLGATE ACTIVE SALT TOOTHPASTE', '<p>Colgate Active Salt Toothpaste, in the net quantity of 200gms, is a one of its kind toothpaste that makes use of Active Salt and its minerals to ensure complete oral care. It fights germs and makes the gums healthy. It also helps in reducing tooth sensitivity. This product also helps in the whitening of the teeth. Its minty flavour revitalizes you and keeps the mouth feeling fresh all day, thus preventing bad mouth odour.</p><h4>Benefits of Colgate Active Salt Toothpaste</h4><ul><li>Contains Active Salt which fights germs and makes the gums healthy</li><li>Whitens teeth</li><li>Reduces tooth sensitivity</li><li>Keeps the mouth feeling fresh</li><li>Prevents bad mouth odour</li></ul><h4>Usage</h4><p>After washing the mouth with water, take a required amount of the Colgate Active Salt Toothpaste onto a tooth brush and brush your teeth thoroughly for ideally 3 minutes; at least 2 minutes, with small upward and downward circular motions. Rinse off with water thoroughly afterwards. For best results, use twice, daily – once in the morning and once before going to bed.</p>', 'COLGATE', 'COLGATE PALMOLIVE INDIA LTD  Plot No78,Epip Phase 1,Jharmajri,Baddi,Tehsil Nalagrah,Distt Solan H.P 174103', 'Yes', 'colgate-active-salt-toothpaste-4', 'other', '0', '2023-11-29 00:07:59', '2023-11-29 00:08:31');
