(83, '', '10 TABLETS', '1200 MG', 336.50, 15, 16, 20, NULL, 1, 'Yes', '', 'd-185581701239211.jpeg', 'd-671181701239211.jpeg', 'd-372301701239211.jpeg', 'd-83851701239211.jpeg', '8', '', 'May', '2026', 'NOOTROPIL', '<p><strong>PRODUCT INFORMATION</strong></p><p>The active ingredient in this medicine is Piracetam. It is a nootropic drug, a cyclic GABA derivative and belongs to class of drugs called racetams. It is a cognitive enhancer, enhances communication between nerve cells, improves the transportation of oxygen &amp; blood to the brain and protects brain.&nbsp;</p><p><strong>USES</strong></p><p>It is used in the treatment of myoclonus, Alzheimer’s disease, age related memory loss, head injury, stroke, dementia in Parkinson’s disease, alcohol dependence, Raynaud\'s phenomenon, DVT, tardive dyskinesia, dyslexia (learning disorder) and vertigo.</p><p><strong>HOW TO USE</strong></p><p>It should be taken in the dose and duration as advised by your doctor. It may be taken with or without food. Swallow it as a whole with a glass of water. Do not chew, cut or break the medicine. Take this medicine at the same time each day, to maintain a consistent level of medicine in the body.&nbsp;</p><p><strong>HOW DOES IT WORK</strong></p><p>The active ingredient in this medicine is Piracetam. It interacts with the polar heads in the phospholipid membrane of neurons which improves membrane stability and allows the membrane to function normally, to transport substances across the membrane, chemical secretion, receptor binding and stimulation. This helps to restore nerve transmission, improves communication between the nerve cells and provide neuroprotective and anticonvulsant effects.</p><p>It also improves the fluidity of platelet membranes and decreases the adhesion of red blood cells which improves blood flow through the brain.</p><p><strong>COMMON SIDE EFFECTS</strong></p><ul><li>Diarrhoea</li><li>Weight gain</li><li>Drowsiness</li><li>Insomnia&nbsp;</li><li>Nervousness, restlessness</li><li>Depression</li><li>Abnormality of voluntary movements</li><li>Impaired coordination, weakness</li><li>Agitation</li><li>Nausea</li><li>Vomiting</li><li>Headache</li><li>Stomach upset</li><li>Constipation&nbsp;</li><li>Skin rash&nbsp;</li></ul><p>This is not a complete list of side effects and others may occur. Call your doctor for medical advice about side effects. Minor side effects disappear as the body adjusts to the medicine and mostly do not require medical attention. Consult your doctor if the side effects persist or if you’re worried about them.</p><p><strong>WHAT TO DO IF I MISS A DOSE</strong></p><p>Take a missed dose as soon as you recall it. However, if it is close to the time for your next dose, skip the missed dose and go back to your regular schedule. Do not take 2 doses at the same time or extra doses.&nbsp;</p><p><strong>CONTRAINDICATIONS</strong></p><p><strong>&nbsp;</strong></p><ul><li>Hypersensitivity/allergy to Piracetam or any other ingredients.</li><li>Cerebral haemorrhage</li><li>Huntington\'s chorea</li><li>End stage renal disease or severe renal impairment.</li></ul><p><strong>PRECAUTIONS</strong></p><p>&nbsp;</p><p><strong>Alcohol:</strong> Avoid alcohol when using this drug, as consuming alcohol along with it can cause increased drowsiness.</p><p>&nbsp;</p><p><strong>Pregnancy:</strong> There is lack of data regarding effects and safety of this drug in pregnant women. Consult and&nbsp;inform your doctor if you are pregnant or planning to become pregnant before taking this this medicine.</p><p>&nbsp;</p><p><strong>Breast feeding:&nbsp;</strong>There is lack of data regarding effects and safety of this drug during&nbsp;breast-feeding. Consult and inform your doctor if you are breast feeding before taking this this medicine.</p><p>&nbsp;</p><p><strong>Driving:</strong>&nbsp;This medicine&nbsp;may decrease your alertness, make you feel drowsy, dizzy and affect your ability to drive. If you experience any of these, don’t drive or use machinery.</p><p>&nbsp;</p><p><strong>Kidney:</strong> This medicine should be used with caution in patients with kidney disease. Dose adjustment may be required. It is not recommended for use in patients with severe renal impairment. Please consult your doctor.</p><p>&nbsp;</p><p><strong>Liver:</strong>&nbsp;This medicine should be used with caution in patients with liver disease. Dose adjustment is not required. Please consult your doctor.</p><p><strong>Children: </strong>It is not recommended for use in children less than 8 years of age as its safety and efficacy are not established in the age group. Dose of this medicine in children depend up on the age and weight of child. Follow your doctor\'s dosing instructions very carefully. Do not give a child more than the prescribed dose of this medicine.</p><p><strong>Other precautions:&nbsp;</strong></p><ul><li>Don’t take this medicine, if you have an allergy to Piracetam or any other ingredients. Tell your doctor if you are allergic to any drugs.</li></ul><p>&nbsp;</p><ul><li>Tell your doctor if you have or ever had any history of kidney disease, cerebral haemorrhage, Huntington’s chorea, bleeding disorder, severe haemorrhage, increased risk of bleeding (e.g., gastrointestinal ulcer) or if you are undergoing a major surgery including dental surgery or if you are taking anticoagulants or antiplatelet drugs.</li></ul><p>&nbsp;</p><p><strong>DRUG INTERACTIONS</strong></p><p><strong>&nbsp;</strong></p><p>Sometimes drugs are not safe when you take them with certain other drugs and food. - Taking them together can cause bad side effects. - Be sure to talk to your doctor about all the drugs you take.</p><p>Consult your doctor if you are taking this medicine with the following drugs:</p><p>&nbsp;</p><p>Levothyroxine, Acenocoumarol, Warfarin, Aspirin, Clopidogrel</p><p>&nbsp;</p><p><strong>STORAGE:</strong> Store in a cool, dry place away from the reach of children.&nbsp;Store below 30°C.</p><p><strong>&nbsp;</strong></p><p><strong>FAQs</strong></p><p>&nbsp;</p><p><strong>Q: What is this medicine and what it is used for?</strong></p><p>&nbsp;</p><p>A: This medicine is a nootropic drug, a cyclic GABA derivative and belongs to class of drugs called racetams.It is used in the treatment of myoclonus, Alzheimer’s disease, age related memory loss, head injury, stroke, dementia in Parkinson’s disease, alcohol dependence, Raynaud\'s phenomenon, DVT, tardive dyskinesia, dyslexia (learning disorder) and vertigo.</p><p>&nbsp;</p><p><strong>Q: Is this medicine safe?</strong></p><p>A: This medicine is generally safe when used in doses and duration advised by your doctor.</p><p><strong>Q: When should I take this medicine, before or after food?</strong></p><p>A: It may be taken with or without food. Swallow it as a whole with a glass of water. Do not chew, cut or break the medicine. It should be taken in the dose and duration as advised by your doctor.</p><p><strong>Q: Does this medicine cause weight gain?</strong></p><p>A: Yes. This medicine may cause weight gain as a side effect. Regular exercise and a healthy balanced diet may help you to maintain a proper weight. Consult your doctor if you are concerned.</p><p><strong>Q: How long should I take this medicine?</strong></p><p>A: The dose and duration of treatment with this medicine, depends upon the clinical condition for which it is used. You may have to take it for several months for conditions like Alzheimer’s disease, dementia and stroke. For epilepsy, you may have to continue it for years. It is advised not to stop taking this medicine without consulting your doctor.</p><p><strong>Q: Can I stop taking this medicine on my own if I feel better?</strong></p><p>A: No, you should not stop taking this medicine on your own even if you feel better. Stopping it suddenly may result in withdrawal symptoms like twitching and jerking movements. To avoid this your doctor will gradually decrease the dose before stopping it. Always consult your before stopping this medicine.&nbsp;</p><p><strong>Q: Is this medicine habit forming or addictive?</strong></p><p>A: No, it is not a habit-forming drug. It does not contain any substance that causes addiction.&nbsp;</p><p><strong>Q: Does this medicine cause hallucinations?</strong></p><p>A: This medicine may cause hallucinations in some cases. So, if you experience hallucinations while taking this medicine, please talk to your doctor immediately.</p><p><strong>&nbsp;</strong></p><p><strong>REFERENCES</strong></p><p><strong>&nbsp;</strong></p><ul><li>CDSCO [Internet]. Cdscoonline.gov.in. 2023.</li><li>Piracetam. Slough, Berkshire: UCB Pharma Limited; 2004</li><li>Medscape.com. reference.medscape.com/drug/dinagen-myocalm-piracetam</li><li>Nootropil Summary of Product Characteristics (SmPC) [Internet]. GSK pro. 2023.</li><li>NOOTROPIL® Piracetam [Internet]. E-lactancia.org. 2023.</li><li>Drug.com. drugs.com/medical-answers/piracetam.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><strong>Disclaimer:</strong></p><p>This information is solely intended to provide a general overview on the product that is it accurate and reliable, as it is reviewed by expert professionals. The information provided here is for informational purposes only. This information is not intended to replace or be a substitute for a registered medical practitioner\'s medical treatment/advice or consultation or create a doctor-patient relationship. This may not cover everything about particular health conditions, lab tests, medicines, all possible side effects, drug interactions, warnings, alerts, etc. You should not use this information to diagnose, prevent, or cure a health problem. Please consult your doctor and discuss all your queries or doubts related to any disease or medicine. You hereby agree that you shall not make any health or medical-related decision based in whole or in part on anything contained in the Site.</p>', 'DR REDDYS LABORATORIES LTD', 'Dr. Reddy\'s Laboratories Ltd., 8-2-337, Road No. 3, Banjara Hills, Hyderabad, Telangana 500034, INDIA', 'Yes', 'nootropil-1', 'medicine', '0', '2023-11-29 00:56:51', '2023-11-29 01:23:56'),
(84, '', '10 TABLETS', 'null', 799.00, 20, 16, 20, NULL, 1, 'No', '', 'd-128581701240565.jpeg', 'd-951911701240566.jpeg', 'd-313281701240566.jpeg', '', '9', '', 'May', '2027', 'STROCIT PLUS', '<p><strong>PRODUCT INFORMATION</strong></p><p>It is a combination of Citicoline and Piracetam. Citicoline is a nootropic (nerve protecting) agent, belongs to class of drugs called ‘psychostimulants’. Piracetam is a nootropic drug, a cyclic GABA derivative and belongs to class of drugs called racetams.&nbsp;</p><p>It is a cognitive enhancer, enhances communication between nerve cells, improves the transportation of oxygen &amp; blood to the brain, nourishes nerve cells and protect them from damage and also helps to repair the damaged nerve cells.</p><p><strong>USES</strong></p><p>It is used in the treatment of&nbsp;</p><ul><li>Stroke</li><li>Head injury</li></ul><p><strong>HOW TO USE</strong></p><p>It should be taken in the dose and duration as advised by your doctor. It may be taken with or without food. Swallow it as a whole with a glass of water. Do not chew, cut or break the medicine. Take this medicine at the same time each day, to maintain a consistent level of medicine in the body.&nbsp;</p><p><strong>HOW DOES IT WORK</strong></p><p>It is a combination of Citicoline and Piracetam. Citicoline stimulates the biosynthesis of structural phospholipids of the neuronal membrane, stimulates the synthesis of acetylcholine which helps in inhibition of apoptosis (neuronal cell death) and regeneration of nerve cells.&nbsp;</p><p>Piracetam interacts with the polar heads in the phospholipid membrane of neurons and improves membrane stability to transport substances, chemical secretion, receptor binding and stimulation. This helps to restore nerve transmission, improves communication between the nerve cells and provide neuroprotective effects.&nbsp;</p><p>Together they increase the activity of the central nervous system, improve cognition and help in recovery of patients with stroke or head injury more effectively.</p><p><strong>COMMON SIDE EFFECTS</strong></p><ul><li>Weight gain</li><li>Hyperactivity</li><li>Nervousness</li><li>Fatigue, malaise&nbsp;</li><li>Uncoordinated body movements</li><li>Stomach pain</li><li>Diarrhea</li><li>Dizziness</li><li>Headache</li><li>Nausea</li><li>Decreased blood pressure</li><li>Difficulty in sleeping (Insomnia)</li></ul><p>This is not a complete list of side effects and others may occur. Call your doctor for medical advice about side effects. Minor side effects disappear as the body adjusts to the medicine and mostly do not require medical attention. Consult your doctor if the side effects persist or if you’re worried about them.</p><p><strong>WHAT TO DO IF I MISS A DOSE</strong></p><p>Take a missed dose as soon as you recall it. However, if it is close to the time for your next dose, skip the missed dose and go back to your regular schedule. Do not take 2 doses at the same time or extra doses.&nbsp;</p><p><strong>CONTRAINDICATIONS</strong></p><p><strong>&nbsp;</strong></p><ul><li>Hypersensitivity/allergy to Citicoline or Piracetam or any other ingredients.</li><li>Cerebral haemorrhage</li><li>Huntington\'s chorea</li><li>End stage renal disease or severe renal impairment.</li></ul><p><strong>PRECAUTIONS</strong></p><p>&nbsp;</p><p><strong>Alcohol:</strong> Avoid alcohol when using this drug, as consuming alcohol along with it can cause increased dizziness and drowsiness.</p><p>&nbsp;</p><p><strong>Pregnancy:</strong> There is lack of data regarding effects and safety of this drug in pregnant women. Consult and&nbsp;inform your doctor if you are pregnant or planning to become pregnant before taking this medicine.</p><p>&nbsp;</p><p><strong>Breast feeding:&nbsp;</strong>There is lack of data regarding effects and safety of this drug during&nbsp;breast-feeding. Consult and inform your doctor if you are breast feeding before taking this medicine.</p><p>&nbsp;</p><p><strong>Driving:</strong>&nbsp;This medicine&nbsp;may decrease your alertness, make you feel drowsy, dizzy and affect your ability to drive. If you experience any of these, don’t drive or use machinery.</p><p>&nbsp;</p><p><strong>Kidney:</strong> This medicine should be used with caution in patients with kidney disease. Dose adjustment may be required. It is not recommended for use in patients with severe renal impairment. Please consult your doctor.</p><p>&nbsp;</p><p><strong>Liver:</strong>&nbsp;This medicine should be used with caution in patients with liver disease. Please consult your doctor.</p><p><strong>Children: </strong>It is not recommended for use in children less than 8 years of age as its safety and efficacy are not established in the age group. Dose of this medicine in children depend up on the age and weight of child. Follow your doctor\'s dosing instructions very carefully. Do not give a child more than the prescribed dose of this medicine</p><p><strong>Other precautions:&nbsp;</strong></p><ul><li>Don’t take this medicine, if you have an allergy to Citicoline or Piracetam or any other ingredients. Tell your doctor if you are allergic to any drugs.</li></ul><p>&nbsp;</p><ul><li>Tell your doctor if you have or ever had any history of cerebral haemorrhage, Huntington’s chorea, bleeding disorder, severe haemorrhage, kidney disease, liver disease or heart disease, increased risk of bleeding (e.g., gastrointestinal ulcer) or if you are undergoing a major surgery including dental surgery or if you are taking anticoagulants or antiplatelet drugs.</li></ul><p>&nbsp;</p><p><strong>DRUG INTERACTIONS</strong></p><p><strong>&nbsp;</strong></p><p>Sometimes drugs are not safe when you take them with certain other drugs and food. - Taking them together can cause bad side effects. - Be sure to talk to your doctor about all the drugs you take.</p><p>&nbsp;</p><p>Consult your doctor if you are taking this medicine with the following drugs: Levodopa, Carbidopa, Entacapone, Levothyroxine, Acenocoumarol, Warfarin, Aspirin, Clopidogrel.</p><p>&nbsp;</p><p><strong>STORAGE:</strong> Store in a cool, dry place away from the reach of children.&nbsp;Store below 30°C.</p><p><strong>&nbsp;</strong></p><p><strong>FAQs</strong></p><p>&nbsp;</p><p><strong>Q: What is this medicine and what it is used for?</strong></p><p>&nbsp;</p><p>A: It is a combination of Citicoline and Piracetam.&nbsp;It is a cognitive enhancer, enhances communication between nerve cells, improves the transportation of oxygen &amp; blood to the brain, nourishes nerve cells and protect them from damage and also helps to repair the damaged nerve cells.&nbsp;It is used in the treatment of stroke and head injury.</p><p>&nbsp;</p><p><strong>Q: Is this medicine safe?</strong></p><p>A: This medicine is generally safe when used in doses and duration advised by your doctor.</p><p><strong>Q: When should I take this medicine, before or after food?</strong></p><p>A: It may be taken with or without food. Swallow it as a whole with a glass of water. Do not chew, cut or break the medicine. It should be taken in the dose and duration as advised by your doctor.</p><p><strong>Q: How long should I take this medicine?</strong></p><p>A: The dose and duration of treatment with this medicine, depends upon the clinical condition for which it is used. You may have to take it for several months for head injury and stroke. It is advised not to stop taking this medicine without consulting your doctor.</p><p><strong>Q: Can I stop taking this medicine on my own if I feel better?</strong></p><p>A: No, you should not stop taking this medicine on your own even if you feel better. Stopping it suddenly may result in withdrawal symptoms like twitching and jerking movements. To avoid this your doctor will gradually decrease the dose before stopping it. Always consult your before stopping this medicine.&nbsp;</p><p><strong>Q: Does this medicine cause weight gain?</strong></p><p>A: Yes. This medicine may cause weight gain as a side effect. Regular exercise and a healthy balanced diet may help you to maintain a proper weight. Consult your doctor if you are concerned.</p><p><strong>Q: Does this medicine cause diarrhoea?</strong></p><p>A: Yes. This medicine may cause diarrhoea as a side-effect. Drink plenty of fluids and eat non-spicy food if you experience diarrhoea. Consult your doctor if you experience severe diarrhoea or if you find blood in stools.</p><p><strong>Q: Does this medicine cause disturbance in sleep (insomnia)?</strong></p><p>A: Yes. This medicine can cause disturbance in sleep (insomnia) as a side effect.&nbsp;</p><p><strong>Q: Is this medicine habit forming or addictive?</strong></p><p>A: No, it is not a habit-forming drug. It does not contain any substance that causes addiction.&nbsp;</p><p><strong>Q: Does this medicine cause hallucinations?</strong></p><p>A: This medicine may cause hallucinations in some cases. So, if you experience hallucinations while taking this medicine, please talk to your doctor immediately.</p><p><strong>Q: Is this medicine safe for use in patients with renal insufficiency?</strong></p><p>A: This medicine should be used with caution in patients with kidney disease. Dose adjustment may be required. It is not recommended for use in patients with severe renal impairment. Please consult your doctor.</p><p><strong>&nbsp;</strong></p><p><strong>REFERENCES</strong></p><p><strong>&nbsp;</strong></p><ul><li>CDSCO [Internet]. Cdscoonline.gov.in. 2023.</li><li>Piracetam. Slough, Berkshire: UCB Pharma Limited; 2004 [revised 09 Feb. 2017].&nbsp;</li><li>Strocit Plus [Internet]. Torrentian.com. 2023.</li><li>Drugs.com. Citicoline.&nbsp;</li><li>Álvarez-Sabín J, Román G. The Role of Citicoline in Neuroprotection and Neurorepair in Ischemic Stroke. PubMed. 2023.</li><li>Citicoline and Piracetam [Product Information]. Ahmedabad, Gujarat: La Renon Healthcare Limited.</li><li>COGNOLIN P Tablets [Internet]. CiplaMed. 2023.</li><li>Citicoline. Laguna Philipines: Amherst Laboratories; 2019.&nbsp;</li></ul><p>&nbsp;</p><p><strong>Disclaimer:</strong></p><p>This information is solely intended to provide a general overview on the product that is it accurate and reliable, as it is reviewed by expert professionals. The information provided here is for informational purposes only. This information is not intended to replace or be a substitute for a registered medical practitioner\'s medical treatment/advice or consultation or create a doctor-patient relationship. This may not cover everything about particular health conditions, lab tests, medicines, all possible side effects, drug interactions, warnings, alerts, etc. You should not use this information to diagnose, prevent, or cure a health problem. Please consult your doctor and discuss all your queries or doubts related to any disease or medicine. You hereby agree that you shall not make any health or medical-related decision based in whole or in part on anything contained in the Site.</p>', 'SUN PHARMA', 'ACME Plaza, Andheri-Kurla Road, Andheri (East),   MUMBAI  400 059 India', 'Yes', 'strocit-plus', 'medicine', '0', '2023-11-29 01:19:26', '2023-11-29 01:19:26'),
(85, '', '10 TABLETS', 'null', 409.75, 15, 16, 17, NULL, 1, 'Yes', '', 'd-944291701093739.jpeg', 'd-911031701093739.jpeg', 'd-735751701093739.jpeg', 'd-303561701093739.jpeg', '7', '', 'Apr', '2025', 'RETOZ MR', '<p><strong>PRODUCT INFORMATION</strong></p><p>It is a combination of Etoricoxib and Thiocolchicoside. It is a non-opioid analgesic (pain relieving) drug with marked muscle relaxant, anti-inflammatory (reducing swelling or oedema) properties.&nbsp;</p><p><strong>USES</strong></p><p>It is used to relieve pain, swelling, inflammation and relax muscles in acute or chronic back pain, neck pain, spine-related disorders, torticollis, myalgia, muscle spasms, musculoskeletal pain, rheumatoid arthritis, osteoarthritis, ankylosing spondylitis, extra-articular rheumatism, muscle inflammation, fracture, post traumatic pain, postoperative pain in people greater than 16 years of age.&nbsp;</p><p><strong>HOW TO USE</strong></p><p>It should be taken in the dose and duration as advised by your doctor. It may be taken with or without food. Swallow it as a whole with a glass of water. Do not chew, crush or break it.&nbsp;</p><p><strong>HOW DOES IT WORK</strong></p><p>It is a combination of Etoricoxib and Thiocolchicoside. Etoricoxib relieves pain by inhibiting the enzyme (Cyclooxygenase-2 or COX-2) that is responsible for the formation of certain chemicals (prostaglandins IL-1β, and TNF) which are responsible for causing the pain, fever, swelling, and redness.</p><p>Thiocolchicoside is a centrally acting skeletal muscle relaxant. It has GABA-mimetic and glycinergic actions on the centres of the spinal cord and brain, thereby reducing skeletal muscle spasm, stiffness, improves muscle movements, and provides relief in pain.</p><p>Together they provide relief in pain, inflammation and relaxation of muscles more effectively.</p><p><strong>COMMON SIDE EFFECTS</strong></p><ul><li>Stomach pain</li><li>Heartburn, epigastric pain, dyspepsia</li><li>Indigestion</li><li>Nausea</li><li>Vomiting</li><li>Diarrhoea</li><li>Dizziness</li><li>Loss of appetite</li><li>Flatulence</li><li>Swelling of the legs or feet</li><li>Flu-like symptoms (fever, cold, cough, or sore throat)</li><li>Wheezing or shortness of breath</li></ul><p>This is not a complete list of side effects and others may occur. Call your doctor for medical advice about side effects. Minor side effects disappear as the body adjusts to the medicine and mostly do not require medical attention. Consult your doctor if the side effects persist or if you’re worried about them.</p><p><strong>WHAT TO DO IF I MISS A DOSE</strong></p><p>Take a missed dose as soon as you recall it. However, if it is close to the time for your next dose, skip the missed dose and go back to your regular schedule. Do not take 2 doses at the same time or extra doses.&nbsp;</p><p><strong>CONTRAINDICATIONS</strong></p><p><strong>&nbsp;</strong></p><ul><li>Allergy to Etoricoxib,&nbsp;Thiocolchicoside, Aspirin, Ibuprofen or other NSAIDs or any ingredients.&nbsp;</li><li>Severe hepatic impairment</li><li>Severe renal impairment</li><li>Active or history of peptic ulcer/ gastrointestinal haemorrhage.</li><li>Inflammatory bowel disease</li><li>Children and adolescent &lt;16 years.&nbsp;</li><li>Pregnancy and lactation.</li><li>History of gastrointestinal bleeding or perforation related to previous NSAID therapy.</li><li>Congestive heart failure, severe heart failure, uncontrolled hypertension, ischaemic heart disease, peripheral arterial disease, cerebrovascular disease.&nbsp;</li></ul><p><strong>&nbsp;</strong></p><p><strong>PRECAUTIONS</strong></p><p>&nbsp;</p><p><strong>Alcohol:</strong> Avoid alcohol when using this drug. Alcohol may increase the risk of side effects&nbsp;like nausea, gastric discomfort and liver problems.</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Pregnancy:</strong>&nbsp;This drug is not recommended for use during pregnancy. Consult your doctor before consuming this drug if you are pregnant or planning to get pregnant.</p><p>&nbsp;</p><p><strong>Breast feeding:&nbsp;</strong>This drug is not recommended for use during breastfeeding. Consult your doctor before consuming this drug if you are breastfeeding.</p><p>&nbsp;</p><p><strong>Driving:</strong>&nbsp;This medicine&nbsp;may cause dizziness,&nbsp;blurred vision,&nbsp;decrease alertness and affect your ability to drive.Avoid driving or operating machinery, if these symptoms occur.</p><p>&nbsp;</p><p><strong>Kidney:</strong> This medicine should be used with caution in patients with kidney disease. Dose adjustment may be required. Its use is not recommended in patients with moderate to severe renal impairment. Please consult your doctor.</p><p>&nbsp;</p><p><strong>Liver:</strong>&nbsp;This medicine should be with caution in patients with hepatic impairment or active liver disease. Dose adjustment may be required. Its use is not recommended in patients with moderate to&nbsp;severe hepatic impairment. &nbsp;Inform your doctor if you have any liver illness, before using this drug.</p><p><strong>Children:&nbsp;</strong>Safety and effectiveness of&nbsp;this medicine are not established in children and use is not recommended.&nbsp;</p><p><strong>Other precautions:&nbsp;</strong></p><ul><li>Don’t take this medicine, if you have an allergy to Etoricoxib, Thiocolchicoside,&nbsp;Aspirin, Ibuprofen or other NSAIDs or any other part of this drug. Tell your doctor if you are allergic to any drugs.</li><li>Consult your doctor if you have or ever had any history of bronchial asthma,&nbsp;liver disease, kidney disease,&nbsp;fits, seizures, glucose or galactose malabsorption, history of gastrointestinal disease (e.g., gastrointestinal bleeding, ulceration, ulcerative colitis, Crohn\'s disease), SLE, hepatic porphyria, dehydration, anaemia hyperlipidaemia, diabetes mellitus, hypertension, heart failure, myocardial infarction, stroke, cerebral haemorrhage, coagulation disorders.</li></ul><p><strong>&nbsp;</strong></p><p><strong>DRUG INTERACTIONS</strong></p><p>Sometimes drugs are not safe when you take them with certain other drugs and food. - Taking them together can cause bad side effects. - Be sure to talk to your doctor about all the drugs you take.</p><p>Consult your doctor if you are taking this medicine with the following drugs:</p><p>Warfarin, Aspirin, Lithium, Methotrexate, Cyclosporine, Tacrolimus, Salbutamol, Minoxidil, Rifampicin, Enalapril, Ramipril, Losartan, Valsartan, Digoxin, Ethinylestradiol.</p><p><strong>&nbsp;</strong></p><p><strong>STORAGE:</strong> Store in a cool, dry place away from the reach of children.&nbsp;Store below 30°C.</p><p><strong>&nbsp;&nbsp;</strong></p><p><strong>FAQs</strong></p><p>&nbsp;</p><p><strong>Q: What is&nbsp;this medicine? What is it used for?</strong></p><p>&nbsp;</p><p>A: It is a combination of Etoricoxib and&nbsp;Thiocolchicoside.&nbsp;It is used to relieve pain, swelling, inflammation and relax muscles in acute or chronic back pain, neck pain, spine-related disorders, torticollis, myalgia, muscle spasms, musculoskeletal pain, rheumatoid arthritis, osteoarthritis, ankylosing spondylitis, extra-articular rheumatism, muscle inflammation, fracture, post traumatic pain, postoperative pain.</p><p>&nbsp;</p><p><strong>Q: Is&nbsp;this medicine an antibiotic?</strong></p><p>&nbsp;</p><p>A: No, it is not an antibiotic,&nbsp;it is a combination of Etoricoxib and Thiocolchicoside with anti-inflammatory, analgesic (pain relieving) and muscle relaxation properties.</p><p>&nbsp;</p><p><strong>Q: Is this medicine a steroid?</strong></p><p>&nbsp;</p><p>A: No, it is not a steroid, it is a combination of Etoricoxib and Thiocolchicoside with anti-inflammatory, analgesic (pain relieving) and muscle relaxation properties.</p><p>&nbsp;</p><p><strong>Q: Can this medicine be taken empty stomach?</strong></p><p>&nbsp;</p><p>A: This medicine may be taken with or without food.</p><p>&nbsp;</p><p><strong>Q: Can this medicine be used during pregnancy?</strong></p><p>&nbsp;</p><p>A: This drug is not recommended for use during pregnancy. Consult your doctor before consuming this drug if you are pregnant or planning to get pregnant.</p><p>&nbsp;</p><p><strong>Q: Is this medicine safe?</strong></p><p>&nbsp;</p><p>A: This medicine is safe if used in the dose and duration advised by your doctor.</p><p>&nbsp;</p><p><strong>Q: Can this medicine be used in children?</strong></p><p>&nbsp;</p><p>A: No, safety and effectiveness of this medicine are not established in children and use is not recommended.</p><p>&nbsp;</p><p><strong>Q: Is this medicine&nbsp;an effective pain killer?</strong></p><p>&nbsp;</p><p>A: This medicine is an effective pain-relieving drug with anti-inflammatory and muscle relaxation properties.</p><p>&nbsp;</p><p><strong>Q: Can I take this medicine for a long period?</strong></p><p>&nbsp;</p><p>A: No, you should not take this medicine for a long period as it might increase the risk of liver and kidney impairment, stomach ulcers, gastrointestinal bleeding, heart problems and cause damage to cells (abnormal number of chromosomes). Do not exceed the dose and duration of treatment prescribed by the doctor.</p><p>&nbsp;</p><p><strong>Q: Is his medicine a narcotic drug? Can it get me high? Can it cause addiction or dependence?</strong></p><p>&nbsp;</p><p>A: No, this medicine is not a narcotic drug. it is a combination of Etoricoxib and Thiocolchicoside with anti-inflammatory, analgesic (pain relieving) and muscle relaxation properties. It does not get you high and does not cause addiction or dependence.</p><p>&nbsp;</p><p><strong>Q: Can this medicine make me drowsy?</strong></p><p>&nbsp;</p><p>A: Yes, this medicine can cause dizziness, blurred vision and drowsiness. Though, it is uncommon, if you have such symptoms avoid driving or operating heavy machinery.</p><p>&nbsp;</p><p><strong>Q: Can I use this medicine for backache or body pain?</strong></p><p>&nbsp;</p><p>A: Yes, this medicine can be used to relieve backache or body pain. Do consult your doctor if your body ache is persistent and does not go away.</p><p>&nbsp;</p><p><strong>Q: I am suffering from hypertension (high blood pressure), can I take this medicine?</strong></p><p>&nbsp;</p><p>A: This medicine increases the risk of heart attack, stroke and also decreases the effectiveness of antihypertensive drugs. Consult your doctor before using this medicine if you have hypertension.&nbsp;</p><p>&nbsp;</p><p><strong>Q: Does this medicine cause swelling (oedema) in hands and feet?</strong></p><p>&nbsp;</p><p>A: Yes. This medicine may cause swelling (oedema) of feet and hands as a side effect, due to fluid retention. A low-salt diet, raising your legs above by putting a pillow below them while lying down might help in reducing swelling (oedema).</p><p>&nbsp;</p><p><strong>Q: I am on birth control pills; Can I use This medicine?</strong></p><p>&nbsp;</p><p>A: This medicine increases the level of estrogen in the body, birth control pills also contain estrogen. This might increase the risk of side-effects. Consult your doctor. your doctor may suggest an alternate method of contraception.</p><p>&nbsp;</p><p><strong>Q: Can this medicine and Pregabalin be taken together?</strong></p><p>&nbsp;</p><p>A: Yes. You may use the medicine along with Pregabalin if it is prescribed so by your doctor. Do not use the medicines without the doctor\'s advice.</p><p>&nbsp;</p><p><strong>Q: Does this medicine cause diarrhoea?</strong></p><p>&nbsp;</p><p>A: Yes, this medicine may cause diarrhoea as a side effect in some patients and not necessarily in everyone. However, if the symptom persists, consult your doctor.</p><p>&nbsp;</p><p><strong>Q: Can this medicine impair fertility?</strong></p><p>&nbsp;</p><p>A: This medicine may affect sperm cells and cause problems with male fertility. So, it is advisable to consult your doctor if you are planning to become a father.</p><p>&nbsp;</p><p><strong>Q: Can I take this medicine for headache?</strong></p><p>&nbsp;</p><p>A: No, you should not take this medicine for headaches. Do not self-medicate. Consult your doctor.</p><p>&nbsp;</p><p><strong>Q: Is this medicine a muscle relaxant?</strong></p><p>&nbsp;</p><p>A: Yes. It contains Thiocolchicoside, which is a centrally acting skeletal muscle relaxant. It reduces skeletal muscle spasm, stiffness, improves muscle movements, and provides relief in pain.</p><p><strong>Q: Can I stop taking this medicine if I feel well?</strong></p><p>A: You should take this medicine for the duration as prescribed by your doctor. It is generally prescribed for short durations. Consult your doctor if you have any difficulty while taking Thiocolchicoside.</p><p><strong>Q: I am a patient of epilepsy; Can I take this medicine?</strong></p><p>A: No. This medicine contains Thiocolchicoside, which may precipitate seizures (especially in patients who are at risk for fits or seizures). Consult your doctor before taking this medicine if you are epileptic patient.</p><p><strong>Q: If my symptoms are not relieved, can I take more than the recommended dose?</strong></p><p>A: No, you should use this drug strictly in the doses as prescribed by your doctor. Dose excess can be harmful.</p><p><strong>Q: Is this medicine helpful in relieving stomach pain?</strong></p><p>&nbsp;</p><p>No, this medicine should not be taken for stomach pain without consulting your doctor. Stomach pain can be due to many reasons, like constipation, dyspepsia, indigestion, food poisoning, etc. This drug can increase the secretion of acid in stomach which may aggravate gastritis or complicate gastric ulcer.</p><p>&nbsp;</p><p><strong>Q: Can the use of this medicine cause kidney damage?</strong></p><p>A: Yes, this medicine lowers the levels of prostaglandins in the body which leads to kidney damage on long-term use. It is less likely to affect kidney function if used as recommended by a doctor. This medicine should be used with caution in people with kidney disease. Kidney function should be monitored in these patients regularly. Effects on renal function are usually reversible on withdrawal of this medicine.</p><p><strong>&nbsp;</strong></p><p><strong>REFERENCES</strong></p><ul><li>CDSCO [Internet]. Cdscoonline.gov.in. 2023.</li><li>Etoricoxib. Hoddesdon, Hertfordshire: Merck Sharp &amp; Dohme Limited; 2016.</li><li>Arcoxia 60 mg Film-coated Tablets - Summary of Product Characteristics (SmPC) - (emc) [Internet]. Medicines.org.uk. 2023.</li><li>Myroil Tablet [Internet]. Sanofi. 2023.</li><li>European Medicine Agency. European Medicines Agency recommends restricting use of thiocolchicoside by mouth or injection: Thiocolchicoside; 2014.&nbsp;</li><li>Thiocolchicoside Tablet [Internet]. Ema.europa.eu. 2023.</li><li>Etoricoxib. Haarlem, The Netherlands: Merck Sharp &amp; Dohme B.V.; 2018.&nbsp;</li><li>Drugs.com. Thiocolchicoside.&nbsp;</li><li>ScienceDirect. Etoricoxib.</li></ul><p>&nbsp;</p><p><strong>Disclaimer:</strong></p><p>This information is solely intended to provide a general overview on the product that is it accurate and reliable, as it is reviewed by expert professionals. The information provided here is for informational purposes only. This information is not intended to replace or be a substitute for a registered medical practitioner\'s medical treatment/advice or consultation or create a doctor-patient relationship. This may not cover everything about particular health conditions, lab tests, medicines, all possible side effects, drug interactions, warnings, alerts, etc. You should not use this information to diagnose, prevent, or cure a health problem. Please consult your doctor and discuss all your queries or doubts related to any disease or medicine. You hereby agree that you shall not make any health or medical-related decision based in whole or in part on anything contained in the Site.</p>', 'DR REDDYS LABORATORIES LTD', 'Dr. Reddy\'s Laboratories Ltd., 8-2-337, Road No. 3, Banjara Hills, Hyderabad, Telangana 500034, INDIA', 'Yes', 'retoz-mr-2', 'medicine', '0', '2023-11-29 01:21:25', '2023-11-29 01:24:38');
