(86, '', '15 CAPSULES', 'null', 231.00, 15, 16, 15, NULL, 2, 'Yes', '', 'd-390771701079634.jpeg', 'd-714841701079634.jpeg', 'd-307171701079634.jpeg', 'd-786801701079634.jpeg', '5', '', 'May', '2026', 'FOLVITE MB', '<p><strong>PRODUCT INFORMATION</strong></p><p>This medicine is a combination of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12. These are essential nutrients required by the body for healthy nervous system, blood and to support the immune system. It also helps in division of cells, formation of haemoglobin, development of blood cells, development of brain &amp; spinal cord and for overall growth, development and functioning of the organs. It helps to reduce homocysteine levels (an amino acid linked with heart diseases, strokes and blood vessel disorders).</p><p><strong>USES</strong></p><ul><li>It is used for treatment and prevention of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12 deficiency which may be due to nutritional causes or malabsorption.&nbsp;</li><li>It is used in the management of anemia, neuropathies like diabetic neuropathy, alcoholic neuropathy, drug-induced neuropathy, trigeminal neuralgia, sciatica and optic neuritis.&nbsp;</li><li>It helps to reduce homocysteine levels in blood (hyperhomocysteinemia), the major factor for atherosclerosis. and help in preventing heart diseases, strokes and blood vessel disorders.</li></ul><p><strong>HOW TO USE</strong></p><p>It should be taken in the dose and duration as advised by your doctor. It may be taken with or without food. Do not chew, cut or break the medicine. Swallow it as a whole with a glass of water.&nbsp;</p><p><strong>HOW DOES IT WORK</strong></p><p>It restores the levels of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12 in the body which helps the body in division of cells, formation of haemoglobin, development of blood cells, development of brain &amp; spinal cord and for overall growth, development and functioning of the organs. It helps to reduce homocysteine levels (an amino acid linked with heart diseases, strokes and blood vessel disorders).</p><p>Folic Acid (Vitamin B9) is important for synthesis of DNA and amino acids. It helps in cell division, development of blood cells and supports immune functions.</p><p>Vitamin B12 (Methylcobalamin) is essential for DNA synthesis, production of red blood cells, and functioning of the brain and nerves.</p><p>Vitamin B6 (pyridoxine) acts as a coenzyme for various reactions in the body and helps in boosting metabolism. It is also important for proper regeneration and nerve function.</p><p><strong>COMMON SIDE EFFECTS</strong></p><ul><li>Stomach upset</li><li>Bloating, flatulence&nbsp;</li><li>Nausea, vomiting</li><li>Loss of appetite (anorexia)</li><li>Headache</li><li>Diarrhea, abdominal pain</li><li>Skin rash, hot flushes</li></ul><p>This is not a complete list of side effects and others may occur. Call your doctor for medical advice about side effects. Minor side effects disappear as the body adjusts to the medicine and mostly do not require medical attention. Consult your doctor if the side effects persist or if you’re worried about them.</p><p><strong>WHAT TO DO IF I MISS A DOSE</strong></p><p>Take a missed dose as soon as you recall it. However, if it is close to the time for your next dose, skip the missed dose and go back to your regular schedule. Do not take 2 doses at the same time or extra doses.&nbsp;</p><p><strong>CONTRAINDICATIONS</strong></p><p><strong>&nbsp;</strong></p><ul><li>Allergy to Folic acid or Vitamin B9 or L-methyl folate or Vitamin B6 or Pyridoxin or Pyridoxal phosphate or Vitamin B12 or Adenosylcobalamin or Cyanocobalamin or Methylcobalamin or Mecobalamin or any other ingredients.</li></ul><p><strong>&nbsp;</strong></p><p><strong>PRECAUTIONS</strong></p><p>&nbsp;</p><p><strong>Alcohol:</strong> Avoid alcohol when using this drug as alcohol may decrease the absorption of this drug.</p><p>&nbsp;</p><p><strong>Pregnancy:</strong> Though, this drug is generally considered safe to use during pregnancy, should be used only if clearly needed. Please consult your doctor.&nbsp;if you are pregnant or planning to get pregnant.</p><p>&nbsp;</p><p><strong>Breast feeding:&nbsp;</strong>This drug is generally considered safe to use during breastfeeding. Consult your doctor if you are breast feeding.</p><p>&nbsp;</p><p><strong>Driving:</strong>&nbsp;This drug doesn’t affect your ability to drive.</p><p>&nbsp;</p><p><strong>Kidney:</strong> This drug should be used with caution in patients with kidney disease. Please consult your doctor&nbsp;if you have any kidney disease, before using this drug.</p><p>&nbsp;</p><p><strong>Liver:</strong>&nbsp;This drug should be used with caution in patients with severe liver disease. Inform your doctor if you have any liver illness, before using this drug.</p><p><strong>Children: </strong>A child\'s dose of this drug depends upon the age and weight of the child. Follow your doctor\'s dosing instructions very carefully. Do not give a child more than the prescribed dose of this drug.</p><p><strong>Other precautions:&nbsp;</strong></p><p>&nbsp;</p><ul><li>Don’t take this medicine, if you have an Allergy to Folic acid or Vitamin B9 or L-methyl folate or Vitamin B6 or Pyridoxin or Pyridoxal phosphate or Vitamin B12 or Adenosylcobalamin or Cyanocobalamin or Methylcobalamin or Mecobalamin or any other ingredients. Tell your doctor if you are allergic to any drugs.</li></ul><p>&nbsp;</p><ul><li>Tell your doctor if you have or ever had any history of kidney disease, liver disease, diabetes, heart disease, bleeding disorders, stomach/intestinal problems, Leber\'s disease or other form of optic nerve damage or low levels of potassium in your blood.</li></ul><p>&nbsp;</p><ul><li>Tell your doctor about all the medications you are taking for your previous ailments.&nbsp;</li></ul><p><strong>&nbsp;</strong></p><p><strong>DRUG INTERACTIONS</strong></p><p>Sometimes drugs are not safe when you take them with certain other drugs and food. Taking them together can cause bad side effects. Be sure to talk to your doctor about all the drugs you take.</p><p>Consult your doctor if you are taking this medicine with the following drugs:</p><p>Chloramphenicol, Neomycin, Nitrofurantoin, Pyrimethamine, Pantoprazole, Omeprazole, Ranitidine, Famotidine, Arsenic Trioxide, Methotrexate, Colchicine, Amino Salicylic Acid, Altretamine, Phenobarbital, Phenytoin, Primidone, Levodopa, Oral Contraceptives.</p><p><strong>STORAGE:</strong> Store in a cool, dry place away from the reach of children.&nbsp;Store below 30°C.</p><p><strong>&nbsp;</strong></p><p><strong>FAQs</strong></p><p>&nbsp;</p><p><strong>Q: What is&nbsp;this medicine? What is it used for?</strong></p><p>&nbsp;</p><p>A: This medicine is a combination of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12.&nbsp;It is used for treatment and prevention of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12 deficiency which may be due to nutritional causes or malabsorption. It is used in the management of anemia, neuropathies like diabetic neuropathy, alcoholic neuropathy, drug-induced neuropathy, trigeminal neuralgia, sciatica and optic neuritis. It also helps to reduce homocysteine levels in blood (hyperhomocysteinemia), the major factor for atherosclerosis. and help in preventing heart diseases, strokes and blood vessel disorders.&nbsp;</p><p>&nbsp;</p><p><strong>Q: Can&nbsp;this medicine be taken empty stomach?</strong></p><p>&nbsp;</p><p>A: It should be taken in the dose and duration as advised by your doctor. It may be taken with or without food. Do not chew, cut or break the medicine. Swallow it as a whole with a glass of water.</p><p>&nbsp;</p><p><strong>Q: Can I take other nutritional supplements along with his medicine?</strong></p><p>&nbsp;</p><p>A: No. You should avoid taking other nutritional supplements along with his medicine as it may lead to a vitamin overdose and side effects.</p><p>&nbsp;</p><p><strong>Q: Can I take antacids while using this medicine?</strong></p><p>&nbsp;</p><p>A: It is advised to take this medicine two hours before or four hours after taking antacids, as antacids may interfere with its absorption.</p><p>&nbsp;</p><p><strong>Q: What are the dietary sources of Folic acid (vitamin B9), Vitamin B6 and Vitamin B12?</strong></p><p>A: Dietary sources of folic acid are Dark green leafy vegetables (peas, turnip greens, spinach, romaine lettuce, asparagus, Brussels, sprouts, broccoli), beans, peanuts, sunflower seeds, fresh fruits, fruit juices, whole grains, liver, aquatic foods, eggs, fortified foods and supplements.</p><p>Dietary sources of vitamin B12 are primarily animal meat, fish, eggs, and dairy products.</p><p>Dietary sources of vitamin B6 are dark leafy greens, bananas, avocados, papayas, oranges, fortified cereals, nuts, beef liver, tuna, meat, salmon, chickpeas, poultry and cantaloupe.</p><p><strong>Q: Can&nbsp;this medicine be used during pregnancy?</strong></p><p>A:&nbsp;Though, it is generally considered safe to use during pregnancy, should be used only if clearly needed.&nbsp;Consult your doctor if you are pregnant before taking this medicine.</p><p><strong>Q: Can I stop taking this medicine if I feel well?</strong></p><p>A: No. You should continue taking this medicine for as long as your doctor has recommended it to achieve full benefit. Consult your doctor if you experience any difficulty while taking this medicine.</p><p><strong>Q: Is it safe to take&nbsp;this medicine for a long time?</strong></p><p>&nbsp;</p><p>A: It is unlikely to harm you if taken for a long time but should be used for as long as prescribed by your doctor.</p><p>&nbsp;</p><p><strong>Q: Does this medicine cause diarrhoea?</strong></p><p>A: Yes. This medicine may cause diarrhoea as a side effect. You should drink plenty of fluids, maintain hydration and eat non-spicy food, if you experience such side effect. Consult your doctor if you have severe diarrhoea or if you find blood in stools.</p><p><strong>&nbsp;</strong></p><p><strong>REFERENCES</strong></p><ul><li>CDSCO [Internet]. Cdscoonline.gov.in. 2023.</li><li>Vitamins and minerals - B vitamins and folic acid [Internet]. nhs.uk. 2023.</li><li>Folate (Folic Acid) – Vitamin B9 [Internet]. The Nutrition Source. 2023.</li><li>Vitamin B12 [Internet]. The Nutrition Source. 2023.</li><li>Office of Dietary Supplements - Vitamin B12 [Internet]. Ods.od.nih.gov. 2023.</li><li>B-Vitamins and Bone Health–A Review of the Current Evidence [Internet]. Ncbi.nlm.nih.gov. 2023.</li><li>Combs Jr. GF, McClung JP. The Vitamins: Fundamental Aspects in Nutrition and Health. 5th ed. Westborough, MA: Academic Press; 2017.</li><li>Vitamin B12 - Fact Sheet for Health Professionals [Internet]. Nccih.nih.gov. 2023.</li><li>Folate - Fact Sheet for Health Professionals [Internet]. Nccih.nih.gov. 2023.</li><li>Office of Dietary Supplements - Vitamin B6 [Internet]. Ods.od.nih.gov. 2023.</li><li>Coates PM, Betz JM, Blackman MR, et al. (Editors). Encyclopedia of Dietary Supplements. 2nd ed. Boca Raton, FL: CRC Press; 2010.</li><li>The Benefits Of Methylfolate [Internet]. Tespo Vitamins. 2023.</li></ul><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;</p><p><strong>Disclaimer:</strong></p><p>This information is solely intended to provide a general overview on the product that is it accurate and reliable, as it is reviewed by expert professionals. The information provided here is for informational purposes only. This information is not intended to replace or be a substitute for a registered medical practitioner\'s medical treatment/advice or consultation or create a doctor-patient relationship. This may not cover everything about particular health conditions, lab tests, medicines, all possible side effects, drug interactions, warnings, alerts, etc. You should not use this information to diagnose, prevent, or cure a health problem. Please consult your doctor and discuss all your queries or doubts related to any disease or medicine. You hereby agree that you shall not make any health or medical-related decision based in whole or in part on anything contained in the Site.</p>', 'PFIZER LIMITED', 'The Capital, 1802, 18th Floor , Plot No. C-70, ‘G’ Block , Bandra Kurla Complex, Bandra East , Mumbai – 400051.', 'No', 'folvite-mb-2', 'medicine', '0', '2023-11-29 01:22:50', '2023-11-29 01:25:34'),
(87, '', '1 TOOTH PASTE', 'null', 88.00, 10, 16, 6, NULL, 0, 'Yes', '', 'd-895411682841409.jpeg', '', '', '', 'null', 'null', 'May', '2027', 'COLGATE HERBAL TOOTH PASTE', '<p>Colgate Herbal Toothpaste, in the net quantity of 100gms, is enriched with the goodness of Chamomile, Myrrh, Eucalyptus and Sage, all of which work towards providing highly effective and complete oral care. This toothpaste cleans the food particles and other debris to keep your teeth clean always. It removes germs, thus keeping cavities at bay. It removes dental plaque and also prevents tooth decay. This product also revitalizes the breath, preventing bad mouth odour and keeping the mouth feeling fresh all day long.</p><h4>Benefits of Colgate Herbal Toothpaste</h4><ul><li>Enriched with Chamomile, Myrrh, Eucalyptus and Sage, which provide complete oral hygiene</li><li>Whitens the teeth</li><li>Provides healthy gums</li><li>Removes food particles and other debris, providing protection from germs</li><li>Prevents cavities and tooth decay</li><li>Removes dental plaque</li><li>Prevents bad mouth odour</li></ul><h4>Usage</h4><p>After rinsing the mouth with water, take a required amount of the Colgate Herbal Toothpaste onto a soft bristle toothbrush and brush the teeth vigorously with it, using small upward and downward circular motions, for ideally 3 minutes; at least 2 minutes. Wash off with water afterwards. For best results, use twice, daily.</p><p><br>&nbsp;</p>', 'COLGATE', 'COLGATE PALMOLIVE INDIA LTD, Plot No78,Epip Phase 1,Jharmajri,Baddi,Tehsil Nalagrah,Distt Solan H.P 174103', 'Yes', 'colgate-herbal-tooth-paste', 'other', '0', '2023-11-29 02:32:56', '2023-11-29 02:32:56'),
(88, '', '1 PACK OF 54 DIAPERS', 'null', 1399.00, 20, 16, 5, NULL, 0, 'Yes', '', 'd-511711690005800.jpeg', 'd-632271690005800.jpeg', 'd-933361690005800.jpeg', 'd-779891690005800.jpeg', 'null', 'null', 'Jun', '2026', 'PAMPERS PREMIUM CARE PANTS M', '<p>Pampers Premium Care Pants – M, in a pack of 54, are medium-sized baby diapers that comes with cotton-like soft top layer and air channels that prevent wetness, providing dryness for the longest time.</p><p>Pampers Premium Care Pants – M comes with a wetness indicator that turns from yellow to blue in order to indicate that it is the time to change the diaper. It also comes with a unique disposal tape that makes it easy to fold and dispose the diaper.</p><p><strong>Benefits of Pampers Premium Care Pants – M</strong></p><p>&nbsp;</p><ul><li>Soft top layer that keeps the baby comfortable</li><li>Air channels prevent wetness for the long hours</li><li>Wetness indicator turns from yellow to blue</li><li>Comes with a disposal tape that makes it easy to roll and dispose off the diaper</li></ul><h4>Usage</h4><p>Gently slip the baby into Pampers Premium Care Pants – M, making sure that the baby is comfortable with the fitting. When the wetness indicator turns from yellow to blue, indicate that it is time to change the diaper, gently remove the diaper and dispose the fecal matter into the toilet. Then, roll the diaper using the disposal tape and enclose it in a waste paper and dispose it in a waste paper basket.</p>', 'PAMPERS', 'PROCTER & GAMBLE, P&G PLAZA,CARDINAL GRACIAS ROAD,CHAKLA,ANDHERI(E),MUMBAI,MAHARASHTRA 400099', 'Yes', 'pampers-premium-care-pants-m-2', 'other', '0', '2023-11-29 02:34:46', '2023-11-29 02:34:46'),
